INSERT INTO `script_texts` VALUES (0, -1580103, 'Gaze now, mortals - upon the HEART OF M\'URU! Unblemished. Bathed by the light of Creation - just as it was at the Dawn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12520, 0, 0, 0, 'prophet velen - SAY5');
INSERT INTO `script_texts` VALUES (0, -1580102, 'Then fortunate it is, that I have reclaimed the noble naaru\'s spark from where it fell! Where faith dwells, hope is never lost, young blood elf.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12519, 0, 0, 0, 'prophet velen - SAY4');
INSERT INTO `script_texts` VALUES (0, -1580101, 'The creature Entropius, whom you were forced to destroy, was once the noble naaru, M\'uru. In life, M\'uru channeled vast energies of LIGHT and HOPE. For a time, a misguided few sought to steal those energies...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12518, 0, 0, 0, 'prophet velen - SAY3');
INSERT INTO `script_texts` VALUES (0, -1580100, 'As the Legion\'s final defeat draws ever-nearer, stand proud in the knowledge that you have saved worlds without number from the flame. Just as this day marks an ending, so too does it herald a new beginning...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12516, 0, 0, 0, 'prophet velen - SAY2');
INSERT INTO `script_texts` VALUES (0, -1580099, 'Mortal heroes, your victory here today was foretold long ago. My brother\'s anguished cry of defeat will echo across the universe, bringing renewed hope to all those who still stand against the Burning Crusade.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12515, 0, 0, 0, 'prophet velen - SAY1');
