INSERT INTO `script_texts` VALUES (0, -1000522, 'A-Me home! A-Me good! Good A-Me. Home. Home. Home.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_ame - SAY_FINISH');
