INSERT INTO `script_texts` VALUES (2768, -1000244, 'The blood elves laid down their weapons in front of the city\'s defenders; their leader, a blood elf elder known as Voren\'thal, stormed into the Terrace of Light and demanded to speak to A\'dal.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_10');
INSERT INTO `script_texts` VALUES (2768, -1000243, 'As the regiment of blood elves crossed this very bridge, the Aldor\'s exarchs and vindicators lined up to defend the Terrace of Light. But then the unexpected happened.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_9');
INSERT INTO `script_texts` VALUES (2768, -1000242, 'It wouldn\'t be long, however, before the city came under attack once again. This time, the attack came from Illidan\'s armies. A large regiment of blood elves had been sent by Illidan\'s ally, Kael\'thas Sunstrider, to lay waste to the city.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_8');
INSERT INTO `script_texts` VALUES (2768, -1000241, 'The priesthood, known as the Aldor, quickly regained its strength as word spread that the naaru had returned and reconstruction soon began. The ruined temple is now used as an infirmary for injured refugees.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_7');
INSERT INTO `script_texts` VALUES (2768, -1000240, 'They were drawn to the ruins of Shattrath City where a small remnant of the draenei priesthood conducted its rites inside a ruined temple on this very spot.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_6');
INSERT INTO `script_texts` VALUES (2768, -1000239, 'The Sha\'tar, or \"born from light\" are the naaru that came to Outland to fight the demons of the Burning Legion.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_5');
INSERT INTO `script_texts` VALUES (2768, -1000238, 'Let us go into the Lower City. I will warn you that as one of the only safe havens in Outland, Shattrath has attracted droves of refugees from all wars, current and past.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_4');
INSERT INTO `script_texts` VALUES (2768, -1000237, 'The city was left in ruins and darkness... until the Sha\'tar arrived.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_3');
INSERT INTO `script_texts` VALUES (2768, -1000236, 'When the Burning Legion turned the orcs against the draenei, the fiercest battle was fought here. The draenei fought tooth and nail, but in the end the city fell.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_2');
INSERT INTO `script_texts` VALUES (2768, -1000235, 'Shattrath was once the draenei capital of this world. Its name means \"dwelling of light.\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_1');
