INSERT INTO `script_texts` VALUES (10096, -1230008, 'Good riddance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'npc_grimstone SCRIPT_TEXT6');
