INSERT INTO `script_texts` VALUES (10162, -1469006, 'Ah, the heroes. You are persistent, aren\'t you. Your allied attempted to match his power against mine, and had to pay the price. Now he shall serve me, by slaughtering you. Get up little red wyrm and destroy them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8279, 1, 0, 0, 'victor_nefarius SAY_VAEL_INTRO');
INSERT INTO `script_texts` VALUES (10162, -1469005, 'Let the games begin!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8280, 1, 0, 0, 'victor_nefarius SAY_GAMESBEGIN_2');
INSERT INTO `script_texts` VALUES (10162, -1469004, 'In this world where time is your enemy, it is my greatest ally. This grand game of life that you think you play in fact plays you. To that I say...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'victor_nefarius SAY_GAMESBEGIN_1');
