INSERT INTO `script_texts` VALUES (10184, -1249004, '%s takes in a deep breath...', NULL, '% prend une grande inspiration...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'onyxia EMOTE_BREATH');
INSERT INTO `script_texts` VALUES (10184, -1249003, 'It seems you\'ll need another lesson, mortals!', NULL, 'Il semble que vous ayez besoin d\'une autre leçon, mortels, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 293, 'onyxia SAY_PHASE_3_TRANS');
INSERT INTO `script_texts` VALUES (10184, -1249002, 'This meaningless exertion bores me. I\'ll incinerate you all from above!', NULL, 'Cet exercice dénué de sens m\'ennuie. Je vais vous incinérer d\'un seul coup, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 254, 'onyxia SAY_PHASE_2_TRANS');
INSERT INTO `script_texts` VALUES (10184, -1249001, 'Learn your place mortal!', NULL, 'Restez à  votre place mortel !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'onyxia SAY_KILL');
INSERT INTO `script_texts` VALUES (10184, -1249000, 'How fortuitous. Usually, I must leave my lair to feed.', NULL, 'Quelle chance, ! D\'habitude, je dois quitter mon repaire pour me nourrir.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'onyxia SAY_AGGRO');
INSERT INTO `script_texts` VALUES (10427, -1000149, 'All mortals will perish!', NULL, 'Que les mortels périssent tous, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11334, 1, 0, 0, 'kazzak SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (10427, -1000148, 'The Legion will conquer all!', NULL, 'La Légion envahira l\'univers, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11333, 1, 0, 0, 'kazzak SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (10427, -1000147, 'I remember well the sting of defeat at the conclusion of the Third War. I have waited far too long for my revenge. Now the shadow of the Legion falls over this world. It is only a matter of time until all of your failed creation... is undone.', NULL, 'Je me rappelle bien le goût amer de la défaite à  la fin de la Troisième guerre. J\'ai attendu bien trop longtemps l\'occasion de me venger. Maintenant, l\'ombre de la Légion tombe sur cette terre. Votre création ratée sera bientôt! défaite. Ce n\'est qu\'une question de temps.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11332, 1, 0, 0, 'kazzak SAY_INTRO');
INSERT INTO `script_texts` VALUES (10638, -1000410, 'Here they come! Defend yourself!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 5, 'kanati SAY_KAN_START');
