INSERT INTO `script_texts` VALUES (11380, -1309014, 'Welcome to da great show friends! Step right up to die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8425, 1, 0, 0, 'jindo SAY_AGGRO');
INSERT INTO `script_texts` VALUES (11382, -1309019, 'Don\'t make me angry. You won\'t like it when I\'m angry.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'mandokir SAY_WATCH_WHISPER');
INSERT INTO `script_texts` VALUES (11382, -1309018, 'I\'m keeping my eye on you, $N!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'mandokir SAY_WATCH');
INSERT INTO `script_texts` VALUES (11382, -1309017, 'GRATS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'mandokir SAY_GRATS_JINDO');
