INSERT INTO `script_texts` VALUES (11502, -1409018, 'MY PATIENCE IS DWINDLING! COME, GNATS, TO YOUR DEATH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8048, 1, 0, 0, 'ragnaros SAY_MAGMABURST');
INSERT INTO `script_texts` VALUES (11502, -1409017, 'DIE INSECT!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8051, 1, 0, 0, 'ragnaros SAY_KILL');
INSERT INTO `script_texts` VALUES (11502, -1409016, 'TASTE THE FLAMES OF SULFURON!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8047, 1, 0, 0, 'ragnaros SAY_WRATH');
INSERT INTO `script_texts` VALUES (11502, -1409015, 'BY FIRE BE PURGED!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8046, 1, 0, 0, 'ragnaros SAY_HAND');
INSERT INTO `script_texts` VALUES (11502, -1409014, 'YOU CANNOT DEFEAT THE LIVING FLAME! COME YOU MINIONS OF FIRE! COME FORTH YOU CREATURES OF HATE! YOUR MASTER CALLS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8050, 1, 0, 0, 'ragnaros SAY_REINFORCEMENTS2');
INSERT INTO `script_texts` VALUES (11502, -1409013, 'COME FORTH, MY SERVANTS! DEFEND YOUR MASTER!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8049, 1, 0, 0, 'ragnaros SAY_REINFORCEMENTS1');
INSERT INTO `script_texts` VALUES (11583, -1469021, 'Rogues? Stop hiding and face me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_ROGUE');
INSERT INTO `script_texts` VALUES (11583, -1469020, 'Hunters and your annoying pea-shooters!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_HUNTER');
INSERT INTO `script_texts` VALUES (11583, -1469019, 'Warlocks, you shouldn\'t be playing with magic you don\'t understand. See what happens?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_WARLOCK');
INSERT INTO `script_texts` VALUES (11583, -1469018, 'Shamans, show me what your totems can do!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_SHAMAN');
INSERT INTO `script_texts` VALUES (11583, -1469017, 'Paladins, I\'ve heard you have many lives. Show me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_PALADIN');
INSERT INTO `script_texts` VALUES (11583, -1469016, 'Priests! If you\'re going to keep healing like that, we might as well make it a little more interesting!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_PRIEST');
INSERT INTO `script_texts` VALUES (11583, -1469015, 'Druids and your silly shapeshifting. Let\'s see it in action!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_DRUID');
INSERT INTO `script_texts` VALUES (11583, -1469014, 'Warriors, I know you can hit harder than that! Let\'s see it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_WARRIOR');
INSERT INTO `script_texts` VALUES (11583, -1469013, 'Mages too? You should be more careful when you play with magic...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nefarian SAY_MAGE');
INSERT INTO `script_texts` VALUES (11583, -1469012, 'This cannot be! I am the Master here! You mortals are nothing to my kind! DO YOU HEAR? NOTHING!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8292, 1, 0, 0, 'nefarian SAY_DEATH');
INSERT INTO `script_texts` VALUES (11583, -1469011, 'Worthless $N! Your friends will join you soon enough!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8293, 1, 0, 0, 'nefarian SAY_SLAY');
INSERT INTO `script_texts` VALUES (11583, -1469010, 'Impossible! Rise my minions! Serve your master once more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8291, 1, 0, 0, 'nefarian SAY_RAISE_SKELETONS');
INSERT INTO `script_texts` VALUES (11583, -1469009, 'Burn, you wretches! Burn!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8290, 1, 0, 0, 'nefarian SAY_SHADOWFLAME');
INSERT INTO `script_texts` VALUES (11583, -1469008, 'Enough! Now you vermin shall feel the force of my birthright, the fury of the earth itself.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8289, 1, 0, 0, 'nefarian SAY_XHEALTH');
INSERT INTO `script_texts` VALUES (11583, -1469007, 'Well done, my minions. The mortals\' courage begins to wane! Now, let\'s see how they contend with the true Lord of Blackrock Spire!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8288, 1, 0, 0, 'nefarian SAY_AGGRO');
INSERT INTO `script_texts` VALUES (11856, -1000349, 'Hey, look out with that kodo! You had better inspect that beast before I give you credit!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'kodo round SAY_SMEED_HOME_2');
INSERT INTO `script_texts` VALUES (11856, -1000348, 'Ah...the wondrous sound of kodos. I love the way they make the ground shake... inspect the beast for me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'kodo round SAY_SMEED_HOME_1');
INSERT INTO `script_texts` VALUES (11856, -1000347, 'We\'re almost to the refuge! Let\'s go.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'kayra SAY_END');
INSERT INTO `script_texts` VALUES (11981, -1469031, 'goes into a frenzy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'flamegor EMOTE_FRENZY');
