INSERT INTO `script_texts` VALUES (12017, -1469000, 'None of your kind should be here! You\'ve doomed only yourselves!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8286, 1, 0, 0, 'broodlord SAY_AGGRO');
INSERT INTO `script_texts` VALUES (12018, -1409012, 'NOW FOR YOU, INSECTS. BOLDLY YOU SAUGHT THE POWER OF RAGNAROS NOW YOU SHALL SEE IT FIRST HAND.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8045, 1, 0, 0, 'ragnaros SAY_ARRIVAL5_RAG');
INSERT INTO `script_texts` VALUES (12018, -1409011, 'FOOL! YOU ALLOWED THESE INSECTS TO RUN RAMPANT THROUGH THE HALLOWED CORE, AND NOW YOU LEAD THEM TO MY VERY LAIR? YOU HAVE FAILED ME, EXECUTUS! JUSTICE SHALL BE MET, INDEED!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8044, 1, 0, 0, 'ragnaros SAY_ARRIVAL3_RAG');
INSERT INTO `script_texts` VALUES (12018, -1409010, 'These mortal infidels, my lord! They have invaded your sanctum, and seek to steal your secrets!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8041, 1, 0, 0, 'ragnaros SAY_ARRIVAL2_MAJ');
INSERT INTO `script_texts` VALUES (12018, -1409009, 'TOO SOON! YOU HAVE AWAKENED ME TOO SOON, EXECUTUS! WHAT IS THE MEANING OF THIS INTRUSION?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8043, 1, 0, 0, 'ragnaros SAY_ARRIVAL1_RAG');
INSERT INTO `script_texts` VALUES (12018, -1409008, 'Behold Ragnaros, the Firelord! He who was ancient when this world was young! Bow before him, mortals! Bow before your ending!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8040, 1, 0, 0, 'ragnaros SAY_SUMMON_MAJ');
INSERT INTO `script_texts` VALUES (12018, -1409007, 'Impossible! Stay your attack mortals! I submitt! I submitt! Brashly you have come to rest the secrets of the living flame. You will soon regret the recklessness of your quest. I go now to summon the lord whos house this is. Should you seek an audiance with him your paltry lives will surly be forfit. Nevertheless seek out his lair if you dare!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8038, 1, 0, 0, 'majordomo SAY_DEFEAT');
INSERT INTO `script_texts` VALUES (12018, -1409006, 'Burn mortals! Burn for this transgression!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8036, 1, 0, 0, 'majordomo SAY_SPECIAL');
INSERT INTO `script_texts` VALUES (12018, -1409005, 'Ashes to Ashes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8037, 1, 0, 0, 'majordomo SAY_SLAY');
INSERT INTO `script_texts` VALUES (12018, -1409004, 'The runes of warding have been destroyed! Hunt down the infedels my bretheren.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8039, 1, 0, 0, 'majordomo SAY_SPAWN');
INSERT INTO `script_texts` VALUES (12018, -1409003, 'Reckless mortals, none may challenge the sons of the living flame!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8035, 1, 0, 0, 'majordomo SAY_AGGRO');
INSERT INTO `script_texts` VALUES (12056, -1409000, '%s performs one last service for Ragnaros.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'geddon EMOTE_SERVICE');
INSERT INTO `script_texts` VALUES (12429, -1000173, 'NOOOOooooooo!', NULL, 'NOOOOooooooonnnn !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nether_drake SAY_NIHIL_INTERRUPT');
INSERT INTO `script_texts` VALUES (12429, -1000172, 'No doubt the fools that banished me are long dead. I shall take wing survey my demense. Pray to whatever gods you hold dear that we do not meet again.', NULL, 'Sans doute que les imbéciles qui m\'ont exclu sont déjà  morts. Je vais surveiller ma demeure depuis les airs. Priez votre dieu afin que nous ne nous rencontrions pas à  nouveau.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nether_drake SAY_NIHIL_4');
INSERT INTO `script_texts` VALUES (12429, -1000171, 'Where shall I begin? I cannot bother myself with a worm such as yourself. There is a world to be conquered!', NULL, 'Par où vais-je commencer ? Je ne peux pas perdre de temps avec un ver comme vous. Il y a un monde à  conquérir !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nether_drake SAY_NIHIL_3');
INSERT INTO `script_texts` VALUES (12429, -1000170, 'All of Draenor shall quick beneath my feet! I will destroy this world and reshape it in my image!', NULL, 'Tout Draenor gisera rapidement sous mes pieds ! Je vais détruire ce monde et le remodeler à  mon image !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nether_drake SAY_NIHIL_2');
INSERT INTO `script_texts` VALUES (12429, -1000169, 'Muahahahaha! You fool! You\'ve released me from my banishment in the interstices between space and time!', NULL, 'Muahahahaha ! Pauvre imbécile ! Vous m\'avez libéré de mon bannissement dans l\'interstice de l\'espace et du temps !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'nether_drake SAY_NIHIL_1');
INSERT INTO `script_texts` VALUES (12429, -1000168, 'Who dares awaken Aquementas?', NULL, 'Qui ose réveiller Aquementas ?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'aquementas AGGRO_YELL_AQUE');
INSERT INTO `script_texts` VALUES (12429, -1000167, 'System failure in five, f-o-u-r...', NULL, 'Panne système dans cinq, q-u-a-t-r-e...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11352, 1, 0, 0, 'doomwalker SAY_DEATH');
INSERT INTO `script_texts` VALUES (12429, -1000166, 'Target exterminated.', NULL, 'Cible exterminée.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11351, 1, 0, 0, 'doomwalker SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (12429, -1000165, 'Directive accomplished.', NULL, 'Instruction exécutée.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11350, 1, 0, 0, 'doomwalker SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (12429, -1000164, 'Threat level zero.', NULL, 'Niveau de menace nul.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11349, 1, 0, 0, 'doomwalker SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (12435, -1469025, 'If I fall into the abyss I\'ll take all of you mortals with me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8278, 1, 0, 0, 'razorgore SAY_DEATH');
INSERT INTO `script_texts` VALUES (12435, -1469024, 'No! Not another one! I\'ll have your heads for this atrocity.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8277, 1, 0, 0, 'razorgore SAY_EGGS_BROKEN3');
INSERT INTO `script_texts` VALUES (12435, -1469023, 'Fools! These eggs are more precious than you know.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8276, 1, 0, 0, 'razorgore SAY_EGGS_BROKEN2');
INSERT INTO `script_texts` VALUES (12435, -1469022, 'You\'ll pay for forcing me to do this.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8275, 1, 0, 0, 'razorgore SAY_EGGS_BROKEN1');
INSERT INTO `script_texts` VALUES (12717, -1800063, 'Please return to Zoram\'gar and report our success to the Warsong runner.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_RETURN');
INSERT INTO `script_texts` VALUES (12717, -1800062, 'I am going to patrol the area for a while longer and ensure that things are truly safe.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_PATROL');
INSERT INTO `script_texts` VALUES (12717, -1800061, 'You have my deepest gratitude. I thank you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_GRATITUDE');
INSERT INTO `script_texts` VALUES (12717, -1800060, 'We have done it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_DONE');
INSERT INTO `script_texts` VALUES (12717, -1800059, 'Perhaps we will get a moment to rest. But I will not give up until we have faced off against Vorsha!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_REST');
INSERT INTO `script_texts` VALUES (12717, -1800058, 'Be on your guard, $N!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_ON_GUARD');
INSERT INTO `script_texts` VALUES (12717, -1800057, 'Now we must wait. It won\'t be long before the naga realize what we have done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_BRAZIER_WAIT');
INSERT INTO `script_texts` VALUES (12717, -1800056, 'This is the brazier, $N. Put it out. Vorsha is a beast, worthy of praise from no one!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_BRAZIER');
INSERT INTO `script_texts` VALUES (12717, -1800055, 'This will be a though fight, $N. Follow me closely.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_START2');
INSERT INTO `script_texts` VALUES (12717, -1800054, 'Are you sure that you are ready? If we do not have a group of your allies to aid us, we will surely fail.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'muglash SAY_MUG_START1');
INSERT INTO `script_texts` VALUES (12858, -1000110, 'Go report that the outpost is taken. We will remain here.', NULL, 'Allez faire votre rapport, et dites que l\'avant-poste est à  nous. Nous, nous resterons ici.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'torek SAY_END');
INSERT INTO `script_texts` VALUES (12858, -1000109, 'Silverwing is ours!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'torek SAY_WIN');
INSERT INTO `script_texts` VALUES (12858, -1000108, 'Prepare yourselves. Silverwing is just around the bend.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'torek SAY_PREPARE');
INSERT INTO `script_texts` VALUES (12858, -1000107, 'Ok, Lets move out!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'torek SAY_MOVE');
INSERT INTO `script_texts` VALUES (12858, -1000106, 'Everyone ready?', NULL, 'Tout le monde est prêt ?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'torek SAY_READY');
INSERT INTO `script_texts` VALUES (13020, -1469030, 'Forgive me $N, your death only adds to my failure.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8284, 1, 0, 0, 'vaelastrasz SAY_KILLTARGET');
INSERT INTO `script_texts` VALUES (13020, -1469029, 'Nefarius\' hate has made me stronger than ever before. You should have fled, while you could, mortals! The fury of Blackrock courses through my veins!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8285, 1, 0, 0, 'vaelastrasz SAY_HALFLIFE');
INSERT INTO `script_texts` VALUES (13020, -1469028, 'FLAME! DEATH! DESTRUCTION! COWER MORTALS BEFORE THE WRATH OF LORD....NO! I MUST FIGHT THIS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8283, 1, 0, 0, 'vaelastrasz SAY_LINE3');
INSERT INTO `script_texts` VALUES (13020, -1469027, 'I beg you Mortals, flee! Flee before I lose all control. The Black Fire rages within my heart. I must release it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8282, 1, 0, 0, 'vaelastrasz SAY_LINE2');
INSERT INTO `script_texts` VALUES (13020, -1469026, 'Too late...friends. Nefarius\' corruption has taken hold. I cannot...control myself.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8281, 1, 0, 0, 'vaelastrasz SAY_LINE1');
INSERT INTO `script_texts` VALUES (14020, -1469003, 'flinches as its skin shimmers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'chromaggus EMOTE_SHIMMER');
INSERT INTO `script_texts` VALUES (14020, -1469002, 'goes into a killing frenzy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'chromaggus EMOTE_FRENZY');
INSERT INTO `script_texts` VALUES (14507, -1309001, 'Ssserenity..at lassst!', NULL, 'La ssssérénité. Enfffffin, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'venoxis SAY_DEATH');
INSERT INTO `script_texts` VALUES (14507, -1309000, 'Let the coils of hate unfurl!', NULL, 'Que se déroulent les anneaux de la haine, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8421, 1, 0, 0, 'venoxis SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES (14509, -1309010, 'Hakkar binds me no more! Peace at last!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8424, 1, 0, 0, 'thekal SAY_DEATH');
INSERT INTO `script_texts` VALUES (14509, -1309009, 'Shirvallah, fill me with your RAGE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8419, 1, 0, 0, 'thekal SAY_AGGRO');
INSERT INTO `script_texts` VALUES (14510, -1309008, 'Bless you mortal for this release. Hakkar controls me no longer...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8423, 1, 0, 0, 'marli SAY_DEATH');
INSERT INTO `script_texts` VALUES (14510, -1309007, 'Aid me my brood!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'marli SAY_SPIDER_SPAWN');
INSERT INTO `script_texts` VALUES (14510, -1309006, 'Shadra, make of me your avatar!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'marli SAY_TRANSFORM');
INSERT INTO `script_texts` VALUES (14510, -1309005, 'Draw me to your web mistress Shadra. Unleash your venom!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8418, 1, 0, 0, 'marli SAY_AGGRO');
INSERT INTO `script_texts` VALUES (14515, -1309013, 'At last, I am free of the Soulflayer!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8412, 1, 0, 0, 'arlokk SAY_DEATH');
INSERT INTO `script_texts` VALUES (14515, -1309012, 'Feast on $n, my pretties!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'arlokk SAY_FEAST_PANTHER');
INSERT INTO `script_texts` VALUES (14515, -1309011, 'Bethekk, your priestess calls upon your might!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8416, 1, 0, 0, 'arlokk SAY_AGGRO');
INSERT INTO `script_texts` VALUES (14517, -1309004, 'Finally ...death. Curse you Hakkar! Curse you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8422, 1, 0, 0, 'jeklik SAY_DEATH');
INSERT INTO `script_texts` VALUES (14517, -1309003, 'I command you to rain fire down upon these invaders!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'jeklik SAY_RAIN_FIRE');
INSERT INTO `script_texts` VALUES (14517, -1309002, 'Lord Hir\'eek, grant me wings of vengance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8417, 1, 0, 0, 'jeklik SAY_AGGRO');
INSERT INTO `script_texts` VALUES (14834, -1309023, 'Minions of Hakkar, hear your God. The sanctity of this temple has been compromised. Invaders encroach upon holy ground! The Altar of Blood must be protected. Kill them all!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'hakkar SAY_PROTECT_ALTAR');
INSERT INTO `script_texts` VALUES (14834, -1309022, 'You dare set foot upon Hakkari holy ground? Minions of Hakkar, destroy the infidels!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'hakkar SAY_MINION_DESTROY');
INSERT INTO `script_texts` VALUES (14834, -1309021, 'Fleeing will do you no good, mortals!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'hakkar SAY_FLEEING');
INSERT INTO `script_texts` VALUES (14834, -1309020, 'PRIDE HERALDS THE END OF YOUR WORLD. COME, MORTALS! FACE THE WRATH OF THE SOULFLAYER!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8414, 1, 0, 0, 'hakkar SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15263, -1531007, 'You only delay... the inevetable.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8622, 1, 0, 0, 'skeram SAY_DEATH');
INSERT INTO `script_texts` VALUES (15263, -1531006, 'Prepare for the return of the ancient ones!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8618, 1, 0, 0, 'skeram SAY_SPLIT');
INSERT INTO `script_texts` VALUES (15263, -1531005, 'The screams of the dying will fill the air. A symphony of terror is about to begin!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8620, 1, 0, 0, 'skeram SAY_SLAY3');
INSERT INTO `script_texts` VALUES (15263, -1531004, 'Spineless wretches! You will drown in rivers of blood!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8619, 1, 0, 0, 'skeram SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15263, -1531003, 'Let your death serve as an example!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8617, 1, 0, 0, 'skeram SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15263, -1531002, 'Tremble! The end is upon you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8621, 1, 0, 0, 'skeram SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15263, -1531001, 'Cower mortals! The age of darkness is at hand.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8616, 1, 0, 0, 'skeram SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15263, -1531000, 'Are you so eager to die? I would be happy to accomodate you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8615, 1, 0, 0, 'skeram SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15378, -1350030, 'glances at her compatriots.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 2, 'MERITHRA_EMOTE_1');
INSERT INTO `script_texts` VALUES (15378, -1350029, 'Succumb to the endless dream, little ones. Let it consume you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 53, 'MERITHRA_YELL_1');
INSERT INTO `script_texts` VALUES (15378, -1350028, 'We will push them back, Anachronos. This I vow. Uphold the end of this task. Let not your hands falter as you seal our fates behind the barrier.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'MERITHRA_SAY_2');
INSERT INTO `script_texts` VALUES (15378, -1350027, 'There is a way...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'MERITHRA_SAY_1');
INSERT INTO `script_texts` VALUES (15379, -1350023, 'Alexstrasza grant me the resolve to drive our enemies back!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 53, 'CAELESTRASZ_YELL_1');
INSERT INTO `script_texts` VALUES (15379, -1350022, 'Do not forget the sacrifices made on this day, night elf. We have all suffered immensely at the hands of these beasts.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'CAELESTRASZ_SAY_2');
INSERT INTO `script_texts` VALUES (15379, -1350021, 'Aye, Fandral, remember these words: Let not your grief guide your faith. These thoughts you hold... dark places you go, night elf. Absolution cannot be had through misguided vengeance.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'CAELESTRASZ_SAY_1');
INSERT INTO `script_texts` VALUES (15380, -1350026, 'nods knowingly.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 273, 'ARYGOS_EMOTE_1');
INSERT INTO `script_texts` VALUES (15380, -1350025, 'Let them feel the wrath of the Blue Flight! May Malygos protect me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 53, 'ARYGOS_YELL_1');
INSERT INTO `script_texts` VALUES (15380, -1350024, 'This distraction will give you and the young druid time enough to seal the gate. Do not falter. Now, let us see how they deal with chaotic magic.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ARYGOS_SAY_1');
INSERT INTO `script_texts` VALUES (15381, -1350012, 'kneels down to pick up the fragments of the shattered scepter.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 87, 'ANACHRONOS_EMOTE_3');
INSERT INTO `script_texts` VALUES (15381, -1350011, 'shakes his head in dissapointment.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 274, 'ANACHRONOS_EMOTE_2');
INSERT INTO `script_texts` VALUES (15381, -1350010, 'hands the Scepter of the Shifting Sands to Fandral Staghelm.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 1, 'ANACHRONOS_EMOTE_1');
INSERT INTO `script_texts` VALUES (15381, -1350009, 'And now you know all that there is to know, mortal...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_10');
INSERT INTO `script_texts` VALUES (15381, -1350008, 'Lord Staghelm, where are you going? You would shatter our bond for the sake of pride?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_9');
INSERT INTO `script_texts` VALUES (15381, -1350007, 'Before I leave this place, I make one final offreing to you, Lord Staghelm. Should a time arise in which you must gain entry to this accursed fortress, use the Scepter of the Shifting Sands on the sacred gong. The magic holding the barrier together will dissipate and the horrors of Ahn\'Qiraj will be unleashed upon the world once more.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_8');
INSERT INTO `script_texts` VALUES (15381, -1350006, 'There is but one duty that remains...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_7');
INSERT INTO `script_texts` VALUES (15381, -1350005, 'It... It is over, Lord Staghelm. We are victorious. Albeit the cost for this victory was great.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_6');
INSERT INTO `script_texts` VALUES (15381, -1350004, 'FINISH THE SPELL STAGHELM! I CANNOT HOLD THE GLYPHS OF WARDING IN PLACE MUCH LONGER! CALL FORTH THE ROOTS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 53, 'ANACHRONOS_SAY_5');
INSERT INTO `script_texts` VALUES (15381, -1350003, 'The sands of time will halt, but only for a moment! I will now conjure the barrier.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_4');
INSERT INTO `script_texts` VALUES (15381, -1350002, 'Stay close...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_3');
INSERT INTO `script_texts` VALUES (15381, -1350001, 'NOW, STAGHELM! WE GO NOW! Prepare your magic!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 81, 'ANACHRONOS_SAY_2');
INSERT INTO `script_texts` VALUES (15381, -1350000, 'We must act quickly or all shall be lost!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'ANACHRONOS_SAY_1');
INSERT INTO `script_texts` VALUES (15382, -1350020, 'hurls the Scepter of the Shifting Sands into the barrier, shattering it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'FANDRAL_EMOTE_2');
INSERT INTO `script_texts` VALUES (15382, -1350019, 'falls to one knee - exhausted.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 16, 'FANDRAL_EMOTE_1');
INSERT INTO `script_texts` VALUES (15382, -1350018, 'My son\'s soul will find no comfort in this hollow victory, dragon. I will have him back.Thought it takes a millennia, I WILL have my son back!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 254, 'FANDRAL_SAY_6');
INSERT INTO `script_texts` VALUES (15382, -1350017, 'I want nothing to do with Silithus, the Qiraji and least of all, any damned dragons!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'FANDRAL_SAY_5');
INSERT INTO `script_texts` VALUES (15382, -1350016, 'After the savagery that my people have witnessed and felt, you expect me to accept another burden, dragon? Surely you are mad.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 25, 'FANDRAL_SAY_4');
INSERT INTO `script_texts` VALUES (15382, -1350015, 'Ancient ones guide my hand... Wake from your slumber! WAKE AND SEAL THIS CURSED PLACE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'FANDRAL_SAY_3');
INSERT INTO `script_texts` VALUES (15382, -1350014, 'It is done dragon. Lead the way...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'FANDRAL_SAY_2');
INSERT INTO `script_texts` VALUES (15382, -1350013, 'My forces cannot overcome the Qiraji defenses. We will not be able to get close enough to place your precious barrier, dragon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'FANDRAL_SAY_1');
INSERT INTO `script_texts` VALUES (15420, -1000282, 'Begone from this place!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'clintar SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES (15420, -1000281, 'The Emerald Dream will never be yours!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'clintar SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES (15420, -1000210, 'What manner of trick is this, $R? If you seek to ambush me, I warn you I will not go down quietly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'anvilward SAY_ANVIL2');
INSERT INTO `script_texts` VALUES (15420, -1000209, 'Very well. Let\'s see what you have to show me, $N.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'anvilward SAY_ANVIL1');
INSERT INTO `script_texts` VALUES (15516, -1531010, 'I serve to the last!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8648, 1, 0, 0, 'sartura SAY_DEATH');
INSERT INTO `script_texts` VALUES (15516, -1531009, 'I sentence you to death!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8647, 1, 0, 0, 'sartura SAY_SLAY');
INSERT INTO `script_texts` VALUES (15516, -1531008, 'You will be judged for defiling these sacred grounds! The laws of the Ancients will not be challenged! Trespassers will be annihilated!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8646, 1, 0, 0, 'sartura SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15550, -1532010, 'Amateurs! Do not think you can best me! I kill for a living.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9304, 1, 0, 0, 'attumen SAY_RANDOM2');
INSERT INTO `script_texts` VALUES (15550, -1532009, 'Such easy sport.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9170, 1, 0, 0, 'attumen SAY_RANDOM1');
INSERT INTO `script_texts` VALUES (15550, -1532008, 'I always knew... someday I would become... the hunted.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9165, 1, 0, 0, 'attumen SAY_DEATH');
INSERT INTO `script_texts` VALUES (15550, -1532007, 'Weapons are merely a convenience for a warrior of my skill!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9166, 1, 0, 0, 'attumen SAY_DISARMED');
INSERT INTO `script_texts` VALUES (15550, -1532006, 'Another trophy to add to my collection!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9300, 1, 0, 0, 'attumen SAY_KILL2');
INSERT INTO `script_texts` VALUES (15550, -1532005, 'It was... inevitable.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9169, 1, 0, 0, 'attumen SAY_KILL1');
INSERT INTO `script_texts` VALUES (15608, -1269028, 'Gul\'dan speaks the truth! We should return at once to tell our brothers of the news! Retreat back trought the portal!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'medivh SAY_ORCS_ANSWER');
INSERT INTO `script_texts` VALUES (15608, -1269027, 'Orcs of the Horde! This portalis the gateway to your new destiny! Azeroth lies before you, ripe for the taking!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'medivh SAY_ORCS_ENTER');
INSERT INTO `script_texts` VALUES (15608, -1269026, 'I am grateful for your aid, champions. Now, Gul\'dan\'s Horde will sweep across this world, like a locust swarm, and all my designs, all my carefully laid plans will at last fall into place.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10440, 1, 0, 0, 'medivh SAY_WIN');
INSERT INTO `script_texts` VALUES (15608, -1269025, 'No... damn this feeble mortal coil...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10441, 1, 0, 0, 'medivh SAY_DEATH');
INSERT INTO `script_texts` VALUES (15608, -1269024, 'The shield is nearly gone! All that I have worked for is in danger!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10439, 1, 0, 0, 'medivh SAY_WEAK25');
INSERT INTO `script_texts` VALUES (15608, -1269023, 'My powers must be concentrated on the portal! I do not have time to hold the shield!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10438, 1, 0, 0, 'medivh SAY_WEAK50');
INSERT INTO `script_texts` VALUES (15608, -1269022, 'Champions, my shield grows weak!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10437, 1, 0, 0, 'medivh SAY_WEAK75');
INSERT INTO `script_texts` VALUES (15608, -1269021, 'What is this? Champions, coming to my aid? I sense the hand of the dark one in this. Truly this sacred event bears his blessing?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10436, 1, 0, 0, 'medivh SAY_INTRO');
INSERT INTO `script_texts` VALUES (15608, -1269020, 'The time has come! Gul\'dan, order your warlocks to double their efforts! Moments from now the gateway will open, and your Horde will be released upon this ripe, unsuspecting world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10435, 1, 0, 0, 'medivh SAY_ENTER');
INSERT INTO `script_texts` VALUES (15687, -1532017, 'How terribly clumsy of me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9213, 1, 0, 0, 'moroes SAY_DEATH');
INSERT INTO `script_texts` VALUES (15687, -1532016, 'I\'ve gone and made a mess.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9315, 1, 0, 0, 'moroes SAY_KILL_3');
INSERT INTO `script_texts` VALUES (15687, -1532015, 'Time... Never enough time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9314, 1, 0, 0, 'moroes SAY_KILL_2');
INSERT INTO `script_texts` VALUES (15687, -1532014, 'One more for dinner this evening.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9214, 1, 0, 0, 'moroes SAY_KILL_1');
INSERT INTO `script_texts` VALUES (15687, -1532013, 'You rang?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9316, 1, 0, 0, 'moroes SAY_SPECIAL_2');
INSERT INTO `script_texts` VALUES (15687, -1532012, 'Now, where was I? Oh yes...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9215, 1, 0, 0, 'moroes SAY_SPECIAL_1');
INSERT INTO `script_texts` VALUES (15687, -1532011, 'Hmm, unannounced visitors? Preparations must be made.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9211, 1, 0, 0, 'moroes SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15688, -1532072, 'Gather, my pets. There is plenty for all.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9331, 1, 0, 0, 'terestian SAY_SUMMON2');
INSERT INTO `script_texts` VALUES (15688, -1532071, 'Come, you dwellers in the dark. Rally to my call!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9265, 1, 0, 0, 'terestian SAY_SUMMON1');
INSERT INTO `script_texts` VALUES (15688, -1532070, 'Let the sacrifice serve his testament to my fealty.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9330, 1, 0, 0, 'terestian SAY_SACRIFICE2');
INSERT INTO `script_texts` VALUES (15688, -1532069, 'Please, accept this humble offering, oh great one.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9263, 1, 0, 0, 'terestian SAY_SACRIFICE1');
INSERT INTO `script_texts` VALUES (15688, -1532068, 'Ah, you\'re just in time. The rituals are about to begin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9260, 1, 0, 0, 'terestian SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15688, -1532067, 'My life, is yours. Oh great one.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9262, 1, 0, 0, 'terestian SAY_DEATH');
INSERT INTO `script_texts` VALUES (15688, -1532066, 'The great one will be pleased.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9329, 1, 0, 0, 'terestian SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15688, -1532065, 'Your blood will anoint my circle.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9264, 1, 0, 0, 'terestian SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15689, -1532090, 'goes into a nether-fed rage!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'netherspite EMOTE_PHASE_BANISH');
INSERT INTO `script_texts` VALUES (15689, -1532089, 'cries out in withdrawal, opening gates to the warp.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'netherspite EMOTE_PHASE_PORTAL');
INSERT INTO `script_texts` VALUES (15690, -1532102, 'I refuse to concede defeat. I am a prince of the Eredar! I am...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9221, 1, 0, 0, 'malchezaar SAY_DEATH');
INSERT INTO `script_texts` VALUES (15690, -1532101, 'You face not Malchezaar alone, but the legions I command!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9322, 1, 0, 0, 'malchezaar SAY_SUMMON2');
INSERT INTO `script_texts` VALUES (15690, -1532100, 'All realities, all dimensions are open to me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9224, 1, 0, 0, 'malchezaar SAY_SUMMON1');
INSERT INTO `script_texts` VALUES (15690, -1532099, 'You are, but a plaything, unfit even to amuse.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9319, 1, 0, 0, 'malchezaar SAY_SLAY3');
INSERT INTO `script_texts` VALUES (15690, -1532098, 'Your greed, your foolishness has brought you to this end.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9318, 1, 0, 0, 'malchezaar SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15690, -1532097, 'Surely you did not think you could win.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9222, 1, 0, 0, 'malchezaar SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15690, -1532096, 'How can you hope to withstand against such overwhelming power?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9321, 1, 0, 0, 'malchezaar SAY_SPECIAL3');
INSERT INTO `script_texts` VALUES (15690, -1532095, 'The cerestial forces are mine to manipulate.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9320, 1, 0, 0, 'malchezaar SAY_SPECIAL2');
INSERT INTO `script_texts` VALUES (15690, -1532094, 'Who knows what secrets hide in the dark.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9223, 1, 0, 0, 'malchezaar SAY_SPECIAL1');
INSERT INTO `script_texts` VALUES (15690, -1532093, 'I see the subtlety of conception is beyond primitives such as you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9317, 1, 0, 0, 'malchezaar SAY_AXE_TOSS2');
INSERT INTO `script_texts` VALUES (15690, -1532092, 'Simple fools! Time is the fire in which you\'ll burn!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9220, 1, 0, 0, 'malchezaar SAY_AXE_TOSS1');
INSERT INTO `script_texts` VALUES (15690, -1532091, 'Madness has brought you here to me. I shall be your undoing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9218, 1, 0, 0, 'malchezaar SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15691, -1532064, 'This Curator is no longer op... er... ation... al.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9184, 1, 0, 0, 'curator SAY_DEATH');
INSERT INTO `script_texts` VALUES (15691, -1532063, 'You are not a guest.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9308, 1, 0, 0, 'curator SAY_KILL2');
INSERT INTO `script_texts` VALUES (15691, -1532062, 'Do not touch the displays.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9187, 1, 0, 0, 'curator SAY_KILL1');
INSERT INTO `script_texts` VALUES (15691, -1532061, 'Failure to comply will result in offensive action.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9185, 1, 0, 0, 'curator SAY_ENRAGE');
INSERT INTO `script_texts` VALUES (15691, -1532060, 'Your request cannot be processed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9186, 1, 0, 0, 'curator SAY_EVOCATE');
INSERT INTO `script_texts` VALUES (15691, -1532059, 'This curator is equipped for gallery protection.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9309, 1, 0, 0, 'curator SAY_SUMMON2');
INSERT INTO `script_texts` VALUES (15691, -1532058, 'Gallery rules will be strictly enforced.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9188, 1, 0, 0, 'curator SAY_SUMMON1');
INSERT INTO `script_texts` VALUES (15691, -1532057, 'The Menagerie is for guests only.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9183, 1, 0, 0, 'curator SAY_AGGRO');
INSERT INTO `script_texts` VALUES (15727, -1531011, 'is weakened!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'cthun EMOTE_WEAKENED');
INSERT INTO `script_texts` VALUES (15928, -1533035, 'Thank... you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8870, 1, 0, 0, 'thaddius SAY_DEATH');
INSERT INTO `script_texts` VALUES (15928, -1533033, 'You die now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8877, 1, 0, 0, 'thaddius SAY_SLAY');
INSERT INTO `script_texts` VALUES (15928, -1533032, 'BREAK YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8869, 1, 0, 0, 'thaddius SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15928, -1533031, 'EAT YOUR BONES!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8868, 1, 0, 0, 'thaddius SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15928, -1533030, 'KILL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8867, 1, 0, 0, 'thaddius SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15936, -1533118, 'Noo... o...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8828, 1, 0, 0, 'heigan SAY_DEATH');
INSERT INTO `script_texts` VALUES (15936, -1533117, 'Hungry worms will feast on your rotten flesh!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8834, 1, 0, 0, 'heigan SAY_TAUNT5');
INSERT INTO `script_texts` VALUES (15936, -1533116, 'The end is upon you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8833, 1, 0, 0, 'heigan SAY_TAUNT4');
INSERT INTO `script_texts` VALUES (15936, -1533115, 'Soon... the world will tremble!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8832, 1, 0, 0, 'heigan SAY_TAUNT3');
INSERT INTO `script_texts` VALUES (15936, -1533114, 'I see endless suffering, I see torment, I see rage. I see... everything!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8831, 1, 0, 0, 'heigan SAY_TAUNT2');
INSERT INTO `script_texts` VALUES (15936, -1533113, 'The races of the world will perish. It is only a matter of time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8830, 1, 0, 0, 'heigan SAY_TAUNT1');
INSERT INTO `script_texts` VALUES (15936, -1533112, 'Close your eyes... sleep!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8829, 1, 0, 0, 'heigan SAY_SLAY');
INSERT INTO `script_texts` VALUES (15936, -1533111, 'You...are next!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8827, 1, 0, 0, 'heigan SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15936, -1533110, 'I see you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8826, 1, 0, 0, 'heigan SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15936, -1533109, 'You are mine now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8825, 1, 0, 0, 'heigan SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15953, -1533016, 'The master... will avenge me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8798, 1, 0, 0, 'faerlina SAY_DEATH');
INSERT INTO `script_texts` VALUES (15953, -1533015, 'Pathetic wretch!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8801, 1, 0, 0, 'faerlina SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15953, -1533014, 'You have failed!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8800, 1, 0, 0, 'faerlina SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15953, -1533013, 'Run while you still can!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8797, 1, 0, 0, 'faerlina SAY_AGGRO4');
INSERT INTO `script_texts` VALUES (15953, -1533012, 'Kneel before me, worm!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8796, 1, 0, 0, 'faerlina SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15953, -1533011, 'You cannot hide from me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8795, 1, 0, 0, 'faerlina SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15953, -1533010, 'Slay them in the master\'s name!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8794, 1, 0, 0, 'faerlina SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15953, -1533009, 'Your old lives, your mortal desires, mean nothing. You are acolytes of the master now, and you will serve the cause without question! The greatest glory is to die in the master\'s service!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8799, 1, 0, 0, 'faerlina SAY_GREET');
INSERT INTO `script_texts` VALUES (15954, -1533081, 'I will serve the master... in... death!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8848, 1, 0, 0, 'noth SAY_DEATH');
INSERT INTO `script_texts` VALUES (15954, -1533080, 'Breathe no more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8850, 1, 0, 0, 'noth SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15954, -1533079, 'My task is done!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8849, 1, 0, 0, 'noth SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15954, -1533078, 'Rise, my soldiers! Rise and fight once more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8851, 1, 0, 0, 'noth SAY_SUMMON');
INSERT INTO `script_texts` VALUES (15954, -1533077, 'Die, trespasser!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8847, 1, 0, 0, 'noth SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15954, -1533076, 'Your life is forfeit!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8846, 1, 0, 0, 'noth SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15954, -1533075, 'Glory to the master!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8845, 1, 0, 0, 'noth SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15956, -1533008, 'Shh... it will all be over soon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8789, 1, 0, 0, 'anubrekhan SAY_SLAY');
INSERT INTO `script_texts` VALUES (15956, -1533007, 'Closer now... tasty morsels. I\'ve been too long without food. Without blood to drink.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8793, 1, 0, 0, 'anubrekhan SAY_TAUNT4');
INSERT INTO `script_texts` VALUES (15956, -1533006, 'Which one shall I eat first? So difficult to choose... the all smell so delicious.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8792, 1, 0, 0, 'anubrekhan SAY_TAUNT3');
INSERT INTO `script_texts` VALUES (15956, -1533005, 'Where to go? What to do? So many choices that all end in pain, end in death.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8791, 1, 0, 0, 'anubrekhan SAY_TAUNT2');
INSERT INTO `script_texts` VALUES (15956, -1533004, 'I hear little hearts beating. Yesss... beating faster now. Soon the beating will stop.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8790, 1, 0, 0, 'anubrekhan SAY_TAUNT1');
INSERT INTO `script_texts` VALUES (15956, -1533003, 'Yes, Run! It makes the blood pump faster!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8787, 1, 0, 0, 'anubrekhan SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15956, -1533002, 'There is no way out.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8786, 1, 0, 0, 'anubrekhan SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15956, -1533001, 'Just a little taste...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8785, 1, 0, 0, 'anubrekhan SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (15956, -1533000, 'Ahh... welcome to my parlor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8788, 1, 0, 0, 'anubrekhan SAY_GREET');
INSERT INTO `script_texts` VALUES (15989, -1533083, '%s enrages!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'sapphiron EMOTE_ENRAGE');
INSERT INTO `script_texts` VALUES (15989, -1533082, 'takes in a deep breath...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'sapphiron EMOTE_BREATH');
INSERT INTO `script_texts` VALUES (15990, -1533108, 'Fools, you have spread your powers too thin. Be free, my minions!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14482, 1, 0, 0, 'kelthuzad SAY_SPECIAL2_DISPELL');
INSERT INTO `script_texts` VALUES (15990, -1533107, 'Enough! I grow tired of these distractions! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14483, 1, 0, 0, 'kelthuzad SAY_SPECIAL3_MANA_DET');
INSERT INTO `script_texts` VALUES (15990, -1533106, 'Your petty magics are no challenge to the might of the Scourge! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14481, 1, 0, 0, 'kelthuzad SAY_SPECIAL1_MANA_DET');
INSERT INTO `script_texts` VALUES (15990, -1533104, 'Very well... warriors of the frozen wastes, rise up! I command you to fight, kill, and die for your master. Let none survive...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'kelthuzad SAY_ANSWER_REQUEST');
INSERT INTO `script_texts` VALUES (15990, -1533103, 'Master! I require aid! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14470, 1, 0, 0, 'kelthuzad SAY_REQUEST_AID');
INSERT INTO `script_texts` VALUES (15990, -1533102, 'I will freeze the blood in your veins!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14474, 1, 0, 0, 'kelthuzad SAY_FROST_BLAST');
INSERT INTO `script_texts` VALUES (15990, -1533101, 'There will be no escape!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14473, 1, 0, 0, 'kelthuzad SAY_CHAIN2');
INSERT INTO `script_texts` VALUES (15990, -1533100, 'Your soul, is bound to me now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14472, 1, 0, 0, 'kelthuzad SAY_CHAIN1');
INSERT INTO `script_texts` VALUES (15990, -1533099, 'AAAAGHHH!... Do not rejoice... your victory is a hollow one... for I shall return with powers beyond your imagining!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14480, 1, 0, 0, 'kelthuzad SAY_DEATH');
INSERT INTO `script_texts` VALUES (15990, -1533098, '<Kel\'Thuzad cackles maniacally!>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14479, 1, 0, 0, 'kelthuzad SAY_SLAY2');
INSERT INTO `script_texts` VALUES (15990, -1533097, 'The dark void awaits you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14478, 1, 0, 0, 'kelthuzad SAY_SLAY1');
INSERT INTO `script_texts` VALUES (15990, -1533096, 'The end is upon you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14477, 1, 0, 0, 'kelthuzad SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (15990, -1533095, 'Scream your dying breath!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14476, 1, 0, 0, 'kelthuzad SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (15990, -1533094, 'Pray for mercy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14475, 1, 0, 0, 'kelthuzad SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (16028, -1533022, '%s becomes enraged!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'patchwerk EMOTE_ENRAGE');
INSERT INTO `script_texts` VALUES (16028, -1533021, 'goes into a berserker rage!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'patchwerk EMOTE_BERSERK');
INSERT INTO `script_texts` VALUES (16028, -1533020, 'What happened to... Patch...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8911, 1, 0, 0, 'patchwerk SAY_DEATH');
INSERT INTO `script_texts` VALUES (16028, -1533019, 'No more play?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8912, 1, 0, 0, 'patchwerk SAY_SLAY');
INSERT INTO `script_texts` VALUES (16028, -1533018, 'Kel\'Thuzad make Patchwerk his Avatar of War!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8910, 1, 0, 0, 'patchwerk SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (16028, -1533017, 'Patchwerk want to play!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8909, 1, 0, 0, 'patchwerk SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (16060, -1533043, 'I have waited long enough! Now, you face the harvester of souls!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8808, 1, 0, 0, 'gothik SAY_TELEPORT');
INSERT INTO `script_texts` VALUES (16060, -1533042, 'I... am... undone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8805, 1, 0, 0, 'gothik SAY_DEATH');
INSERT INTO `script_texts` VALUES (16060, -1533041, 'Death is the only escape.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8806, 1, 0, 0, 'gothik SAY_KILL');
INSERT INTO `script_texts` VALUES (16060, -1533040, 'Foolishly you have sought your own demise. Brazenly you have disregarded powers beyond your understanding. You have fought hard to invade the realm of the harvester. Now there is only one way out - to walk the lonely path of the damned.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8807, 1, 0, 0, 'gothik SAY_SPEECH');
INSERT INTO `script_texts` VALUES (16063, -1533074, 'Death... will not stop me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14580, 1, 0, 0, 'rivendare_naxx SAY_RIVE_DEATH');
INSERT INTO `script_texts` VALUES (16063, -1533073, 'Life is meaningless. It is in death that we are truly tested.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14579, 1, 0, 0, 'rivendare_naxx SAY_RIVE_TAUNT3');
INSERT INTO `script_texts` VALUES (16063, -1533072, 'Conserve your anger! Harness your rage! You will all have outlets for your frustration soon enough.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14578, 1, 0, 0, 'rivendare_naxx SAY_RIVE_TAUNT2');
INSERT INTO `script_texts` VALUES (16063, -1533071, 'Enough prattling. Let them come! We shall grind their bones to dust.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14577, 1, 0, 0, 'rivendare_naxx SAY_RIVE_TAUNT1');
INSERT INTO `script_texts` VALUES (16063, -1533070, 'Bow to the might of the scourge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14576, 1, 0, 0, 'rivendare_naxx SAY_RIVE_SPECIAL');
INSERT INTO `script_texts` VALUES (16063, -1533069, 'The master\'s will is done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14575, 1, 0, 0, 'rivendare_naxx SAY_RIVE_SLAY2');
INSERT INTO `script_texts` VALUES (16063, -1533068, 'You will find no peace in death.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14574, 1, 0, 0, 'rivendare_naxx SAY_RIVE_SLAY1');
INSERT INTO `script_texts` VALUES (16063, -1533067, 'Be still!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14573, 1, 0, 0, 'rivendare_naxx SAY_RIVE_AGGRO3');
INSERT INTO `script_texts` VALUES (16063, -1533066, 'None shall pass!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14572, 1, 0, 0, 'rivendare_naxx SAY_RIVE_AGGRO2');
INSERT INTO `script_texts` VALUES (16063, -1533065, 'You seek death?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14571, 1, 0, 0, 'rivendare_naxx SAY_RIVE_AGGRO1');
INSERT INTO `script_texts` VALUES (16063, -1533064, 'It is... as it should be.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8914, 1, 0, 0, 'zeliek SAY_ZELI_DEATH');
INSERT INTO `script_texts` VALUES (16063, -1533063, 'Forgive me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8915, 1, 0, 0, 'zeliek SAY_ZELI_SLAY');
INSERT INTO `script_texts` VALUES (16063, -1533062, 'I- I have no choice but to obey!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8916, 1, 0, 0, 'zeliek SAY_ZELI_SPECIAL');
INSERT INTO `script_texts` VALUES (16063, -1533061, 'Do not continue! Turn back while there\'s still time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8919, 1, 0, 0, 'zeliek SAY_ZELI_TAUNT3');
INSERT INTO `script_texts` VALUES (16063, -1533060, 'Perhaps they will come to their senses, and run away as fast as they can!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8918, 1, 0, 0, 'zeliek SAY_ZELI_TAUNT2');
INSERT INTO `script_texts` VALUES (16063, -1533059, 'Invaders, cease this foolish venture at once! Turn away while you still can!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8917, 1, 0, 0, 'zeliek SAY_ZELI_TAUNT1');
INSERT INTO `script_texts` VALUES (16063, -1533058, 'Flee, before it\'s too late!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8913, 1, 0, 0, 'zeliek SAY_ZELI_AGGRO');
INSERT INTO `script_texts` VALUES (16063, -1533057, 'What a bloody waste this is!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8900, 1, 0, 0, 'korthazz SAY_KORT_DEATH');
INSERT INTO `script_texts` VALUES (16063, -1533056, 'Next time, bring more friends!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8901, 1, 0, 0, 'korthazz SAY_KORT_SLAY');
INSERT INTO `script_texts` VALUES (16063, -1533055, 'I like my meat extra crispy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8902, 1, 0, 0, 'korthazz SAY_KORT_SPECIAl');
INSERT INTO `script_texts` VALUES (16063, -1533054, 'I\'m gonna enjoy killin\' these slack-jawed daffodils!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8905, 1, 0, 0, 'korthazz SAY_KORT_TAUNT3');
INSERT INTO `script_texts` VALUES (16063, -1533053, 'I heard about enough of yer sniveling. Shut yer fly trap \'afore I shut it for ye!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8904, 1, 0, 0, 'korthazz SAY_KORT_TAUNT2');
INSERT INTO `script_texts` VALUES (16063, -1533052, 'To arms, ye roustabouts! We\'ve got company!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8903, 1, 0, 0, 'korthazz SAY_KORT_TAUNT1');
INSERT INTO `script_texts` VALUES (16063, -1533051, 'Come out and fight, ye wee ninny!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8899, 1, 0, 0, 'korthazz SAY_KORT_AGGRO');
INSERT INTO `script_texts` VALUES (16063, -1533050, 'Tou... che!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8893, 1, 0, 0, 'blaumeux SAY_BLAU_DEATH');
INSERT INTO `script_texts` VALUES (16063, -1533049, 'Who\'s next?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8894, 1, 0, 0, 'blaumeux SAY_BLAU_SLAY');
INSERT INTO `script_texts` VALUES (16063, -1533048, 'Your life is mine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8895, 1, 0, 0, 'blaumeux SAY_BLAU_SPECIAL');
INSERT INTO `script_texts` VALUES (16063, -1533047, 'The first kill goes to me! Anyone care to wager?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8898, 1, 0, 0, 'blaumeux SAY_BLAU_TAUNT3');
INSERT INTO `script_texts` VALUES (16063, -1533046, 'I do hope they stay alive long enough for me to... introduce myself.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8897, 1, 0, 0, 'blaumeux SAY_BLAU_TAUNT2');
INSERT INTO `script_texts` VALUES (16063, -1533045, 'Come, Zeliek, do not drive them out. Not before we\'ve had our fun.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8896, 1, 0, 0, 'blaumeux SAY_BLAU_TAUNT1');
INSERT INTO `script_texts` VALUES (16063, -1533044, 'Defend youself!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 8892, 1, 0, 0, 'blaumeux SAY_BLAU_AGGRO');
INSERT INTO `script_texts` VALUES (16151, -1532004, 'Come, Midnight, let\'s disperse this petty rabble!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9168, 1, 0, 0, 'attumen SAY_MOUNT');
INSERT INTO `script_texts` VALUES (16151, -1532003, 'Perhaps you would rather test yourselves against a more formidable opponent?!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9299, 1, 0, 0, 'attumen SAY_APPEAR3');
INSERT INTO `script_texts` VALUES (16151, -1532002, 'Who dares attack the steed of the Huntsman?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9298, 1, 0, 0, 'attumen SAY_APPEAR2');
INSERT INTO `script_texts` VALUES (16151, -1532001, 'Cowards! Wretches!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9167, 1, 0, 0, 'attumen SAY_APPEAR1');
INSERT INTO `script_texts` VALUES (16151, -1532000, 'Well done Midnight!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9173, 1, 0, 0, 'attumen SAY_MIDNIGHT_KILL');
INSERT INTO `script_texts` VALUES (16295, -1000146, 'Liatha, get someone to look at those injuries. Thank you for bringing her back safely.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha CAPTAIN_ANSWER');
INSERT INTO `script_texts` VALUES (16295, -1000145, 'Captain Helios, I\'ve been rescued from the Amani Catacombs. Reporting for duty, sir!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_END2');
INSERT INTO `script_texts` VALUES (16295, -1000144, 'Thank you for saving my life and bringing me back to safety, $N', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_END1');
INSERT INTO `script_texts` VALUES (16295, -1000143, 'There\'s Farstrider Enclave now, $C. Not far to go... Look out! Troll ambush!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_PROGRESS3');
INSERT INTO `script_texts` VALUES (16295, -1000142, 'I can see the light at the end of the tunnel!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_PROGRESS2');
INSERT INTO `script_texts` VALUES (16295, -1000141, '$N, let\'s use the antechamber to the right.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_PROGRESS1');
INSERT INTO `script_texts` VALUES (16295, -1000140, 'Let\'s go.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'lilatha SAY_START');
INSERT INTO `script_texts` VALUES (16457, -1532024, 'Death comes. Will your conscience be clear?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9206, 1, 0, 0, 'maiden SAY_DEATH');
INSERT INTO `script_texts` VALUES (16457, -1532023, 'Your impurity must be cleansed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9208, 1, 0, 0, 'maiden SAY_REPENTANCE2');
INSERT INTO `script_texts` VALUES (16457, -1532022, 'Cast out your corrupt thoughts.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9313, 1, 0, 0, 'maiden SAY_REPENTANCE1');
INSERT INTO `script_texts` VALUES (16457, -1532021, 'Impure thoughts lead to profane actions.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9311, 1, 0, 0, 'maiden SAY_SLAY3');
INSERT INTO `script_texts` VALUES (16457, -1532020, 'This is for the best.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9312, 1, 0, 0, 'maiden SAY_SLAY2');
INSERT INTO `script_texts` VALUES (16457, -1532019, 'Ah ah ah...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9207, 1, 0, 0, 'maiden SAY_SLAY1');
INSERT INTO `script_texts` VALUES (16457, -1532018, 'Your behavior will not be tolerated!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9204, 1, 0, 0, 'maiden SAY_AGGRO');
INSERT INTO `script_texts` VALUES (16483, -1000255, 'Good luck stranger, and welcome to Shattrath City.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_21');
INSERT INTO `script_texts` VALUES (16483, -1000254, 'Khadgar should be ready to see you again. Just remember that to serve the Sha\'tar you will most likely have to ally with the Aldor or the Scryers. And seeking the favor of one group will cause the others\' dislike.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_20');
INSERT INTO `script_texts` VALUES (16483, -1000253, 'Such is their animosity that they vie for the honor of being sent to assist the naaru there. Each day, that decision is made here by A\'dal. The armies gather here to receive A\'dal\'s blessing before heading to Shadowmoon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_19');
INSERT INTO `script_texts` VALUES (16483, -1000252, 'There he continues to wage war on Illidan with the assistance of the Aldor and the Scryers. The two factions have not given up on their old feuds, though.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_18');
INSERT INTO `script_texts` VALUES (16483, -1000251, 'The attacks against Shattrath continued, but the city did not fall, as you can see. On the contrary, the naaru known as Xi\'ri led a successful incursion into Shadowmoon Valley - Illidan\'s doorstep.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_17');
INSERT INTO `script_texts` VALUES (16483, -1000250, 'The Aldor\'s most holy temple and its surrounding dwellings lie on the terrace above. As a holy site, only the initiated are welcome inside.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_16');
INSERT INTO `script_texts` VALUES (16483, -1000249, 'Many of the priesthood had been slain by the same magisters who now vowed to serve the naaru. They were not happy to share the city with their former enemies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_15');
INSERT INTO `script_texts` VALUES (16483, -1000248, 'The Aldor are followers of the Light and forgiveness and redemption are values they understand. However, they found hard to forget the deeds of the blood elves while under Kael\'s command.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, 'SAY_KHAD_SERV_14');
INSERT INTO `script_texts` VALUES (16524, -1532088, 'Where did you get that?! Did HE send you?!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9249, 1, 0, 0, 'aran SAY_ATIESH');
INSERT INTO `script_texts` VALUES (16524, -1532087, 'At last... The nightmare is.. over...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9244, 1, 0, 0, 'aran SAY_DEATH');
INSERT INTO `script_texts` VALUES (16524, -1532086, 'You\'ve wasted enough of my time. Let these games be finished!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9247, 1, 0, 0, 'aran SAY_TIMEOVER');
INSERT INTO `script_texts` VALUES (16524, -1532085, 'Torment me no more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9328, 1, 0, 0, 'aran SAY_KILL2');
INSERT INTO `script_texts` VALUES (16524, -1532084, 'I want this nightmare to be over!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9250, 1, 0, 0, 'aran SAY_KILL1');
INSERT INTO `script_texts` VALUES (16524, -1532083, 'I\'m not finished yet! No, I have a few more tricks up me sleeve.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9251, 1, 0, 0, 'aran SAY_ELEMENTALS');
INSERT INTO `script_texts` VALUES (16524, -1532082, 'Surely you would not deny an old man a replenishing drink? No, no I thought not.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9248, 1, 0, 0, 'aran SAY_DRINK');
INSERT INTO `script_texts` VALUES (16524, -1532081, 'I am not some simple jester! I am Nielas Aran!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9325, 1, 0, 0, 'aran SAY_EXPLOSION2');
INSERT INTO `script_texts` VALUES (16524, -1532080, 'Yes, yes, my son is quite powerful... but I have powers of my own!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9242, 1, 0, 0, 'aran SAY_EXPLOSION1');
INSERT INTO `script_texts` VALUES (16524, -1532079, 'Back to the cold dark with you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9327, 1, 0, 0, 'aran SAY_BLIZZARD2');
INSERT INTO `script_texts` VALUES (16524, -1532078, 'I\'ll freeze you all!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9246, 1, 0, 0, 'aran SAY_BLIZZARD1');
INSERT INTO `script_texts` VALUES (16524, -1532077, 'Burn you hellish fiends!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9326, 1, 0, 0, 'aran SAY_FLAMEWREATH2');
INSERT INTO `script_texts` VALUES (16524, -1532076, 'I\'ll show you this beaten dog still has some teeth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9245, 1, 0, 0, 'aran SAY_FLAMEWREATH1');
INSERT INTO `script_texts` VALUES (16524, -1532075, 'Who are you? What do you want? Stay away from me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9324, 1, 0, 0, 'aran SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (16524, -1532074, 'I\'ll not be tortured again!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9323, 1, 0, 0, 'aran SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (16524, -1532073, 'Please, no more. My son... he\'s gone mad!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9241, 1, 0, 0, 'aran SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (16807, -1540017, 'What a ... a shame.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10276, 1, 0, 0, 'nethekurse SAY_DIE');
INSERT INTO `script_texts` VALUES (16807, -1540016, 'Ohh! Just die.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10275, 1, 0, 0, 'nethekurse SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (16807, -1540015, 'You Loose.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10274, 1, 0, 0, 'nethekurse SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (16807, -1540014, 'I had more fun torturing the peons.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10273, 1, 0, 0, 'nethekurse SAY_AGGRO_3');
INSERT INTO `script_texts` VALUES (16807, -1540013, 'Come on! ... Show me a real fight.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10272, 1, 0, 0, 'nethekurse SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES (16807, -1540012, 'I\'m already bored.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10271, 1, 0, 0, 'nethekurse SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES (16807, -1540011, 'Your pain amuses me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10261, 1, 0, 0, 'nethekurse SAY_TAUNT_3');
INSERT INTO `script_texts` VALUES (16807, -1540010, 'Run covad, ruun!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10260, 1, 0, 0, 'nethekurse SAY_TAUNT_2');
