INSERT INTO `script_texts` VALUES (16812, -1532114, 'But don\'t take it from me, see for yourself what tragedy lies ahead when the paths of star-crossed lovers meet. And now...on with the show!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9343, 1, 0, 0, 'barnes RAJ4');
INSERT INTO `script_texts` VALUES (16812, -1532113, 'But beware, for not all love stories end happily, as you may find out. Sometimes, love pricks like a thorn.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9342, 1, 0, 0, 'barnes RAJ3');
INSERT INTO `script_texts` VALUES (16812, -1532112, 'Tonight, we explore a tale of forbidden love!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9341, 1, 0, 0, 'barnes RAJ2');
INSERT INTO `script_texts` VALUES (16812, -1532111, 'Welcome, Ladies and Gentlemen, to this evening\'s presentation!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9176, 1, 0, 0, 'barnes RAJ1');
INSERT INTO `script_texts` VALUES (16812, -1532110, 'But don\'t let me pull the wool over your eyes. See for yourself what lies beneath those covers! And now... on with the show!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9337, 1, 0, 0, 'barnes HOOD4');
INSERT INTO `script_texts` VALUES (16812, -1532109, 'Take for instance, this quiet, elderly woman, waiting for a visit from her granddaughter. Surely there is nothing to fear from this sweet, grey-haired, old lady.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9336, 1, 0, 0, 'barnes HOOD3');
INSERT INTO `script_texts` VALUES (16812, -1532108, 'Tonight, things are not what they seem. For tonight, your eyes may not be trusted', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9335, 1, 0, 0, 'barnes HOOD2');
INSERT INTO `script_texts` VALUES (16812, -1532107, 'Good evening, Ladies and Gentlemen! Welcome to this evening\'s presentation!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9175, 1, 0, 0, 'barnes HOOD1');
INSERT INTO `script_texts` VALUES (16812, -1532106, 'Will she survive? Will she prevail? Only time will tell. And now ... on with the show!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9340, 1, 0, 0, 'barnes OZ4');
INSERT INTO `script_texts` VALUES (16812, -1532105, 'But she is pursued... by a wicked malevolent crone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9339, 1, 0, 0, 'barnes OZ3');
INSERT INTO `script_texts` VALUES (16812, -1532104, 'Tonight we plumb the depths of the human soul as we join a lost, lonely girl trying desperately -- with the help of her loyal companions -- to find her way home!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9338, 1, 0, 0, 'barnes OZ2');
INSERT INTO `script_texts` VALUES (16812, -1532103, 'Welcome Ladies and Gentlemen, to this evening\'s presentation!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9174, 1, 0, 0, 'barnes OZ1');
INSERT INTO `script_texts` VALUES (16993, -1000122, 'You won\'t keep me from getting to Falcon Watch!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'wounded elf SAY_ELF_AGGRO');
