INSERT INTO `script_texts` VALUES (17077, -1000498, 'Welcome, kind spirit. What has brought you to us?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'ancestral wolf SAY_WOLF_WELCOME');
