INSERT INTO `script_texts` VALUES (17243, -1000258, 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those humans with your power to back me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 4, 'garments SAY_KORJA_THANKS');
INSERT INTO `script_texts` VALUES (17243, -1000257, 'Farewell to you, and may the Light be with you always.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 3, 'garments SAY_ROBERTS_GOODBYE');
INSERT INTO `script_texts` VALUES (17243, -1000256, 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those murlocs with the Light on my side!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 4, 'garments SAY_ROBERTS_THANKS');
