INSERT INTO `script_texts` VALUES (17318, -1000266, 'I\'ll begin drawing energy from the stone. Your job, $N, is to defend me. This place is cursed... trust me.', NULL, 'Je vais commencer à  puiser l\'énergie de la pierre. Votre travail, $N, est de me défendre. Cet endroit est maudit... croyez moi.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'phizzlethorpe SAY_PROGRESS_3');
INSERT INTO `script_texts` VALUES (17318, -1000265, 'I discovered this cave on our first day here. I believe the energy in the stone can be used to our advantage.', NULL, 'J\'ai découvert cette grotte dès notre premier jour ici. Je crois que l\'énergie de la pierre peut être utilisée à  notre avantage.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'phizzlethorpe SAY_PROGRESS_2');
INSERT INTO `script_texts` VALUES (17318, -1000264, 'Ok, $N. Follow me to the cave where I\'ll attempt to harness the power of the rune stone into these goggles.', NULL, 'Ok, $N. Suivez-moi jusqu\'à  la grotte où je vais tenter de capturer la puissance de la pierre runique dans ces lunettes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'phizzlethorpe SAY_PROGRESS_1');
INSERT INTO `script_texts` VALUES (17318, -1000263, 'Farewell to you, and may Elune be with you always.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 2, 3, 'garments SAY_SHAYA_GOODBYE');
INSERT INTO `script_texts` VALUES (17318, -1000262, 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those corrupt timberlings with Elune\'s power behind me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 2, 4, 'garments SAY_SHAYA_THANKS');
INSERT INTO `script_texts` VALUES (17318, -1000261, 'Farewell to you, and may the Light be with you always.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 3, 'garments SAY_DOLF_GOODBYE');
INSERT INTO `script_texts` VALUES (17318, -1000260, 'Thank you! Thank you, $GPriest:Priestess;. Now I can take on those wendigo with the Light on my side!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 4, 'garments SAY_DOLF_THANKS');
INSERT INTO `script_texts` VALUES (17318, -1000259, 'Farewell to you, and may our ancestors be with you always!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 3, 'garments SAY_KORJA_GOODBYE');
