INSERT INTO `script_texts` VALUES (17521, -1532045, 'Run away little girl, run away!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9278, 1, 0, 0, 'wolf SAY_WOLF_HOOD');
