INSERT INTO `script_texts` VALUES (17533, -1532056, 'How well my comfort is revived by this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9238, 1, 0, 0, 'romulo SAY_ROMULO_SLAY');
