INSERT INTO `script_texts` VALUES (17534, -1532047, 'Where is my lord? Where is my Romulo?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9199, 1, 0, 0, 'julianne SAY_JULIANNE_ENTER');
