INSERT INTO `script_texts` VALUES (17535, -1532028, 'Oh dear, we simply must find a way home! The old wizard could be our only hope! Strawman, Roar, Tinhead, will you... wait! Oh golly, look! We have visitors!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9195, 1, 0, 0, 'dorothee SAY_DOROTHEE_AGGRO');
