INSERT INTO `script_texts` VALUES (17848, -1560008, 'No more middling for you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10432, 1, 0, 0, 'lieutenant_drake SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17848, -1560007, 'I know what you\'re up to, and I mean to put an end to it, permanently!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10429, 1, 0, 0, 'lieutenant_drake SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17848, -1560006, 'You there, fetch water quickly! Get these flames out before they spread to the rest of the keep! Hurry, damn you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10428, 1, 0, 0, 'lieutenant_drake SAY_ENTER');
INSERT INTO `script_texts` VALUES (17852, -1534017, 'Uraaa...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11034, 1, 0, 0, 'thrall hyjal DEATH');
INSERT INTO `script_texts` VALUES (17852, -1534016, 'We have played our part and done well. It is up to the others now.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11035, 1, 0, 0, 'thrall hyjal SUCCESS');
INSERT INTO `script_texts` VALUES (17852, -1534015, 'It is over. Withdraw! We have failed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11033, 1, 0, 0, 'thrall hyjal FAILURE');
INSERT INTO `script_texts` VALUES (17852, -1534014, 'Do not give an inch of ground!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11060, 1, 0, 0, 'thrall hyjal RALLY 2');
INSERT INTO `script_texts` VALUES (17852, -1534013, 'Victory or death!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11059, 1, 0, 0, 'thrall hyjal RALLY 1');
INSERT INTO `script_texts` VALUES (17852, -1534012, 'Hold them back! Do not falter!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11030, 1, 0, 0, 'thrall hyjal BEGIN');
INSERT INTO `script_texts` VALUES (17852, -1534011, 'Make ready for another wave! LOK-TAR OGAR!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11032, 1, 0, 0, 'thrall hyjal INCOMING');
INSERT INTO `script_texts` VALUES (17852, -1534010, 'Bring the fight to me and pay with your lives!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11061, 1, 0, 0, 'thrall hyjal ATTACKED 2');
INSERT INTO `script_texts` VALUES (17852, -1534009, 'I will lie down for no one!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11031, 1, 0, 0, 'thrall hyjal ATTACKED 1');
INSERT INTO `script_texts` VALUES (17862, -1560005, 'Guards! Urgh..Guards..!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10411, 1, 0, 0, 'skarloc SAY_DEATH');
INSERT INTO `script_texts` VALUES (17862, -1560004, 'Did you really think you would leave here alive?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10410, 1, 0, 0, 'skarloc SAY_SLAY2');
INSERT INTO `script_texts` VALUES (17862, -1560003, 'Thrall will never be free!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10409, 1, 0, 0, 'skarloc SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17862, -1560002, 'I don\'t know what Blackmoore sees in you. For my money, you\'re just another ignorant savage!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10408, 1, 0, 0, 'skarloc SAY_TAUNT2');
INSERT INTO `script_texts` VALUES (17862, -1560001, 'You\'re a slave. That\'s all you\'ll ever be.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10407, 1, 0, 0, 'skarloc SAY_TAUNT1');
INSERT INTO `script_texts` VALUES (17862, -1560000, 'Thrall! You didn\'t really think you would escape did you? You and your allies shall answer to Blackmoore - after I\'ve had my fun!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10406, 1, 0, 0, 'skarloc SAY_ENTER');
INSERT INTO `script_texts` VALUES (17876, -1560047, 'I will not waste this chance. I will seek out my destiny.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10457, 1, 0, 0, 'thrall hillsbrad SAY_TH_LEAVE_COMBAT3');
INSERT INTO `script_texts` VALUES (17876, -1560046, 'Thank you, strangers. You have given me hope.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10456, 1, 0, 0, 'thrall hillsbrad SAY_TH_LEAVE_COMBAT2');
INSERT INTO `script_texts` VALUES (17876, -1560045, 'I am truly in your debt, strangers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10455, 1, 0, 0, 'thrall hillsbrad SAY_TH_LEAVE_COMBAT1');
INSERT INTO `script_texts` VALUES (17876, -1560044, 'I did not ask for this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10454, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_KILL3');
INSERT INTO `script_texts` VALUES (17876, -1560043, 'It should not have come to this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10453, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_KILL2');
INSERT INTO `script_texts` VALUES (17876, -1560042, 'You have forced my hand!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10452, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_KILL1');
INSERT INTO `script_texts` VALUES (17876, -1560041, 'Blackmoore has much to answer for!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10451, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_AGGRO4');
INSERT INTO `script_texts` VALUES (17876, -1560040, 'I am a slave no longer!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10450, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_AGGRO3');
INSERT INTO `script_texts` VALUES (17876, -1560039, 'This day is long overdue. Out of my way!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10449, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_AGGRO2');
INSERT INTO `script_texts` VALUES (17876, -1560038, 'I have earned my freedom!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10448, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_AGGRO1');
INSERT INTO `script_texts` VALUES (17876, -1560037, 'A good day...to die...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10461, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_DIE2');
INSERT INTO `script_texts` VALUES (17876, -1560036, 'Taretha...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10460, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_DIE1');
INSERT INTO `script_texts` VALUES (17876, -1560035, 'I will fight to the last!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10459, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_LOW_HP2');
INSERT INTO `script_texts` VALUES (17876, -1560034, 'Things are looking grim...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10458, 1, 0, 0, 'thrall hillsbrad SAY_TH_RANDOM_LOW_HP1');
INSERT INTO `script_texts` VALUES (17876, -1560033, 'Goodbye, Taretha. I will never forget your kindness.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10472, 1, 0, 0, 'thrall hillsbrad SAY_TH_EVENT_COMPLETE');
INSERT INTO `script_texts` VALUES (17876, -1560032, 'No!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10471, 1, 0, 5, 'thrall hillsbrad SAY_TH_EPOCH_KILL_TARETHA');
INSERT INTO `script_texts` VALUES (17876, -1560031, 'Who or what was that?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10470, 1, 0, 1, 'thrall hillsbrad SAY_TH_EPOCH_WONDER');
INSERT INTO `script_texts` VALUES (17876, -1560030, 'Taretha! What foul magic is this?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'thrall hillsbrad SAY_TH_MEET_TARETHA');
INSERT INTO `script_texts` VALUES (17876, -1560029, 'Taretha must be in the inn. Let\'s go.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'thrall hillsbrad SAY_TH_CHURCH_END');
INSERT INTO `script_texts` VALUES (17876, -1560028, 'Let\'s ride!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10469, 0, 0, 1, 'thrall hillsbrad SAY_TH_MOUNTS_UP');
INSERT INTO `script_texts` VALUES (17876, -1560027, 'Very well. Tarren Mill lies just west of here. Since time is of the essence...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10468, 1, 0, 0, 'thrall hillsbrad SAY_TH_START_EVENT_PART2');
INSERT INTO `script_texts` VALUES (17876, -1560026, 'I\'ll never be chained again!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10467, 1, 0, 0, 'thrall hillsbrad SAY_TH_SKARLOC_TAUNT');
INSERT INTO `script_texts` VALUES (17876, -1560025, 'A rider approaches!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10466, 0, 0, 0, 'thrall hillsbrad SAY_TH_SKARLOC_MEET');
INSERT INTO `script_texts` VALUES (17876, -1560024, 'As long as we\'re going with a new plan, I may aswell pick up a weapon and some armor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'thrall hillsbrad SAY_TH_ARMORY');
INSERT INTO `script_texts` VALUES (17876, -1560023, 'Very well then. Let\'s go!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10465, 1, 0, 0, 'thrall hillsbrad SAY_TH_START_EVENT_PART1');
INSERT INTO `script_texts` VALUES (17879, -1269011, 'Time ... is on our side.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10417, 1, 0, 0, 'chrono_lord_deja SAY_DEATH');
INSERT INTO `script_texts` VALUES (17879, -1269010, 'Leaving so soon?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10416, 1, 0, 0, 'chrono_lord_deja SAY_SLAY2');
INSERT INTO `script_texts` VALUES (17879, -1269009, 'I told you it was a fool\'s quest!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10415, 1, 0, 0, 'chrono_lord_deja SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17879, -1269008, 'You have outstayed your welcome, Timekeeper. Begone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10413, 1, 0, 0, 'chrono_lord_deja SAY_BANISH');
INSERT INTO `script_texts` VALUES (17879, -1269007, 'If you will not cease this foolish quest, then you will die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10414, 1, 0, 0, 'chrono_lord_deja SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17879, -1269006, 'Why do you aid the Magus? Just think of how many lives could be saved if the portal is never opened, if the resulting wars could be erased ...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10412, 1, 0, 0, 'chrono_lord_deja SAY_ENTER');
INSERT INTO `script_texts` VALUES (17880, -1269005, 'My death means ... little.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10447, 1, 0, 0, 'temporus SAY_DEATH');
INSERT INTO `script_texts` VALUES (17880, -1269004, 'Your days are done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10446, 1, 0, 0, 'temporus SAY_SLAY2');
INSERT INTO `script_texts` VALUES (17880, -1269003, 'You should have left when you had the chance.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10445, 1, 0, 0, 'temporus SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17880, -1269002, 'Time... sands of time is run out for you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10443, 1, 0, 0, 'temporus SAY_BANISH');
INSERT INTO `script_texts` VALUES (17880, -1269001, 'So be it ... you have been warned.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10444, 1, 0, 0, 'temporus SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17880, -1269000, 'Why do you persist? Surely you can see the futility of it all. It is not too late! You may still leave with your lives ...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10442, 1, 0, 0, 'temporus SAY_ENTER');
INSERT INTO `script_texts` VALUES (17881, -1269018, 'goes into a frenzy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'aeonus EMOTE_FRENZY');
INSERT INTO `script_texts` VALUES (17881, -1269017, 'It is only a matter...of time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10405, 1, 0, 0, 'aeonus SAY_DEATH');
INSERT INTO `script_texts` VALUES (17881, -1269016, 'No one can stop us! No one!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10404, 1, 0, 0, 'aeonus SAY_SLAY2');
INSERT INTO `script_texts` VALUES (17881, -1269015, 'One less obstacle in our way!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10403, 1, 0, 0, 'aeonus SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17881, -1269014, 'Your time is up, slave of the past!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10401, 1, 0, 0, 'aeonus SAY_BANISH');
INSERT INTO `script_texts` VALUES (17881, -1269013, 'Let us see what fate lays in store...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10402, 1, 0, 0, 'aeonus SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17881, -1269012, 'The time has come to shatter this clockwork universe forever! Let us no longer be slaves of the hourglass! I warn you: those who do not embrace the greater path shall become victims of its passing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10400, 1, 0, 0, 'aeonus SAY_ENTER');
INSERT INTO `script_texts` VALUES (17900, -1000359, 'Thank you for helping me. I know my way back from here.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'KAYA_END');
INSERT INTO `script_texts` VALUES (17968, -1534030, 'Bow to my will.', NULL, 'Pliez devant ma volonté !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11042, 1, 0, 0, 'archimonde SAY_SOUL_CHARGE2');
INSERT INTO `script_texts` VALUES (17968, -1534029, 'You are mine now.', NULL, 'Vous êtes à  moi maintenant !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10988, 1, 0, 0, 'archimonde SAY_SOUL_CHARGE1');
INSERT INTO `script_texts` VALUES (17968, -1534028, 'No, it cannot be! Nooo!', NULL, 'Non, c\'est impossible, ! Noooon, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10992, 1, 0, 0, 'archimonde SAY_DEATH');
INSERT INTO `script_texts` VALUES (17968, -1534027, 'At last it is here. Mourn and lament the passing of all you have ever known and all that would have been! Akmin-kurai!', NULL, 'L\'heure est enfin venue ! Pleurez et lamentez-vous, car voici venue la fin de tout ce que vous avez pu connaître et de tout avenir ! Akmin-kurai !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10993, 1, 0, 0, 'archimonde SAY_ENRAGE');
INSERT INTO `script_texts` VALUES (17968, -1534026, 'I am the coming of the end!', NULL, 'Je suis l\'avènement de la fin !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11045, 1, 0, 0, 'archimonde SAY_SLAY3');
INSERT INTO `script_texts` VALUES (17968, -1534025, 'Your soul will languish for eternity.', NULL, 'Ton âme se morfondra pour l\'éternité.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10991, 1, 0, 0, 'archimonde SAY_SLAY2');
INSERT INTO `script_texts` VALUES (17968, -1534024, 'All creation will be devoured!', NULL, 'Toute la création sera dévorée !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11044, 1, 0, 0, 'archimonde SAY_SLAY1');
INSERT INTO `script_texts` VALUES (17968, -1534023, 'Away vermin!', NULL, 'Dégage, vermine.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11043, 1, 0, 0, 'archimonde SAY_AIR_BURST2');
INSERT INTO `script_texts` VALUES (17968, -1534022, 'A-kreesh!', NULL, 'A-Kreesh !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10989, 1, 0, 0, 'archimonde SAY_AIR_BURST1');
INSERT INTO `script_texts` VALUES (17968, -1534021, 'Manach sheek-thrish!', NULL, 'Manach sheek-thrish, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11041, 1, 0, 0, 'archimonde SAY_DOOMFIRE2');
INSERT INTO `script_texts` VALUES (17968, -1534020, 'This world will burn!', NULL, 'Ce monde brûlera, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10990, 1, 0, 0, 'archimonde SAY_DOOMFIRE1');
INSERT INTO `script_texts` VALUES (17968, -1534019, 'Your resistance is insignificant.', NULL, 'Votre résistance est futile.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10987, 1, 0, 0, 'archimonde SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17969, -1000364, 'Thanks a bunch... I can find my way back to Whitereach Post from here. Be sure to talk with Motega Firemane; perhaps you can keep him from sending me home.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'paoka SAY_COMPLETE');
INSERT INTO `script_texts` VALUES (17969, -1000363, 'Now this looks familiar. If we keep heading east, I think we can... Ahh, Wyvern on the attack!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'paoka SAY_WYVERN');
INSERT INTO `script_texts` VALUES (17969, -1000362, 'Let\'s go $N. I am ready to reach Whitereach Post.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 'paoka SAY_START');
INSERT INTO `script_texts` VALUES (17975, -1553005, 'The specimens...must be preserved.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11149, 1, 0, 0, 'freywinn SAY_DEATH');
INSERT INTO `script_texts` VALUES (17975, -1553004, 'Nature bends to my will!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11148, 1, 0, 0, 'freywinn SAY_TREE_2');
INSERT INTO `script_texts` VALUES (17975, -1553003, 'Endorel aluminor!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11147, 1, 0, 0, 'freywinn SAY_TREE_1');
INSERT INTO `script_texts` VALUES (17975, -1553002, 'You will feed the worms.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11146, 1, 0, 0, 'freywinn SAY_KILL_2');
INSERT INTO `script_texts` VALUES (17975, -1553001, 'Your life cycle is now concluded!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11145, 1, 0, 0, 'freywinn SAY_KILL_1');
INSERT INTO `script_texts` VALUES (17975, -1553000, 'What are you doing? These specimens are very delicate!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11144, 1, 0, 0, 'freywinn SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17977, -1553012, 'So... confused. Do not... belong here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11235, 1, 0, 0, 'warp SAY_DEATH');
INSERT INTO `script_texts` VALUES (17977, -1553011, 'Maybe this is not-- No, we fight! Come to my aid.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11234, 1, 0, 0, 'warp SAY_SUMMON_2');
INSERT INTO `script_texts` VALUES (17977, -1553010, 'Children, come to me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11233, 1, 0, 0, 'warp SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES (17977, -1553009, 'What am I doing? Why do I...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11232, 1, 0, 0, 'warp SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (17977, -1553008, 'You must die! But wait: this does not-- No, no... you must die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11231, 1, 0, 0, 'warp SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (17977, -1553007, 'Who disturbs this sanctuary?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11230, 1, 0, 0, 'warp SAY_AGGRO');
INSERT INTO `script_texts` VALUES (17980, -1553006, 'emits a strange noise.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'laj EMOTE_SUMMON');
INSERT INTO `script_texts` VALUES (18096, -1560022, 'No!...The master... will not... be pleased.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10427, 1, 0, 0, 'epoch_hunter SAY_DEATH');
INSERT INTO `script_texts` VALUES (18096, -1560021, 'Struggle as much as you like!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10424, 1, 0, 0, 'epoch_hunter SAY_BREATH2');
INSERT INTO `script_texts` VALUES (18096, -1560020, 'Not so fast!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10423, 1, 0, 0, 'epoch_hunter SAY_BREATH1');
INSERT INTO `script_texts` VALUES (18096, -1560019, 'Thrall will remain a slave. Taretha will die. You have failed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10426, 1, 0, 0, 'epoch_hunter SAY_SLAY2');
INSERT INTO `script_texts` VALUES (18096, -1560018, 'You are...irrelevant.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10425, 1, 0, 0, 'epoch_hunter SAY_SLAY1');
INSERT INTO `script_texts` VALUES (18096, -1560017, 'You cannot fight fate!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10422, 1, 0, 0, 'epoch_hunter SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (18096, -1560016, 'Enough! I will erase your very existence!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10421, 1, 0, 0, 'epoch_hunter SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (18096, -1560015, 'Ah, there you are. I had hoped to accomplish this with a bit of subtlety, but I suppose direct confrontation was inevitable. Your future, Thrall, must not come to pass and so...you and your troublesome friends must die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10420, 1, 0, 0, 'epoch_hunter SAY_ENTER3');
INSERT INTO `script_texts` VALUES (18096, -1560014, 'Taretha\'s life hangs in the balance. Surely you care for her. Surely you wish to save her...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10419, 1, 0, 0, 'epoch_hunter SAY_ENTER2');
INSERT INTO `script_texts` VALUES (18096, -1560013, 'Thrall! Come outside and face your fate!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 10418, 1, 0, 0, 'epoch_hunter SAY_ENTER1');
INSERT INTO `script_texts` VALUES (18168, -1532042, 'Fixed you, didn\'t I? <cackles>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9180, 1, 0, 0, 'crone SAY_CRONE_SLAY');
INSERT INTO `script_texts` VALUES (18168, -1532041, 'How could you? What a cruel, cruel world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9178, 1, 0, 0, 'crone SAY_CRONE_DEATH');
INSERT INTO `script_texts` VALUES (18168, -1532040, 'It will all be over soon! <cackles>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9307, 1, 0, 0, 'crone SAY_CRONE_AGGRO2');
INSERT INTO `script_texts` VALUES (18168, -1532039, 'Woe to each and every one of you my pretties! <cackles>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 9179, 1, 0, 0, 'crone SAY_CRONE_AGGRO');
