INSERT INTO `script_texts` VALUES (19622, -1550024, 'I have not come this far to be stopped! The future I have planned will not be jeopardized! Now you will taste true power!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11273, 1, 0, 0, 'kaelthas SAY_PHASE5_NUTS');
INSERT INTO `script_texts` VALUES (19622, -1550023, 'Alas, sometimes one must take matters into one\'s own hands. Balamore shanal!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11263, 1, 0, 0, 'kaelthas SAY_PHASE4_INTRO2');
INSERT INTO `script_texts` VALUES (19622, -1550022, 'Perhaps I underestimated you. It would be unfair to make you fight all four advisors at once, but... fair treatment was never shown to my people. I\'m just returning the favor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11262, 1, 0, 0, 'kaelthas SAY_PHASE3_ADVANCE');
INSERT INTO `script_texts` VALUES (19622, -1550021, 'As you see, I have many weapons in my arsenal...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11261, 1, 0, 0, 'kaelthas SAY_PHASE2_WEAPON');
INSERT INTO `script_texts` VALUES (19622, -1550020, 'You have persevered against some of my best advisors... but none can withstand the might of the Blood Hammer. Behold, Lord Sanguinar!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11260, 1, 0, 0, 'kaelthas SAY_INTRO_SANGUINAR');
INSERT INTO `script_texts` VALUES (19622, -1550019, 'Let us see how your nerves hold up against the Darkener, Thaladred.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11259, 1, 0, 0, 'kaelthas SAY_INTRO_THALADRED');
INSERT INTO `script_texts` VALUES (19622, -1550018, 'Well done, you have proven worthy to test your skills against my master engineer, Telonicus.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11258, 1, 0, 0, 'kaelthas SAY_INTRO_TELONICUS');
INSERT INTO `script_texts` VALUES (19622, -1550017, 'Capernian will see to it that your stay here is a short one.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11257, 1, 0, 0, 'kaelthas SAY_INTRO_CAPERNIAN');
INSERT INTO `script_texts` VALUES (19622, -1550016, 'Energy. Power. My people are addicted to it... a dependence made manifest after the Sunwell was destroyed. Welcome... to the future. A pity you are too late to stop it. No one can stop me now! Selama ashal\'anore!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11256, 1, 0, 0, 'kaelthas SAY_INTRO');
