INSERT INTO `script_texts` VALUES (20129, -1000158, 'Impudent whelps, you only delay the inevitable. Where one has fallen, ten shall rise. Such is the will of Kazzak...', NULL, 'Petits impudents, vous retardez seulement l\'inévitable. Là  où un est tombé, dix se lèveront. Telle est la volonté de Kazzak...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'kazzak SAY_RAND2');
INSERT INTO `script_texts` VALUES (20129, -1000157, 'Invaders, you dangle upon the precipice of oblivion! The Burning Legion comes and with it comes your end.', NULL, 'Envahisseurs, vous êtes suspendus au rebord du précipice de l\'oubli, ! La Légion ardente arrive, et avec elle votre fin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'kazzak SAY_RAND1');
INSERT INTO `script_texts` VALUES (20129, -1000156, '%s goes into a frenzy!', NULL, '%s est pris de frénésie !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'kazzak EMOTE_FRENZY');
INSERT INTO `script_texts` VALUES (20129, -1000155, 'The Legion... will never... fall.', NULL, 'La Légion! ne tombera! jamais.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11340, 1, 0, 0, 'kazzak SAY_DEATH');
INSERT INTO `script_texts` VALUES (20129, -1000154, 'The universe will be remade.', NULL, 'L\'univers sera redéfini.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11339, 1, 0, 0, 'kazzak SAY_KILL3');
INSERT INTO `script_texts` VALUES (20129, -1000153, 'Contemptible wretch!', NULL, 'Pitoyable vermine, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11338, 1, 0, 0, 'kazzak SAY_KILL2');
INSERT INTO `script_texts` VALUES (20129, -1000152, 'Kirel Narak!', NULL, 'Kirel narak, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11337, 1, 0, 0, 'kazzak SAY_KILL1');
INSERT INTO `script_texts` VALUES (20129, -1000151, 'I\'ll rip the flesh from your bones!', NULL, 'J\'arracherai la chair de vos os, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11336, 1, 0, 0, 'kazzak SAY_SURPREME2');
INSERT INTO `script_texts` VALUES (20129, -1000150, 'All life must be eradicated!', NULL, 'Toute vie doit être éradiquée, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11335, 1, 0, 0, 'kazzak SAY_SURPREME1');
INSERT INTO `script_texts` VALUES (20201, -1269019, 'Stop! Do not go further, mortals. You are ill-prepared to face the forces of the Infinite Dragonflight. Come, let me help you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'saat SAY_SAAT_WELCOME');
INSERT INTO `script_texts` VALUES (20209, -1000301, 'There\'s the stolen shredder! Stop it or Lugwizzle will have our hides!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'wizzlecrank SAY_MERCENARY');
INSERT INTO `script_texts` VALUES (20209, -1000300, 'Okay, I think I\'ve got it, now. Follow me, $n!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'wizzlecrank SAY_STARTUP2');
INSERT INTO `script_texts` VALUES (20209, -1000299, 'Arrrgh! This isn\'t right!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wizzlecrank SAY_STARTUP1');
INSERT INTO `script_texts` VALUES (20209, -1000298, 'Alright, alright I think I can figure out how to operate this thing...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 393, 'wizzlecrank SAY_START');
INSERT INTO `script_texts` VALUES (20209, -1000297, 'Meet me down by the orchard-- I just need to put my gun away.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 0, 'stilwell SAY_DS_PROLOGUE');
INSERT INTO `script_texts` VALUES (20209, -1000296, 'We\'ve done it! We won!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 0, 'stilwell SAY_DS_DOWN_3');
INSERT INTO `script_texts` VALUES (20415, -1000305, 'Hmm... I don\'t think this blinking red light is a good thing...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wizzlecrank SAY_END');
INSERT INTO `script_texts` VALUES (20415, -1000304, 'That was a close one! Well, let\'s get going, it\'s still a ways to Ratchet!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wizzlecrank SAY_PROGRESS_3');
INSERT INTO `script_texts` VALUES (20812, -1800072, 'This is the last time I get caught!I promise! Bye!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (20904, -1552030, 'Welcome, O\'great one. I am your humble servant.', NULL, 'Bienvenu, à” tout-puissant. Je suis votre humble serviteur.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11229, 1, 0, 0, 'mellichar YELL_WELCOME');
INSERT INTO `script_texts` VALUES (20904, -1552029, 'One final cell remains. Yes, O\'great one, right away!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11228, 1, 0, 0, 'mellichar YELL_RELEASE4');
INSERT INTO `script_texts` VALUES (20904, -1552028, 'Anarchy! Bedlam! Oh, you are so wise! Yes, I see it now, of course!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11227, 1, 0, 0, 'mellichar YELL_RELEASE3');
INSERT INTO `script_texts` VALUES (20904, -1552027, 'What is this? A lowly gnome? I will do better, O\'great one.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11226, 1, 0, 0, 'mellichar YELL_RELEASE2B');
INSERT INTO `script_texts` VALUES (20904, -1552026, 'Behold another terrifying creature of incomprehensible power!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11225, 1, 0, 0, 'mellichar YELL_RELEASE2A');
INSERT INTO `script_texts` VALUES (20904, -1552025, 'Yes, yes... another! Your will is mine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11224, 1, 0, 0, 'mellichar YELL_RELEASE1');
INSERT INTO `script_texts` VALUES (20904, -1552024, 'The naaru kept some of the most dangerous beings in existence here in these cells. Let me introduce you to another...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11223, 1, 0, 0, 'mellichar YELL_INTRO2');
INSERT INTO `script_texts` VALUES (20904, -1552023, 'I knew the prince would be angry but, I... I have not been myself. I had to let them out! The great one speaks to me, you see. Wait--outsiders. Kael\'thas did not send you! Good... I\'ll just tell the prince you released the prisoners!', NULL, 'Je savais que le prince serait en colère, mais je... je n\'étais plus moi même. Il fallait que je les relâche. Le tout-puissant me parle voyez-vous. Attendez... des étrangers... ce n\'est pas Kael Thas qui vous envoie ? Bien, il me suffira de dire au prince que c\'est vous qui avez libéré les prisonniers !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11222, 1, 0, 0, 'mellichar YELL_INTRO1');
INSERT INTO `script_texts` VALUES (20907, -1000302, 'Looks like we\'re out of woods, eh? Wonder what this does...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wizzlecrank SAY_PROGRESS_1');
INSERT INTO `script_texts` VALUES (20912, -1552009, 'I am merely one of... infinite multitudes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11126, 1, 0, 0, 'skyriss SAY_DEATH');
INSERT INTO `script_texts` VALUES (20912, -1552008, 'We span the universe, as countless as the stars!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11131, 1, 0, 0, 'skyriss SAY_IMAGE');
INSERT INTO `script_texts` VALUES (20912, -1552007, 'I will show you horrors undreamed of!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11130, 1, 0, 0, 'skyriss SAY_FEAR_2');
INSERT INTO `script_texts` VALUES (20912, -1552006, 'Flee in terror!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11129, 1, 0, 0, 'skyriss SAY_FEAR_1');
INSERT INTO `script_texts` VALUES (20912, -1552005, 'Your will is no longer your own.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11128, 1, 0, 0, 'skyriss SAY_MIND_2');
INSERT INTO `script_texts` VALUES (20912, -1552004, 'You will do my bidding, weakling.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11127, 1, 0, 0, 'skyriss SAY_MIND_1');
INSERT INTO `script_texts` VALUES (20912, -1552003, 'The chaos I have sown here is but a taste...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11125, 1, 0, 0, 'skyriss SAY_KILL_2');
INSERT INTO `script_texts` VALUES (20912, -1552002, 'Your fate is written!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11124, 1, 0, 0, 'skyriss SAY_KILL_1');
INSERT INTO `script_texts` VALUES (20912, -1552001, 'Bear witness to the agent of your demise!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11123, 1, 0, 0, 'skyriss SAY_AGGRO');
INSERT INTO `script_texts` VALUES (20912, -1552000, 'It is a small matter to control the mind of the weak... for I bear allegiance to powers untouched by time, unmoved by fate. No force on this world or beyond harbors the strength to bend our knee... not even the mighty Legion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11122, 1, 0, 0, 'skyriss SAY_INTRO');
INSERT INTO `script_texts` VALUES (20977, -1552022, 'Who\'s bad? Who\'s bad? That\'s right: we bad!', NULL, 'Ce soir on vous met... ce soir on vous met le feu !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11183, 1, 0, 0, 'millhouse SAY_COMPLETE');
INSERT INTO `script_texts` VALUES (20977, -1552021, 'You\'ll be hearing from my lawyer...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11182, 1, 0, 0, 'millhouse SAY_DEATH');
INSERT INTO `script_texts` VALUES (20977, -1552020, 'Heal me! Oh, for the love of all that is holy, HEAL me! I\'m dying!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11181, 1, 0, 0, 'millhouse SAY_LOWHP');
INSERT INTO `script_texts` VALUES (20977, -1552019, 'Ice, ice, baby!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11180, 1, 0, 0, 'millhouse SAY_ICEBLOCK');
INSERT INTO `script_texts` VALUES (20977, -1552018, 'I\'m gonna light you up, sweet cheeks!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11179, 1, 0, 0, 'millhouse SAY_PYRO');
INSERT INTO `script_texts` VALUES (20977, -1552017, 'You guys, feel free to jump in anytime.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11178, 1, 0, 0, 'millhouse SAY_KILL_2');
INSERT INTO `script_texts` VALUES (20977, -1552016, 'I didn\'t even break a sweat on that one.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11177, 1, 0, 0, 'millhouse SAY_KILL_1');
INSERT INTO `script_texts` VALUES (20977, -1552015, 'Aaalllriiiight!! Who ordered up an extra large can of whoop-ass?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11176, 1, 0, 0, 'millhouse SAY_READY');
INSERT INTO `script_texts` VALUES (20977, -1552014, 'And of course i\'ll need some mana. You guys are gonna love this, just wait.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11175, 1, 0, 0, 'millhouse SAY_DRINK');
INSERT INTO `script_texts` VALUES (20977, -1552013, 'Fantastic! Next, some protective spells. Yes! Now we\'re cookin\'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11174, 1, 0, 0, 'millhouse SAY_BUFFS');
INSERT INTO `script_texts` VALUES (20977, -1552012, 'I just need to get some things ready first. You guys go ahead and get started. I need to summon up some water...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11173, 1, 0, 0, 'millhouse SAY_WATER');
INSERT INTO `script_texts` VALUES (20977, -1552011, '\"Lowly\"? I don\'t care who you are friend, no one refers to the mighty Millhouse Manastorm as \"Lowly\"! I have no idea what goes on here, but I will gladly join your fight against this impudent imbecile! Prepare to defend yourself, cretin!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11172, 1, 0, 0, 'millhouse SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (20977, -1552010, 'Where in Bonzo\'s brass buttons am I? And who are-- yaaghh, that\'s one mother of a headache!', NULL, 'Par tous les grands gluants de Gnomeregan où suis-je ? Et qui êtes-vous -- Yaaghh ! Ma tête... la mère de toute les migaines...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11171, 1, 0, 0, 'millhouse SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (21027, -1000390, 'Thank you, $n. Please return to my brethren at the Altar of Damnation, near the Hand of Gul\'dan, and tell them that Wilda is safe. May the Earthmother watch over you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_END');
INSERT INTO `script_texts` VALUES (21027, -1000389, 'It shouldn\'t be much further, $n. The exit is just up ahead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_JUST_AHEAD');
INSERT INTO `script_texts` VALUES (21027, -1000388, 'The tumultuous nature of the great waterways of Azeroth and Draenor are a direct result of tormented water spirits.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_PROGRESS5');
INSERT INTO `script_texts` VALUES (21027, -1000387, 'Lady Vashj must answer for these atrocities. She must be brought to justice!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_PROGRESS4');
INSERT INTO `script_texts` VALUES (21027, -1000386, 'Now we must find the exit.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_FIND_EXIT');
INSERT INTO `script_texts` VALUES (21027, -1000385, 'The naga of Coilskar are exceptionally cruel to their prisoners. It is a miracle that I survived inside that watery prison for as long as I did. Earthmother be praised.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_PROGRESS2');
INSERT INTO `script_texts` VALUES (21027, -1000384, 'Grant me protection $n, I must break trough their foul magic!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_PROGRESS1');
INSERT INTO `script_texts` VALUES (21027, -1000383, 'Naga attackers! Defend yourself!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_AGGRO2');
INSERT INTO `script_texts` VALUES (21027, -1000382, 'Watch out!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'wilda SAY_WIL_AGGRO1');
INSERT INTO `script_texts` VALUES (21027, -1000381, 'I sense the tortured spirits, $n. They are this way, come quickly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'wilda SAY_WIL_START');
INSERT INTO `script_texts` VALUES (21212, -1548055, 'Lord Illidan, I... I am... sorry.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11544, 1, 0, 0, 'vashj SAY_DEATH');
INSERT INTO `script_texts` VALUES (21212, -1548054, 'Be\'lamere an\'delay', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11543, 1, 0, 0, 'vashj SAY_SLAY3');
INSERT INTO `script_texts` VALUES (21212, -1548053, 'You have failed!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11542, 1, 0, 0, 'vashj SAY_SLAY2');
INSERT INTO `script_texts` VALUES (21212, -1548052, 'Your time ends now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11541, 1, 0, 0, 'vashj SAY_SLAY1');
INSERT INTO `script_texts` VALUES (21212, -1548051, 'Seek your mark!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11537, 1, 0, 0, 'vashj SAY_BOWSHOT2');
INSERT INTO `script_texts` VALUES (21212, -1548050, 'Straight to the heart!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11536, 1, 0, 0, 'vashj SAY_BOWSHOT1');
INSERT INTO `script_texts` VALUES (21212, -1548049, 'You may want to take cover.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11540, 1, 0, 0, 'vashj SAY_PHASE3');
INSERT INTO `script_texts` VALUES (21212, -1548048, 'The time is now! Leave none standing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11539, 1, 0, 0, 'vashj SAY_PHASE2');
INSERT INTO `script_texts` VALUES (21212, -1548047, 'I did not wish to lower myself by engaging your kind, but you leave me little choice!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11538, 1, 0, 0, 'vashj SAY_PHASE1');
INSERT INTO `script_texts` VALUES (21212, -1548046, 'Death to the outsiders!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11535, 1, 0, 0, 'vashj SAY_AGGRO4');
INSERT INTO `script_texts` VALUES (21212, -1548045, 'I spit on you, surface filth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11534, 1, 0, 0, 'vashj SAY_AGGRO3');
INSERT INTO `script_texts` VALUES (21212, -1548044, 'Victory to Lord Illidan!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11533, 1, 0, 0, 'vashj SAY_AGGRO2');
INSERT INTO `script_texts` VALUES (21212, -1548043, 'I\'ll split you from stem to stern!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11532, 1, 0, 0, 'vashj SAY_AGGRO1');
INSERT INTO `script_texts` VALUES (21212, -1548042, 'Water is life. It has become a rare commodity here in Outland. A commodity that we alone shall control. We are the Highborne, and the time has come at last for us to retake our rightful place in the world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11531, 1, 0, 0, 'vashj SAY_INTRO');
INSERT INTO `script_texts` VALUES (21213, -1548041, 'summons Watery Globules!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'morogrim EMOTE_WATERY_GLOBULES');
INSERT INTO `script_texts` VALUES (21213, -1548040, 'The violent earthquake has alerted nearby murlocs!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'morogrim EMOTE_EARTHQUAKE');
INSERT INTO `script_texts` VALUES (21213, -1548039, 'sends his enemies to their watery graves!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'morogrim EMOTE_WATERY_GRAVE');
INSERT INTO `script_texts` VALUES (21213, -1548038, 'Great... currents of... Ageon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11329, 1, 0, 0, 'morogrim SAY_DEATH');
INSERT INTO `script_texts` VALUES (21213, -1548037, 'Only the strong survive.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11328, 1, 0, 0, 'morogrim SAY_SLAY3');
INSERT INTO `script_texts` VALUES (21213, -1548036, 'Strugging only makes it worse.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11327, 1, 0, 0, 'morogrim SAY_SLAY2');
INSERT INTO `script_texts` VALUES (21213, -1548035, 'It is done!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11326, 1, 0, 0, 'morogrim SAY_SLAY1');
INSERT INTO `script_texts` VALUES (21213, -1548034, 'Soon it will be finished!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11325, 1, 0, 0, 'morogrim SAY_SUMMON_BUBL2');
INSERT INTO `script_texts` VALUES (21213, -1548033, 'There is nowhere to hide!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11324, 1, 0, 0, 'morogrim SAY_SUMMON_BUBL1');
INSERT INTO `script_texts` VALUES (21213, -1548032, 'Destroy them my subjects!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11323, 1, 0, 0, 'morogrim SAY_SUMMON2');
INSERT INTO `script_texts` VALUES (21213, -1548031, 'By the Tides, kill them at once!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11322, 1, 0, 0, 'morogrim SAY_SUMMON1');
INSERT INTO `script_texts` VALUES (21213, -1548030, 'Flood of the deep, take you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11321, 1, 0, 0, 'morogrim SAY_AGGRO');
INSERT INTO `script_texts` VALUES (21214, -1548029, 'Her ... excellency ... awaits!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11285, 1, 0, 0, 'karathress SAY_DEATH');
INSERT INTO `script_texts` VALUES (21214, -1548028, 'I am rid of you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11284, 1, 0, 0, 'karathress SAY_SLAY3');
INSERT INTO `script_texts` VALUES (21214, -1548027, 'Alana be\'lendor!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11283, 1, 0, 0, 'karathress SAY_SLAY2');
INSERT INTO `script_texts` VALUES (21214, -1548026, 'Land-dwelling scum!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11282, 1, 0, 0, 'karathress SAY_SLAY1');
INSERT INTO `script_texts` VALUES (21214, -1548025, 'More knowledge, more power!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11281, 1, 0, 0, 'karathress SAY_GAIN_ABILITY3');
INSERT INTO `script_texts` VALUES (21214, -1548024, 'I am more powerful than ever!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11280, 1, 0, 0, 'karathress SAY_GAIN_ABILITY2');
INSERT INTO `script_texts` VALUES (21214, -1548023, 'Go on, kill them! I\'ll be the better for it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11279, 1, 0, 0, 'karathress SAY_GAIN_ABILITY1');
INSERT INTO `script_texts` VALUES (21214, -1548022, 'Your overconfidence will be your undoing! Guards, lend me your strength!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11278, 1, 0, 0, 'karathress SAY_GAIN_BLESSING');
INSERT INTO `script_texts` VALUES (21214, -1548021, 'Guards, attention! We have visitors...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11277, 1, 0, 0, 'karathress SAY_AGGRO');
INSERT INTO `script_texts` VALUES (21215, -1548020, 'You cannot kill me! Fools, I\'ll be back! I\'ll... aarghh...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11317, 1, 0, 0, 'leotheras SAY_DEATH');
INSERT INTO `script_texts` VALUES (21215, -1548019, 'At last I am liberated. It has been too long since I have tasted true freedom!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11309, 1, 0, 0, 'leotheras SAY_FREE');
INSERT INTO `script_texts` VALUES (21215, -1548018, 'No... no! What have you done? I am the master! Do you hear me? I am... aaggh! Can\'t... contain him...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11313, 1, 0, 0, 'leotheras SAY_FINAL_FORM');
INSERT INTO `script_texts` VALUES (21215, -1548017, 'Who\'s the master now?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11316, 1, 0, 0, 'leotheras SAY_NIGHTELF_SLAY3');
INSERT INTO `script_texts` VALUES (21215, -1548016, 'That\'s right! Yes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11315, 1, 0, 0, 'leotheras SAY_NIGHTELF_SLAY2');
INSERT INTO `script_texts` VALUES (21215, -1548015, 'Kill! KILL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11314, 1, 0, 0, 'leotheras SAY_NIGHTELF_SLAY1');
INSERT INTO `script_texts` VALUES (21215, -1548014, 'Yes, YES! Ahahah!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11308, 1, 0, 0, 'leotheras SAY_DEMON_SLAY3');
