INSERT INTO `script_texts` VALUES (21216, -1548001, 'Better, much better.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 11290, 1, 0, 0, 'hydross SAY_SWITCH_TO_CLEAN');
