INSERT INTO `script_texts` VALUES (21469, -1000174, 'Good $N, you are under the spell\'s influence. I must analyze it quickly, then we can talk.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 7, 0, 'daranelle SAY_SPELL_INFLUENCE');
INSERT INTO `script_texts` VALUES (21648, -1000222, 'As custodians of time, we watch over and care for Nozdormu\'s realm. The master is away at the moment, which means that attempts are being made to dramatically alter time. The master never meddles in the affairs of mortals but instead corrects the alterations made to time by others. He is reactionary in this regard.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'WHISPER_CUSTODIAN_6');
INSERT INTO `script_texts` VALUES (22083, -1000220, 'Follow me, please.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'WHISPER_CUSTODIAN_4');
INSERT INTO `script_texts` VALUES (22083, -1000219, 'It is strange, I know... Most mortals cannot actually comprehend what they see here, as often, what they see is not anchored within their own perception of reality.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'WHISPER_CUSTODIAN_3');
INSERT INTO `script_texts` VALUES (22083, -1000218, 'We do not know if the Caverns of Time have always been accessible to mortals. Truly, it is impossible to tell as the Timeless One is in perpetual motion, changing our timeways as he sees fit. What you see now may very well not exist tomorrow. You may wake up and have no memory of this place.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'WHISPER_CUSTODIAN_2');
INSERT INTO `script_texts` VALUES (22083, -1000217, 'Greetings, $N. I will guide you through the cavern. Please try and keep up.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'WHISPER_CUSTODIAN_1');
