INSERT INTO `script_texts` VALUES (23578, -1568009, 'Come, friends. Your bodies gonna feed ma hatchlings, and your souls are going to feed me with power!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12040, 1, 0, 0, 'janalai SAY_EVENT_FRIENDS');
