INSERT INTO `script_texts` VALUES (23578, -1568005, 'It all be over now, mon!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12036, 1, 0, 0, 'janalai SAY_SLAY_1');
