INSERT INTO `script_texts` VALUES (23578, -1568003, 'I show you strength... in numbers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12034, 1, 0, 0, 'janalai SAY_ALL_EGGS');
INSERT INTO `script_texts` VALUES (23578, -1568002, 'Where ma hatcha? Get to work on dem eggs!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12033, 1, 0, 0, 'janalai SAY_SUMMON_HATCHER');
