INSERT INTO `script_texts` VALUES (23578, -1568000, 'Spirits of da wind be your doom!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12031, 1, 0, 0, 'janalai SAY_AGGRO');
INSERT INTO `script_texts` VALUES (23861, -1000471, 'It was... terrible... the demon...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (23861, -1000470, 'Go away,whoever you are! Witch Hill is mine... mine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (23861, -1000469, 'It is too late for us,living one. Take yourself and your friend away from here before you both are... claimed...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (23864, -1000473, 'All who venture here belong to me,including you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (23864, -1000472, 'This land was mine long before your wretched kind set foot here.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (23953, -1574004, 'I join... the night.', NULL, 'Je rejoins... la nuit.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13225, 1, 0, 0, 'keleseth SAY_DEATH');
INSERT INTO `script_texts` VALUES (23953, -1574003, 'Darkness waits', NULL, 'Les ténèbres attendent !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13223, 1, 0, 0, 'keleseth SAY_KILL');
INSERT INTO `script_texts` VALUES (23953, -1574002, 'Aranal, lidel! Their fate shall be yours!', NULL, 'Aranal, ledel, ! Leur destin vous appartiendra, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13224, 1, 0, 0, 'keleseth SAY_SKELETONS');
INSERT INTO `script_texts` VALUES (23953, -1574001, 'Not so fast.', NULL, 'Pas si vite.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13222, 1, 0, 0, 'keleseth SAY_FROST_TOMB');
INSERT INTO `script_texts` VALUES (23953, -1574000, 'Your blood is mine!', NULL, 'Votre sang est à  moi !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13221, 1, 0, 0, 'keleseth SAY_AGGRO');
INSERT INTO `script_texts` VALUES (23954, -1574010, 'I am a warrior born!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13214, 1, 0, 0, 'ingvar SAY_KILL_SECOND');
INSERT INTO `script_texts` VALUES (23954, -1574009, 'Mjul orm agn gjor!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13212, 1, 0, 0, 'ingvar SAY_KILL_FIRST');
INSERT INTO `script_texts` VALUES (23954, -1574008, 'No! I can do... better! I can...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13211, 1, 0, 0, 'ingvar SAY_DEATH_SECOND');
