INSERT INTO `script_texts` VALUES (24200, -1574012, 'Not... over... yet.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13230, 1, 0, 0, 'skarvald YELL_SKARVALD_DAL_DIED');
INSERT INTO `script_texts` VALUES (24200, -1574011, 'Dalronn! See if you can muster the nerve to join my attack!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13229, 1, 0, 0, 'skarvald YELL_SKARVALD_AGGRO');
INSERT INTO `script_texts` VALUES (24201, -1574020, 'Skarvald, you incompetent slug! Return and make yourself useful!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13203, 1, 0, 0, 'dalronn YELL_DALRONN_SKA_DIEDFIRST');
INSERT INTO `script_texts` VALUES (24201, -1574019, 'You may serve me yet.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13202, 1, 0, 0, 'dalronn YELL_DALRONN_KILL');
INSERT INTO `script_texts` VALUES (24201, -1574018, 'There\'s no... greater... glory.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13201, 1, 0, 0, 'dalronn YELL_DALRONN_DAL_DIEDFIRST');
