INSERT INTO `script_texts` VALUES (24560, -1585022, 'Not what I had... planned...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12397, 1, 0, 0, 'delrissa SAY_DEATH');
