INSERT INTO `script_texts` VALUES (24560, -1585019, 'Not really much of a group, anymore, is it?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12409, 1, 0, 0, 'delrissa PlayerDeath3');
