INSERT INTO `script_texts` VALUES (24560, -1585017, 'I call that a good start.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12405, 1, 0, 0, 'delrissa PlayerDeath1');
