INSERT INTO `script_texts` VALUES (24664, -1585027, 'Master... grant me strength.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12419, 1, 0, 0, 'kaelthas MT SAY_TIRED');
INSERT INTO `script_texts` VALUES (24664, -1585026, 'I\'ll turn your world... upside... down...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12418, 1, 0, 0, 'kaelthas MT SAY_GRAVITY_LAPSE');
INSERT INTO `script_texts` VALUES (24664, -1585025, 'Felomin ashal!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12417, 1, 0, 0, 'kaelthas MT SAY_FLAMESTRIKE');
INSERT INTO `script_texts` VALUES (24664, -1585024, 'Vengeance burns!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12415, 1, 0, 0, 'kaelthas MT SAY_PHOENIX');
INSERT INTO `script_texts` VALUES (24664, -1585023, 'Don\'t look so smug! I know what you\'re thinking, but Tempest Keep was merely a set back. Did you honestly believe I would trust the future to some blind, half-night elf mongrel? Oh no, he was merely an instrument, a stepping stone to a much larger plan! It has all led to this, and this time, you will not interfere!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12413, 1, 0, 0, 'kaelthas MT SAY_AGGRO');
INSERT INTO `script_texts` VALUES (24723, -1585006, '%s begins to channel from the nearby Fel Crystal...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'selin EMOTE_CRYSTAL');
