INSERT INTO `script_texts` VALUES (24850, -1580005, 'My awakening is complete! You shall all perish!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12427, 1, 0, 0, 'kalecgos SAY_EVIL_ENRAGE');
