INSERT INTO `script_texts` VALUES (24882, -1580035, 'Malygos, my lord! I did my best!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12476, 1, 0, 0, 'madrigosa YELL_MADR_DEATH');
