INSERT INTO `script_texts` VALUES (24882, -1580032, 'Where is Anveena, demon? What has become of Kalec?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12473, 1, 0, 0, 'madrigosa YELL_MADR_INTRO');
