INSERT INTO `script_texts` VALUES (24891, -1580009, 'I am forever in your debt. Once we have triumphed over Kil\'jaeden, this entire world will be in your debt as well.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12431, 1, 0, 0, 'kalecgos humanoid SAY_GOOD_PLRWIN');
