INSERT INTO `script_texts` VALUES (25248, -1571047, 'I suppose this is it, then? I won\'t go down quietly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_hidden_cultist SAY_HIDDEN_CULTIST_4');
