INSERT INTO `script_texts` VALUES (25250, -1571015, 'Ugh! My head won\'t stop spinning...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25250, -1571014, 'What... what happened to me?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25251, -1571020, 'Don\'t leave me again! You want to fight for your country, but they don\'t even want you! They sent you here to die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25251, -1571018, 'I thought... I thought you were... dead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25251, -1571016, 'Thassarian, you\'re alive!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (25301, -1571013, 'Yes, my lord!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25301, -1571011, 'Allow me to take care of the intruders, lord. I will feed their entrails to the maggots.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
