INSERT INTO `script_texts` VALUES (25315, -1580094, '%s begins to channel dark energy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'KJ - EMOTE_KJ_DARKNESS');
INSERT INTO `script_texts` VALUES (25315, -1580093, 'Nooooooooooooo!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12527, 1, 0, 0, 'KJ - SAY_KJ_DEATH');
INSERT INTO `script_texts` VALUES (25315, -1580091, 'Strike now, heroes, while he is weakened! Vanquish the Deceiver!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12449, 1, 0, 0, 'KJ - SAY_KALECGOS_ENCOURAGE');
INSERT INTO `script_texts` VALUES (25315, -1580090, 'Goodbye, Anveena, my love. Few will remember your name, yet this day you change the course of destiny. What was once corrupt is now pure. Heroes, do not let her sacrifice be in vain.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12450, 1, 0, 0, 'KJ - SAY_KALECGOS_GOODBYE');
INSERT INTO `script_texts` VALUES (25315, -1580089, 'The nightmare is over, the spell is broken! Goodbye, Kalec, my love!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12514, 1, 0, 0, 'KJ - SAY_ANVEENA_GOODBYE');
INSERT INTO `script_texts` VALUES (25315, -1580088, 'Yes, Anveena! Let fate embrace you now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12448, 1, 0, 0, 'KJ - SAY_KALECGOS_FATE');
INSERT INTO `script_texts` VALUES (25315, -1580087, 'Kalec... Kalec?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12513, 1, 0, 0, 'KJ - SAY_ANVEENA_KALEC');
INSERT INTO `script_texts` VALUES (25315, -1580086, 'Anveena, I love you! Focus on my voice, come back for me now! Only you can cleanse the Sunwell!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12447, 1, 0, 0, 'KJ - SAY_KALECGOS_FOCUS');
INSERT INTO `script_texts` VALUES (25315, -1580085, 'But I\'m... lost... I cannot find my way back!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12512, 1, 0, 0, 'KJ - SAY_ANVEENA_LOST');
INSERT INTO `script_texts` VALUES (25315, -1580084, 'You must let go! You must become what you were always meant to be! The time is now, Anveena!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12446, 1, 0, 0, 'KJ - SAY_KALECGOS_LETGO');
INSERT INTO `script_texts` VALUES (25315, -1580083, 'I serve only the Master now.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12511, 1, 0, 0, 'KJ - SAY_ANVEENA_IMPRISONED');
INSERT INTO `script_texts` VALUES (25315, -1580082, 'Anveena, you must awaken, this world needs you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12445, 1, 0, 0, 'KJ - SAY_KALECGOS_AWAKEN');
INSERT INTO `script_texts` VALUES (25315, -1580081, 'Aggghh! The powers of the Sunwell... turned... against me! What have you done? WHAT HAVE YOU DONE?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12510, 1, 0, 0, 'KJ - SAY_KJ_PHASE5');
INSERT INTO `script_texts` VALUES (25315, -1580080, 'Do not harbor false hope. You cannot win!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12509, 1, 0, 0, 'KJ - SAY_KJ_PHASE4');
INSERT INTO `script_texts` VALUES (25315, -1580079, 'I will not be denied! This world shall fall!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12508, 1, 0, 0, 'KJ - SAY_KJ_PHASE3');
INSERT INTO `script_texts` VALUES (25315, -1580078, 'Oblivion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12507, 1, 0, 0, 'KJ - SAY_KJ_DARKNESS3');
INSERT INTO `script_texts` VALUES (25315, -1580077, 'Destruction!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12506, 1, 0, 0, 'KJ - SAY_KJ_DARKNESS2');
INSERT INTO `script_texts` VALUES (25315, -1580076, 'Chaos!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12505, 1, 0, 0, 'KJ - SAY_KJ_DARKNESS1');
INSERT INTO `script_texts` VALUES (25315, -1580075, 'The enemy is among you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12504, 1, 0, 0, 'KJ - SAY_KJ_REFLECTION2');
INSERT INTO `script_texts` VALUES (25315, -1580074, 'Who can you trust?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12503, 1, 0, 0, 'KJ - SAY_KJ_REFLECTION1');
INSERT INTO `script_texts` VALUES (25315, -1580073, 'Anak-ky\'ri!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12502, 1, 0, 0, 'KJ - SAY_KJ_SLAY2');
INSERT INTO `script_texts` VALUES (25315, -1580072, 'Another step towards destruction!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12501, 1, 0, 0, 'KJ - SAY_KJ_SLAY1');
INSERT INTO `script_texts` VALUES (25315, -1580071, 'The expendible have perished... So be it! Now I shall succeed where Sargeras could not! I will bleed this wretched world and secure my place as the true master of the Burning Legion. The end has come! Let the unraveling of this world commence!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12500, 1, 0, 0, 'KJ - SAY_KJ_EMERGE');
INSERT INTO `script_texts` VALUES (25319, -1580098, 'I have channeled all I can! The power is in your hands!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12443, 1, 0, 0, 'KJ - SAY_KALEC_ORB_READY4');
INSERT INTO `script_texts` VALUES (25319, -1580097, 'Another orb is ready! Make haste!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12442, 1, 0, 0, 'KJ - SAY_KALEC_ORB_READY3');
INSERT INTO `script_texts` VALUES (25319, -1580096, 'I have empowered another orb! Use it quickly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12441, 1, 0, 0, 'KJ - SAY_KALEC_ORB_READY2');
INSERT INTO `script_texts` VALUES (25319, -1580095, 'I will channel my power into the orbs, be ready!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12440, 1, 0, 0, 'KJ - SAY_KALEC_ORB_READY1');
INSERT INTO `script_texts` VALUES (25319, -1580092, 'You are not alone. The Blue Dragonflight shall help you vanquish the Deceiver.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12438, 1, 0, 0, 'KJ - SAY_KALECGOS_JOIN');
INSERT INTO `script_texts` VALUES (25478, -1571030, 'Noooo! This torture is inhumane! You have what you want... why don\'t you just kill me?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571029, 'I\'ve given you the information, $C ! You\'re wasting your time....', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571028, 'Alright! I am beaten. Your previous archmage is held in a prison, elevated and sealed. Even if you manage to reach her, Salrand herself holds the key. Your mission is folly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571027, 'Stop! I beg you, please stop. Please...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571026, 'Aahhhh! Release me! I am of no use to you. I swear it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571025, 'Aargh! Do your worst, $C ! I\'ll tell you NOTHING!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25478, -1571024, 'Pathetic fool! A servant of Malygos would sooner die than aid an enemy...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (25504, -1750044, 'Father! You\'re safe!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_mootoo_the_younger');
INSERT INTO `script_texts` VALUES (25504, -1750043, 'There\'s no sign of it ending! Where could my father be?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_mootoo_the_younger');
INSERT INTO `script_texts` VALUES (25504, -1750042, 'What could this be?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_mootoo_the_younger');
INSERT INTO `script_texts` VALUES (25504, -1750041, 'Watch out for the monsters!Which way should we go first? Let\'s try this way...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_mootoo_the_younger');
INSERT INTO `script_texts` VALUES (25504, -1750040, 'My father\'s aura is quite strong,he cannot be far. Could you be a doll and fight off the monsters wandering throught the mist?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_mootoo_the_younger');
INSERT INTO `script_texts` VALUES (25589, -1700003, 'I\'ll make you a deal: If you get me out of here alive,you\'ll get a reward larger than you can imagine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_bonker_togglevolt');
INSERT INTO `script_texts` VALUES (25589, -1700002, 'I AM NOT AN APPETIZER!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_bonker_togglevolt');
INSERT INTO `script_texts` VALUES (25589, -1700001, 'Right then,no time to waste. Lets get outa here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_bonker_togglevolt');
INSERT INTO `script_texts` VALUES (25608, -1580070, 'Drain the girl! Drain her power until there is nothing but a vacant shell!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12499, 1, 0, 0, 'KJ - SAY_KJ_OFFCOMBAT5');
INSERT INTO `script_texts` VALUES (25608, -1580069, 'Fail me and suffer for eternity!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12498, 1, 0, 0, 'KJ - SAY_KJ_OFFCOMBAT4');
INSERT INTO `script_texts` VALUES (25608, -1580068, 'I have waited long enough!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12497, 1, 0, 0, 'KJ - SAY_KJ_OFFCOMBAT3');
INSERT INTO `script_texts` VALUES (25608, -1580067, 'Stay on task! Do not waste time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12496, 1, 0, 0, 'KJ - SAY_KJ_OFFCOMBAT2');
INSERT INTO `script_texts` VALUES (25608, -1580066, 'All my plans have led to this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12495, 1, 0, 0, 'KJ - SAY_KJ_OFFCOMBAT1');
INSERT INTO `script_texts` VALUES (25827, -1571046, 'You don\'t know who you\'re messing with! Death beckons!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_hidden_cultist SAY_HIDDEN_CULTIST_3');
INSERT INTO `script_texts` VALUES (25828, -1571045, 'Finally! This charade is over... Arthas give me strength!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'npc_hidden_cultist SAY_HIDDEN_CULTIST_2');
INSERT INTO `script_texts` VALUES (26170, -1571023, 'Do not worry, Leryssa. I will come back to you when I\'m done. Nothing in the world will stop me from coming home to the only family that I have left.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571022, 'I know that look in your eye... I\'m not going to be able to talk you out of this. If you die on me again...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571021, 'You might be right, sister. My obligations to my land and King have been fulfilled. But there is still something that I owe to myself.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571019, 'I cannot return home with you just yet, Leryssa. I am not quite done with the Scourge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571017, 'Leryssa... you... you\'re all right!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571010, 'I would sooner slit my own throat. You will pay for what you did to your own men, Arthas... for what you did to me! I swear it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571008, 'What have you done to my sister, you motherless elf scum!?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (26170, -1571007, 'Leryssa!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (26203, -1571012, 'Do not fail me, San\'layn. Return to Icecrown with this fool\'s head or do not bother to return.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26203, -1571009, 'Now this is a surprise, Thassarian. I hadn\'t heard from Mograine or the other death knights for months. You\'ve come to rejoin the Scourge, I take it?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26203, -1571006, 'The power you\'ve bestowed upon me has allowed me great mental influence over human minds. I bear these offerings as proof of my progress.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26203, -1571005, 'Your progress in this region has been impressive, Blood Prince. I am pleased...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (26497, -1595086, 'I\'m sorry, Arthas. I can\'t watch you do this.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12838, 0, 0, 1, 'culling SAY_PHASE117');
INSERT INTO `script_texts` VALUES (26497, -1595082, 'Arthas! You can\'t just--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12837, 0, 0, 0, 'culling SAY_PHASE113');
INSERT INTO `script_texts` VALUES (26499, -1595120, 'You performed well this day. Anything that Mal\'Ganis has left behind is yours. Take it as your reward. I must now begin plans for an expedition to Northrend.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14319, 0, 0, 1, 'culling SAY_PHASE504');
INSERT INTO `script_texts` VALUES (26499, -1595119, 'I\'ll hunt you to the ends of the earth if I have to! Do you hear me? To the ends of the earth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14318, 0, 0, 0, 'culling SAY_PHASE503');
INSERT INTO `script_texts` VALUES (26499, -1595118, 'We\'re going to finish this right now, Mal\'Ganis. Just you... and me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14317, 0, 0, 5, 'culling SAY_PHASE502');
INSERT INTO `script_texts` VALUES (26499, -1595117, 'Justice will be done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14316, 0, 0, 0, 'culling SAY_PHASE501');
INSERT INTO `script_texts` VALUES (26499, -1595116, 'At last some good luck. Market Row has not caught fire yet. Mal\'Ganis is supposed to be in Crusaders\' Square, which is just ahead. Tell me when you\'re ready to move forward.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14315, 0, 0, 396, 'culling SAY_PHASE407');
INSERT INTO `script_texts` VALUES (26499, -1595115, 'That\'s enough; we must move again. Mal\'Ganis awaits.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14314, 0, 0, 396, 'culling SAY_PHASE406');
INSERT INTO `script_texts` VALUES (26499, -1595114, 'Rest a moment and clear your lungs, but we must move again soon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14313, 0, 0, 396, 'culling SAY_PHASE405');
INSERT INTO `script_texts` VALUES (26499, -1595113, 'Let\'s move through here as quickly as possible. If the undead don\'t kill us, the fires might.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14312, 0, 0, 396, 'culling SAY_PHASE404');
INSERT INTO `script_texts` VALUES (26499, -1595112, 'I\'m relieved this secret passage still works.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14311, 0, 0, 0, 'culling SAY_PHASE403');
INSERT INTO `script_texts` VALUES (26499, -1595111, 'This will only take a moment.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14310, 0, 0, 432, 'culling SAY_PHASE402');
INSERT INTO `script_texts` VALUES (26499, -1595110, 'The quickest path to Mal\'Ganis lies behind that bookshelf ahead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14308, 0, 0, 0, 'culling SAY_PHASE401');
INSERT INTO `script_texts` VALUES (26499, -1595109, 'I do what I must for Lordaeron, and neither your words nor your actions will stop me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14309, 0, 0, 396, 'culling SAY_PHASE315');
INSERT INTO `script_texts` VALUES (26499, -1595108, 'What else can he put in my way?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14307, 0, 0, 396, 'culling SAY_PHASE313');
INSERT INTO `script_texts` VALUES (26499, -1595107, 'They\'re very persistent.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14306, 0, 0, 396, 'culling SAY_PHASE312');
INSERT INTO `script_texts` VALUES (26499, -1595106, 'Mal\'Ganis is not making this easy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14305, 0, 0, 396, 'culling SAY_PHASE311');
INSERT INTO `script_texts` VALUES (26499, -1595105, 'One less obstacle to deal with.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'culling SAY_PHASE310. NEEDS VERIFICATION');
INSERT INTO `script_texts` VALUES (26499, -1595104, 'Watch your backs: they have us surrounded in this hall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14304, 0, 0, 1, 'culling SAY_PHASE309');
INSERT INTO `script_texts` VALUES (26499, -1595103, 'Let\'s move on.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14303, 0, 0, 396, 'culling SAY_PHASE308');
INSERT INTO `script_texts` VALUES (26499, -1595102, 'More vile sorcery! Be ready for anything!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14302, 0, 0, 0, 'culling SAY_PHASE307');
INSERT INTO `script_texts` VALUES (26499, -1595101, 'Mal\'Ganis appears to have more than scourge in his arsenal. We should make haste.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14301, 0, 0, 0, 'culling SAY_PHASE306. NEEDS VERIFICATION');
INSERT INTO `script_texts` VALUES (26499, -1595099, 'What is this sorcery?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14300, 0, 0, 0, 'culling SAY_PHASE304');
INSERT INTO `script_texts` VALUES (26499, -1595098, 'Yes, I\'m glad I could get to you before the plague.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14299, 0, 0, 1, 'culling SAY_PHASE303');
INSERT INTO `script_texts` VALUES (26499, -1595096, 'Follow me, I know the way through.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14298, 0, 0, 1, 'culling SAY_PHASE301');
INSERT INTO `script_texts` VALUES (26499, -1595095, 'Champions, meet me at the Town Hall at once. We must take the fight to Mal\'Ganis.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14297, 1, 0, 1, 'culling SAY_PHASE210');
INSERT INTO `script_texts` VALUES (26499, -1595094, 'Mal\'ganis will send out some of his Scourge minions to interfere with us. Those of you with the strongest steel and magic shall go forth and destroy them. I will lead the rest of my forces in purging Stratholme of the infected.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14885, 1, 0, 1, 'culling SAY_PHASE209');
INSERT INTO `script_texts` VALUES (26499, -1595093, 'I won\'t allow it, Mal\'Ganis! Better that these people die by my hand than serve as your slaves in death!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14296, 1, 0, 397, 'culling SAY_PHASE208');
INSERT INTO `script_texts` VALUES (26499, -1595092, 'That was just the beginning.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14295, 0, 0, 1, 'culling SAY_PHASE205');
INSERT INTO `script_texts` VALUES (26499, -1595090, 'I can only help you with a clean death.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14294, 0, 0, 0, 'culling SAY_PHASE203');
INSERT INTO `script_texts` VALUES (26499, -1595088, 'Everyone looks ready. Remember, these people are all infected with the plague and will die soon. We must purge Stratholme to protect the remainder of Lordaeron from the Scourge. Let\'s go.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14293, 0, 0, 396, 'culling SAY_PHASE201');
INSERT INTO `script_texts` VALUES (26499, -1595087, 'Take position here, and I will lead a small force inside Stratholme to begin the culling. We must contain and purge the infected for the sake of all of Lordaeron!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14327, 1, 0, 1, 'culling SAY_PHASE118');
INSERT INTO `script_texts` VALUES (26499, -1595085, 'Jaina?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12836, 0, 0, 0, 'culling SAY_PHASE116');
INSERT INTO `script_texts` VALUES (26499, -1595083, 'It\'s done! Those of you who have the will to save this land, follow me! The rest of you... get out of my sight!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12835, 0, 0, 1, 'culling SAY_PHASE114');
INSERT INTO `script_texts` VALUES (26499, -1595081, 'Have I? Lord Uther, by my right of succession and the sovereignty of my crown, I hereby relieve you of your command and suspend your paladins from service.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12834, 0, 0, 0, 'culling SAY_PHASE112');
INSERT INTO `script_texts` VALUES (26499, -1595079, 'Then I must consider this an act of treason.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12833, 0, 0, 396, 'culling SAY_PHASE110');
INSERT INTO `script_texts` VALUES (26499, -1595077, 'Damn it, Uther! As your future king, I order you to purge this city!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12832, 0, 0, 5, 'culling SAY_PHASE108');
INSERT INTO `script_texts` VALUES (26499, -1595075, 'This entire city must be purged.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12831, 0, 0, 396, 'culling SAY_PHASE106');
INSERT INTO `script_texts` VALUES (26499, -1595073, 'Oh, no. We\'re too late. These people have all been infected! They may look fine now, but it\'s just a matter of time before they turn into the undead!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12830, 0, 0, 5, 'culling SAY_PHASE104');
INSERT INTO `script_texts` VALUES (26499, -1595072, 'As if I could forget. Listen, Uther, there\'s something about the plague you should know...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12829, 0, 0, 0, 'culling SAY_PHASE103');
INSERT INTO `script_texts` VALUES (26499, -1595070, 'Glad you could make it, Uther.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12828, 0, 0, 396, 'culling SAY_PHASE101');
INSERT INTO `script_texts` VALUES (26528, -1595084, 'You\'ve just crossed a terrible threshold, Arthas.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12844, 0, 0, 397, 'culling SAY_PHASE115');
INSERT INTO `script_texts` VALUES (26528, -1595080, 'Treason? Have you lost your mind, Arthas?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12843, 0, 0, 5, 'culling SAY_PHASE111');
INSERT INTO `script_texts` VALUES (26528, -1595078, 'You are not my king yet, boy! Nor would I obey that command even if you were!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12842, 0, 0, 396, 'culling SAY_PHASE109');
INSERT INTO `script_texts` VALUES (26528, -1595076, 'How can you even consider that? There\'s got to be some other way.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12841, 0, 0, 6, 'culling SAY_PHASE107');
INSERT INTO `script_texts` VALUES (26528, -1595074, 'What?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12840, 0, 0, 5, 'culling SAY_PHASE105');
INSERT INTO `script_texts` VALUES (26528, -1595071, 'Watch your tone with me, boy. You may be the prince, but I\'m still your superior as a paladin!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 12839, 0, 0, 397, 'culling SAY_PHASE102');
INSERT INTO `script_texts` VALUES (26529, -1595031, 'This... not fun...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13433, 1, 0, 0, 'meathook SAY_DEATH');
INSERT INTO `script_texts` VALUES (26529, -1595030, 'New toys!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13429, 1, 0, 0, 'meathook SAY_SPAWN');
INSERT INTO `script_texts` VALUES (26529, -1595029, 'Get up! Me not done!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13432, 1, 0, 0, 'meathook SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (26529, -1595028, 'Why you stop moving?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13431, 1, 0, 0, 'meathook SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (26529, -1595027, 'Boring...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13430, 1, 0, 0, 'meathook SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (26529, -1595026, 'Play time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13428, 1, 0, 0, 'meathook SAY_AGGRO');
INSERT INTO `script_texts` VALUES (26530, -1595044, 'Come, citizen of Stratholme! Meet your saviors.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13477, 1, 0, 0, 'salramm SAY_SUMMON_GHOULS_2');
INSERT INTO `script_texts` VALUES (26530, -1595043, 'Say hello to some friends of mine.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13476, 1, 0, 0, 'salramm SAY_SUMMON_GHOULS_1');
INSERT INTO `script_texts` VALUES (26530, -1595042, 'Your flesh betrays you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13482, 1, 0, 0, 'salramm SAY_STEAL_FLESH_3');
INSERT INTO `script_texts` VALUES (26530, -1595041, 'Such strength... it must be mine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13481, 1, 0, 0, 'salramm SAY_STEAL_FLESH_2');
INSERT INTO `script_texts` VALUES (26530, -1595040, 'I want a sample...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13480, 1, 0, 0, 'salramm SAY_STEAL_FLESH_1');
INSERT INTO `script_texts` VALUES (26530, -1595039, 'Blood... destruction... EXHILARATING!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13479, 1, 0, 0, 'salramm SAY_EXPLODE_GHOUL_2');
INSERT INTO `script_texts` VALUES (26530, -1595038, 'BOOM! Hahahahah...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13478, 1, 0, 0, 'salramm SAY_EXPLODE_GHOUL_1');
INSERT INTO `script_texts` VALUES (26530, -1595037, 'You only advance... the master\'s plan...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13483, 1, 0, 0, 'salramm SAY_DEATH');
INSERT INTO `script_texts` VALUES (26530, -1595036, 'Don\'t worry, I\'ll make good use of you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13475, 1, 0, 0, 'salramm SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (26530, -1595035, 'Aah, quality materials!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13474, 1, 0, 0, 'salramm SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (26530, -1595034, 'The fun is just beginning!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13473, 1, 0, 0, 'salramm SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (26530, -1595033, 'You are too late, champion of Lordaeron. The dead shall have their day.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13471, 1, 0, 0, 'salramm SAY_SPAWN');
INSERT INTO `script_texts` VALUES (26530, -1595032, 'Ah, the entertainment has arrived!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13472, 1, 0, 0, 'salramm SAY_AGGRO');
INSERT INTO `script_texts` VALUES (26532, -1595008, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13416, 0, 0, 0, 'epoch SAY_DEATH');
INSERT INTO `script_texts` VALUES (26532, -1595007, 'You were destined to fail.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13415, 1, 0, 0, 'epoch SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (26532, -1595006, 'This is the hour of our greatest triumph!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13414, 1, 0, 0, 'epoch SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (26532, -1595005, 'There is no future for you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13413, 1, 0, 0, 'epoch SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (26532, -1595004, 'Let\'s get this over with. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13412, 1, 0, 0, 'epoch SAY_TIME_WARP_3');
INSERT INTO `script_texts` VALUES (26532, -1595003, 'Not quick enough!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13411, 1, 0, 0, 'epoch SAY_TIME_WARP_2');
INSERT INTO `script_texts` VALUES (26532, -1595002, 'Tick tock, tick tock...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13410, 1, 0, 0, 'epoch SAY_TIME_WARP_1');
INSERT INTO `script_texts` VALUES (26532, -1595001, 'We\'ll see about that, young prince.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13409, 1, 0, 0, 'epoch SAY_AGGRO');
INSERT INTO `script_texts` VALUES (26532, -1595000, 'Prince Arthas Menethil, on this day, a powerful darkness has taken hold of your soul. The death you are destined to visit upon others will this day be your own.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13408, 1, 0, 0, 'epoch SAY_INTRO | culling SAY_PHASE314');
INSERT INTO `script_texts` VALUES (26533, -1595025, 'Your journey has just begun, young prince. Gather your forces and meet me in the artic land of Northrend. It is there that we shall settle the score between us. It is there that your true destiny will unfold.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14412, 1, 0, 1, 'mal_ganis SAY_OUTRO');
INSERT INTO `script_texts` VALUES (26533, -1595024, 'You\'ll never defeat the Lich King without my forces! I\'ll have my revenge...on him, AND you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14429, 1, 0, 0, 'mal_ganis SAY_ESCAPE_SPEECH_2');
INSERT INTO `script_texts` VALUES (26533, -1595023, 'ENOUGH! I waste my time here...I must gather my strength on the home world...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14428, 1, 0, 0, 'mal_ganis SAY_ESCAPE_SPEECH_1');
INSERT INTO `script_texts` VALUES (26533, -1595022, '(Eredun) I AM MAL\'GANIS! I AM ETERNAL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14427, 1, 0, 0, 'mal_ganis SAY_15HEALTH');
INSERT INTO `script_texts` VALUES (26533, -1595021, 'I spent too much time in that weak little shell...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14426, 1, 0, 0, 'mal_ganis SAY_30HEALTH');
INSERT INTO `script_texts` VALUES (26533, -1595020, 'You seem...tired...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14415, 1, 0, 0, 'mal_ganis SAY_SLEEP_2');
INSERT INTO `script_texts` VALUES (26533, -1595019, 'Time out...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14414, 1, 0, 0, 'mal_ganis SAY_SLEEP_1');
INSERT INTO `script_texts` VALUES (26533, -1595018, 'Your time has come to an end!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14425, 1, 0, 0, 'mal_ganis SAY_SLAY_4');
INSERT INTO `script_texts` VALUES (26533, -1595017, 'Your death is in vain, tiny mortal...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14424, 1, 0, 0, 'mal_ganis SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (26533, -1595016, 'My onslaught will wash over the Lich King\'s forces...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14423, 1, 0, 0, 'mal_ganis SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (26533, -1595015, 'Anak\'Keri...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14422, 1, 0, 0, 'mal_ganis SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (26533, -1595014, 'It is Prince Arthas I want... not you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14418, 1, 0, 0, 'mal_ganis SAY_KILL_3');
INSERT INTO `script_texts` VALUES (26533, -1595013, 'The dark lord is displeased with your interference...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14417, 1, 0, 0, 'mal_ganis SAY_KILL_2');
INSERT INTO `script_texts` VALUES (26533, -1595012, 'All too easy...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14416, 1, 0, 0, 'mal_ganis SAY_KILL_1');
INSERT INTO `script_texts` VALUES (26533, -1595011, 'This will be a fine test...Prince Arthas...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14413, 1, 0, 0, 'mal_ganis SAY_AGGRO');
INSERT INTO `script_texts` VALUES (26533, -1595010, 'As you can see, your people are now mine. I will now turn this city household by household, until the flame of life has been snuffed out... forever.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14411, 1, 0, 0, 'mal_ganis SAY_INTRO_2 | culling SAY_PHASE207');
INSERT INTO `script_texts` VALUES (26533, -1595009, 'Yes, this is the beginning. I\'ve been waiting for you, young prince. I am Mal\'Ganis.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14410, 1, 0, 0, 'mal_ganis SAY_INTRO_1 | culling SAY_PHASE206');
INSERT INTO `script_texts` VALUES (26588, -1800013, 'Thank you for helping me get back to the camp. Go tell Walter that I\'m safe now!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800012, 'Are you ready, Mr. Floppy? Stay close to me and watch out for those wolves!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800011, 'The Ravenous Worg chomps down on Mr. Floppy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800010, 'Mr. Floppy revives', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800009, 'I think I see the camp! We\'re almost home, Mr. Floppy! Let\'s go!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800008, 'Mr. Floppy, you\'re ok! Thank you so much for saving Mr. Floppy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800007, 'Don\'t go toward the light, Mr. Floppy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800006, 'Let\'s get out of here before more wolves find us!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
INSERT INTO `script_texts` VALUES (26588, -1800005, 'There\'s a big meanie attacking Mr. Floppy! Help! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '12027');
