INSERT INTO `script_texts` VALUES (26861, -1575037, 'Tor of the Brutal Siege! Bestow your might upon me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13613, 1, 0, 0, 'King Ymirom - SAY_SUMMON_TORGYN');
