INSERT INTO `script_texts` VALUES (27316, -1800041, 'Let\'s you and I have a chat about some things,Godfrey.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800040, 'Return to Halford with the information the good mayor was kind enough to submit,$N,I will finish here and squeeze whatever else this wretch might know about Thel\'zan. Now,I will show Godfrey the rarely shown \"option three.\" ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800039, 'You let us worry about how we kill the bastard,Godfrey. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800036, 'What? There is a mausoleum beneath the old village? What fools we are to not have noticed. We will find and strike down your master now,Godfrey. We will end this nightmare. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800033, 'RUBBISH! Godfrey do you take me for a fool? Do not spew your Scourge propaganda at a man of the Light,heathen! Speak now or I will have the peasants craft a holy water bath and dip you into it like a dog with fleas! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800031, 'I thought you would see the Light,Godfrey... Now speak quickly,fiend. What does it say? ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800030, 'The power of the Lich King pales in comparison to the glory of the Light! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800029, 'LIGHT TAKE YOU,BEAST! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800027, 'LET THE LIGHT IN,GODFREY GODDARD! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800026, 'May the power of Light compel you! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800024, 'LET THE LIGHT IN,GODFREY GODDARD! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800023, 'Let the sermon begin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800022, 'I say a prayer for you now,lost soul. May the Light take you gracefully. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800021, 'Then it is option two. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800017, 'We can do this in one of two ways,Godfrey. First,I will simply ask you to tell me what the unholy markings etched upon the pages of this tome mean. What say you? ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800016, 'Good,I have your attention,then,Godfrey? ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800015, 'GODFREY! Hear me,fiend! Hear me,for I am the Light,here to deliver you from evil! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27316, -1800014, 'Stand back,$N,the beast might lash out and harm you. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27447, -1578029, 'Intruders, your victory will be short-lived. I am Commander Varos Cloudstrider. My drakes control the skies and protest this conduit. I will see to it personally that the Oculus does not fall into your hands!', '', '', '', '', '', '', '', '', NULL, NULL, 13648, 1, 0, 0, 'varos SAY_SPAWN');
INSERT INTO `script_texts` VALUES (27447, -1578028, 'Strike now! Obliterate them!', '', '', '', '', '', '', '', '', NULL, NULL, 13652, 1, 0, 0, 'varos SAY_STRIKE_3');
INSERT INTO `script_texts` VALUES (27447, -1578027, 'Take no prisoners! Attack!', '', '', '', '', '', '', '', '', NULL, NULL, 13651, 1, 0, 0, 'varos SAY_STRIKE_2');
INSERT INTO `script_texts` VALUES (27447, -1578026, 'Blast them! Destroy them!', '', '', '', '', '', '', '', '', NULL, NULL, 13650, 1, 0, 0, 'varos SAY_STRIKE_1');
INSERT INTO `script_texts` VALUES (27447, -1578025, 'They are... too strong! Underestimated their... fortitude.', '', '', '', '', '', '', '', '', NULL, NULL, 13655, 1, 0, 0, 'varos SAY_DEATH');
INSERT INTO `script_texts` VALUES (27447, -1578024, 'The Oculus is ours.', '', '', '', '', '', '', '', '', NULL, NULL, 13654, 1, 0, 0, 'varos SAY_KILL_2');
INSERT INTO `script_texts` VALUES (27447, -1578023, 'You were warned.', '', '', '', '', '', '', '', '', NULL, NULL, 13653, 1, 0, 0, 'varos SAY_KILL_1');
INSERT INTO `script_texts` VALUES (27447, -1578022, 'There will be no mercy!', '', '', '', '', '', '', '', '', NULL, NULL, 13649, 1, 0, 0, 'varos SAY_AGGRO');
