INSERT INTO `script_texts` VALUES (27577, -1800038, 'You cannot stop Thel\'zan! He bears the dark gift,bestowed upon him by the Lich King himself! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800037, 'How? Humans truly are stupid,yes? Thel\'zan the Duskbringer! Thel\'zan the Lich! He who is born of human flesh and bone,sacrificed all power,protected by the Lich King! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800035, 'Humans... Beneath the earth of Wintergarde Village you built a mausoleum! Why do you think Naxxramas attacked that spot? Thel\'zan hides deep in your own crypt and sends a thousand-thousand corpses at you! Perish you will... ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800034, 'NOOOO!!! I tell you! I tell you everything! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800032, 'It tells of the coming apocalypse. How this world will burn and be reborn from death. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800028, 'Never felt hurt like this! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800025, 'IT BURNSSSSS! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800020, 'The book is your salvation,yes... but nothing will you know. NOTHING I SAY! NOTHING! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800019, 'What can you do to me that Kel\'Thuzad has not? That the Lich King will not? ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (27577, -1800018, 'Tell you nothing,preacher. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
