INSERT INTO `script_texts` VALUES (27655, -1578021, 'Still you fight. Still you cling to misguided principles. If you survive, you\'ll find me in the center ring.', '', '', '', '', '', '', '', '', NULL, NULL, 13637, 1, 0, 0, 'urom SAY_SUMMON_3');
INSERT INTO `script_texts` VALUES (27655, -1578020, 'Clearly my pets failed. Perhaps another demonstration is in order.', '', '', '', '', '', '', '', '', NULL, NULL, 13636, 1, 0, 0, 'urom SAY_SUMMON_2');
INSERT INTO `script_texts` VALUES (27655, -1578019, 'What do we have here... those would defy the Spell-Weaver? Those without foresight or understanding. How could I make you see? Malygos is saving the world from itself! Bah! You are hardly worth my time!', '', '', '', '', '', '', '', '', NULL, NULL, 13635, 1, 0, 0, 'urom SAY_SUMMON_1');
INSERT INTO `script_texts` VALUES (27655, -1578018, 'So much unstable energy... but worth the risk to destroy you!', '', '', '', '', '', '', '', '', NULL, NULL, 13640, 1, 0, 0, 'urom SAY_EXPLOSION_2');
INSERT INTO `script_texts` VALUES (27655, -1578017, 'A taste... just a small taste... of the Spell-Weaver\'s power!', '', '', '', '', '', '', '', '', NULL, NULL, 13639, 1, 0, 0, 'urom SAY_EXPLOSION_1');
INSERT INTO `script_texts` VALUES (27655, -1578016, 'Everything I\'ve done... has been for Azeroth...', '', '', '', '', '', '', '', '', NULL, NULL, 13644, 1, 0, 0, 'urom SAY_DEATH');
INSERT INTO `script_texts` VALUES (27655, -1578015, 'Unfortunate, but necessary.', '', '', '', '', '', '', '', '', NULL, NULL, 13643, 1, 0, 0, 'urom SAY_KILL_3');
INSERT INTO `script_texts` VALUES (27655, -1578014, 'Now, do you see? DO YOU?!', '', '', '', '', '', '', '', '', NULL, NULL, 13642, 1, 0, 0, 'urom SAY_KILL_2');
INSERT INTO `script_texts` VALUES (27655, -1578013, 'If only you understood!', '', '', '', '', '', '', '', '', NULL, NULL, 13641, 1, 0, 0, 'urom SAY_KILL_1');
