INSERT INTO `script_texts` VALUES (27975, -1599006, 'So much lost time... that you\'ll never get back!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13492, 1, 0, 0, 'maiden of grief SAY_STUN');
INSERT INTO `script_texts` VALUES (27975, -1599005, 'I hope you all rot! I never...wanted...this.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13493, 1, 0, 0, 'maiden of grief SAY_DEATH');
INSERT INTO `script_texts` VALUES (27975, -1599004, 'This is your own fault!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13491, 1, 0, 0, 'maiden of grief SAY_SLAY_4');
INSERT INTO `script_texts` VALUES (27975, -1599003, 'My burden grows heavier.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13490, 1, 0, 0, 'maiden of grief SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (27975, -1599002, 'You had it coming!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13489, 1, 0, 0, 'maiden of grief SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (27975, -1599001, 'Why must it be this way?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13488, 1, 0, 0, 'maiden of grief SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (27975, -1599000, 'You shouldn\'t have come...now you will die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13487, 1, 0, 0, 'maiden of grief SAY_AGGRO');
INSERT INTO `script_texts` VALUES (27977, -1599010, 'Break.... you....', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14178, 1, 0, 0, 'krystallus SAY_SHATTER');
INSERT INTO `script_texts` VALUES (27977, -1599009, 'Uuuuhhhhhhhhhh......', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14179, 1, 0, 0, 'krystallus SAY_DEATH');
