INSERT INTO `script_texts` VALUES (27978, -1599015, 'Loken will not rest, until the forge is retaken. You changed nothing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14184, 1, 0, 0, 'Sjonnir SAY_DEATH');
INSERT INTO `script_texts` VALUES (27978, -1599014, 'Folvynn buul hrom onn!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Sjonnir The Ironshaper SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (27978, -1599013, 'Armies of iron will smother the world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14183, 1, 0, 0, 'Sjonnir SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (27978, -1599012, 'Flesh is no match for iron!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14182, 1, 0, 0, 'Sjonnir SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (27978, -1599011, 'Soft, vulnerable shells. Brief, fragile lives. You can not escape the curse of flesh!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14180, 1, 0, 0, 'Sjonnir SAY_AGGRO');
INSERT INTO `script_texts` VALUES (28070, -1599068, 'I think it\'s time to see what\'s behind the door near the entrance. I\'m going to sneak over there, nice and quiet. Meet me at the door and I\'ll get us in.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'brann SAY_ENTRANCE_MEET');
INSERT INTO `script_texts` VALUES (28070, -1599067, 'I\'ll use the forge to make badtches o\' earthen to stand guard... But our greatest challenge still remains: find and stop Loken!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14279, 1, 0, 0, 'brann SAY_VICTORY_SJONNIR_2');
INSERT INTO `script_texts` VALUES (28070, -1599066, 'Loken?! That\'s downright bothersome... We might\'ve neutralized the iron dwarves, but I\'d lay odds there\'s another machine somewhere else churnin\' out a whole mess o\' these iron vrykul!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14278, 1, 0, 0, 'brann SAY_VICTORY_SJONNIR_1');
INSERT INTO `script_texts` VALUES (28070, -1599065, 'Acknowledged Branbronzan. Session terminated.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13773, 1, 0, 0, 'brann SAY_EVENT_END_21_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599064, 'Well now. That\'s a lot to digest. I\'m gonna need some time to take all of this in. Thank you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14273, 1, 0, 0, 'brann SAY_EVENT_END_20');
INSERT INTO `script_texts` VALUES (28070, -1599063, 'Essentially that is correct.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13764, 1, 0, 0, 'brann SAY_EVENT_END_19_MARN');
INSERT INTO `script_texts` VALUES (28070, -1599062, 'This Loken sounds like a nasty character. Glad we don\'t have to worry about the likes of him anymore. So if I\'m understanding you lads the original Earthen eventually woke up from this statis. And by that time this destabily-whatever had turned them into our brother dwarfs. Or at least dwarf ancestors. Hm?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14272, 1, 0, 0, 'brann SAY_EVENT_END_18');
INSERT INTO `script_texts` VALUES (28070, -1599061, 'Unknown. Data suggests that impetus for global combat originated with prime designate Loken who neutralized all remaining Aesir and Vanir affecting termination of conflict. Prime designate Loken then initiated stasis of several seed races including Earthen, Giant and Vrykul at designated holding facilities.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13763, 1, 0, 0, 'brann SAY_EVENT_END_17_MARN');
INSERT INTO `script_texts` VALUES (28070, -1599060, 'Hold everything! The Aesir and Vanir went to war? Why?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14271, 1, 0, 0, 'brann SAY_EVENT_END_16');
INSERT INTO `script_texts` VALUES (28070, -1599059, 'Additional background is relevant to your query. Following global combat between-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13762, 1, 0, 0, 'brann SAY_EVENT_END_15_MARN');
INSERT INTO `script_texts` VALUES (28070, -1599058, 'Aesir and Vanir. Okay. So the Forge of Wills started to make new Earthen. But what happened to the old ones?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14270, 1, 0, 0, 'brann SAY_EVENT_END_14');
INSERT INTO `script_texts` VALUES (28070, -1599057, 'Designations: Aesir and Vanir or in common nomenclator Storm and Earth Giants. Sentinel Loken designated supreme. Dragon Aspects appointed to monitor evolution of Azeroth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13759, 1, 0, 0, 'brann SAY_EVENT_END_13_KADD');
INSERT INTO `script_texts` VALUES (28070, -1599056, 'What protectors?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14269, 1, 0, 0, 'brann SAY_EVENT_END_12');
INSERT INTO `script_texts` VALUES (28070, -1599055, 'Correct. Creators neutralized parasitic threat and contained it within the host. Forge of Wills and other systems were instituted to create new Earthen. Safeguards were implemented and protectors were appointed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13758, 1, 0, 0, 'brann SAY_EVENT_END_11_KADD');
INSERT INTO `script_texts` VALUES (28070, -1599054, 'If they killed the Old Gods Azeroth would have been destroyed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14268, 1, 0, 0, 'brann SAY_EVENT_END_10');
INSERT INTO `script_texts` VALUES (28070, -1599053, 'Accessing. Creators arrived to extirpate symbiotic infection. Assessment revealed that Old God infestation had grown malignant. Excising parasites would result in loss of host.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13757, 1, 0, 0, 'brann SAY_EVENT_END_09_KADD');
INSERT INTO `script_texts` VALUES (28070, -1599052, 'Old Gods eh? So they zapped the Earthen with this Curse of Flesh. And then what?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14267, 1, 0, 0, 'brann SAY_EVENT_END_08');
INSERT INTO `script_texts` VALUES (28070, -1599051, 'Designation: Old Gods. Old Gods rendered all systems, including Earthen defenseless in order to facilitate assimilation. This matrix destabilization has been termed the Curse of Flesh. Effects of destabilization increased over time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13772, 1, 0, 0, 'brann SAY_EVENT_END_07_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599050, 'Necro-what? Speak bloody common will ya?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14266, 1, 0, 0, 'brann SAY_EVENT_END_06');
INSERT INTO `script_texts` VALUES (28070, -1599049, 'Accessing. In the early stages of its development cycle Azeroth suffered infection by parasitic, necrophotic symbiotes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13771, 1, 0, 0, 'brann SAY_EVENT_END_05_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599048, 'Right, right! I know that the Earthen were made of stone to shape the deep reaches of the world but what about the anomalies? Matrix non-stabilizing and whatnot.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14265, 1, 0, 0, 'brann SAY_EVENT_END_04');
INSERT INTO `script_texts` VALUES (28070, -1599047, 'Accessing prehistoric data. Retrieved. In the beginning Earthen were created to-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13770, 1, 0, 0, 'brann SAY_EVENT_END_03_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599046, 'Tell me how that dwarfs came to be! And start at the beginning!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14264, 1, 0, 0, 'brann SAY_EVENT_END_02');
INSERT INTO `script_texts` VALUES (28070, -1599045, 'Query? What do you think I\'m here for? Tea and biscuits? Spill the beans already!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14263, 1, 0, 0, 'brann SAY_EVENT_END_01');
INSERT INTO `script_texts` VALUES (28070, -1599044, 'System online. Life form pattern recognized. Welcome Branbronzan. Query?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13769, 1, 0, 0, 'brann SAY_EVENT_D_4_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599043, 'Purge? No no no no no! Where did I-- Aha, this should do the trick...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14256, 1, 0, 0, 'brann SAY_EVENT_D_3');
INSERT INTO `script_texts` VALUES (28070, -1599042, 'Alert! Security fail safes deactivated. Beginning memory purge...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13768, 1, 0, 0, 'brann SAY_EVENT_D_2_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599041, 'Ha! The old magic fingers finally won through! Now let\'s get down to-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14255, 1, 0, 0, 'brann SAY_EVENT_D_1');
INSERT INTO `script_texts` VALUES (28070, -1599040, 'Hang on! Nobody\'s gonna\' be sanitized as long as I have a say in it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14254, 1, 0, 0, 'brann SAY_EVENT_C_3');
INSERT INTO `script_texts` VALUES (28070, -1599039, 'Critical threat index. Void analysis diverted. Initiating sanitization protocol.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13767, 1, 0, 0, 'brann SAY_EVENT_C_2_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599038, 'So that was the problem? Now I\'m makin\' progress...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14253, 1, 0, 0, 'brann SAY_EVENT_C_1');
INSERT INTO `script_texts` VALUES (28070, -1599037, 'Heightened? What\'s the good news?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14252, 1, 0, 0, 'brann SAY_EVENT_B_3');
INSERT INTO `script_texts` VALUES (28070, -1599036, 'Threat index threshold exceeded. Celestial archive aborted. Security level heightened.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13761, 1, 0, 0, 'brann SAY_EVENT_B_2_MARN');
INSERT INTO `script_texts` VALUES (28070, -1599035, 'Couple more minutes and I\'ll--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14251, 1, 0, 0, 'brann SAY_EVENT_B_1');
INSERT INTO `script_texts` VALUES (28070, -1599034, 'Ah, you want to play hardball, eh? That\'s just my game!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14250, 1, 0, 0, 'brann SAY_EVENT_A_3');
INSERT INTO `script_texts` VALUES (28070, -1599033, 'Security breach in progress. Analysis of historical archives transferred to lower priority queue. Countermeasures engaged.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13756, 1, 0, 0, 'brann SAY_EVENT_A_2_KADD');
INSERT INTO `script_texts` VALUES (28070, -1599032, 'Oh, that doesn\'t sound good. We might have a complication or two...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14249, 1, 0, 0, 'brann SAY_EVENT_A_1');
INSERT INTO `script_texts` VALUES (28070, -1599031, 'Warning! Life form pattern not recognized. Archival processing terminated. Continued interference will result in targeted response.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13765, 1, 0, 0, 'brann SAY_EVENT_INTRO_3_ABED');
INSERT INTO `script_texts` VALUES (28070, -1599030, 'Now keep an eye out! I\'ll have this licked in two shakes of a--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14248, 1, 0, 0, 'brann SAY_EVENT_INTRO_2');
INSERT INTO `script_texts` VALUES (28070, -1599029, 'Take a moment and relish this with me! Soon all will be revealed! Okay then, let\'s do this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14247, 1, 0, 0, 'brann SAY_EVENT_INTRO_1');
INSERT INTO `script_texts` VALUES (28070, -1599028, 'Ha, that did it. Help\'s a-coming. Take this you glow-eying brute!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14277, 1, 0, 0, 'brann SAY_SPAWN_EARTHEN');
INSERT INTO `script_texts` VALUES (28070, -1599027, 'What in the name o\' Madoran did THAT do? Oh! Wait: I just about got it...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14276, 1, 0, 0, 'brann SAY_SPAWN_OOZE');
INSERT INTO `script_texts` VALUES (28070, -1599026, 'This is a wee bit trickier that before... Oh, bloody--incomin\'!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14275, 1, 0, 0, 'brann SAY_SPAWN_TROGG');
INSERT INTO `script_texts` VALUES (28070, -1599025, 'Don\'t worry. Old Brann has got your back. Keep that metal monstrosity busy and I\'ll see if I can sweet talk this machine into helping you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14274, 1, 0, 0, 'brann SAY_SPAWN_DWARF');
INSERT INTO `script_texts` VALUES (28070, -1599024, 'Time to get some answers! Let\'s get this show on the road!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14259, 1, 0, 0, 'brann SAY_ESCORT_START');
INSERT INTO `script_texts` VALUES (28070, -1599023, 'I hope this is all worth it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14262, 1, 0, 0, 'brann SAY_PLAYER_DEATH_3');
INSERT INTO `script_texts` VALUES (28070, -1599022, 'Light preserve you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14261, 1, 0, 0, 'brann SAY_PLAYER_DEATH_2');
INSERT INTO `script_texts` VALUES (28070, -1599021, 'I\'m doing everything I can!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14260, 1, 0, 0, 'brann SAY_PLAYER_DEATH_1');
INSERT INTO `script_texts` VALUES (28070, -1599020, 'Not yet, not... yet-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14258, 1, 0, 0, 'brann SAY_DEATH');
INSERT INTO `script_texts` VALUES (28070, -1599019, 'I\'m all kinds of busted up. Might not... make it...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14257, 1, 0, 0, 'brann SAY_LOW_HEALTH');
INSERT INTO `script_texts` VALUES (28070, -1599018, 'Keep it up now. Plenty of death-dealing for everyone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14246, 1, 0, 0, 'brann SAY_KILL_3');
INSERT INTO `script_texts` VALUES (28070, -1599017, 'Press on, that\'s the way!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14245, 1, 0, 0, 'brann SAY_KILL_2');
INSERT INTO `script_texts` VALUES (28070, -1599016, 'Now that\'s owning your supper!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14244, 1, 0, 0, 'brann SAY_KILL_1');
INSERT INTO `script_texts` VALUES (28090, -1571038, 'Your\'re right! What was I thinking? Bring on the Scourge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusade recruit RECRUIT_SAY3');
INSERT INTO `script_texts` VALUES (28090, -1571037, 'Your\'re right! We can do this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusade recruit RECRUIT_SAY2');
INSERT INTO `script_texts` VALUES (28090, -1571036, 'We\'ll cleanse this place! Arthas beware!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusade recruit RECRUIT_SAY1');
INSERT INTO `script_texts` VALUES (28315, -1000208, 'Frenzyheart kill you if you come back. You no welcome here no more!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'vekjik SAY_TEXTID_VEKJIK1');
