INSERT INTO `script_texts` VALUES (28546, -1602017, 'No one is safe!', NULL, 'Nul n\'est à  l\'abris !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14455, 1, 0, 0, 'ionar SAY_SPLIT_2');
