INSERT INTO `script_texts` VALUES (28546, -1602015, 'Master... you have guests.', NULL, 'Maître! Vous avez des invités.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14459, 1, 0, 0, 'ionar SAY_DEATH');
