INSERT INTO `script_texts` VALUES (28546, -1602013, 'You atempt the unpossible.', NULL, 'Vous tentez l\'impossible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14457, 1, 0, 0, 'ionar SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (28546, -1602012, 'Shocking ... I know!', NULL, 'Je sais... ça fait un choc !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14456, 1, 0, 0, 'ionar SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (28546, -1602011, 'You wish to confront the master? You must weather the storm!', NULL, 'Vous souhaitez affronter le maître, ? Vous devrez d\'abord supporter la tempête, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14453, 1, 0, 0, 'ionar SAY_AGGRO');
INSERT INTO `script_texts` VALUES (28586, -1602010, '%s switches to Defensive Stance!', NULL, '%s passe en posture défensive, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'bjarngrim EMOTE_DEFENSIVE_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602009, 'Give me your worst!', NULL, 'Allez-y, lâchez-vous, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14150, 1, 0, 0, 'bjarngrim SAY_DEFENSIVE_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602008, '%s switches to Berserker Stance!', NULL, '%s passe en posture berserker, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'bjarngrim EMOTE_BERSEKER_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602007, 'GRAAAAAH! Behold the fury of iron and steel!', NULL, 'GRAAAAAH, ! Tremblez devant la fureur du fer et de l\'acier, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14152, 1, 0, 0, 'bjarngrim SAY_BERSEKER_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602006, '%s switches to Battle Stance!', NULL, '%s passe en posture de combat, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'bjarngrim EMOTE_BATTLE_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602005, 'Defend yourself, for all the good it will do!', NULL, 'Défendez-vous, même si ça ne servira à  rien, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14151, 1, 0, 0, 'bjarngrim SAY_BATTLE_STANCE');
INSERT INTO `script_texts` VALUES (28586, -1602004, 'How can it be...? Flesh is not... stronger!', NULL, 'Comment est-ce possible!, ? La chair n\'est pas... plus forte, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14156, 1, 0, 0, 'bjarngrim SAY_DEATH');
INSERT INTO `script_texts` VALUES (28586, -1602003, '...', NULL, '...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14155, 1, 0, 0, 'bjarngrim SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (28586, -1602002, 'Flesh... is... weak!', NULL, 'La chair... est... faible, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14154, 1, 0, 0, 'bjarngrim SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (28586, -1602001, 'So ends your curse!', NULL, 'Voilà  comment votre malédiction prend fin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14153, 1, 0, 0, 'bjarngrim SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (28586, -1602000, 'I am the greatest of my father\'s sons! Your end has come!', NULL, 'Je suis le meilleur des fils de mon père, ! Vous êtes fichus, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14149, 1, 0, 0, 'bjarngrim SAY_AGGRO');
INSERT INTO `script_texts` VALUES (28587, -1602042, '%s prepares to shatter his Brittle Golems!', NULL, '%s se prépare à  fracasser ses golems vermoulus, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'volkhan EMOTE_SHATTER');
INSERT INTO `script_texts` VALUES (28587, -1602041, '%s runs to his anvil!', NULL, '%s court vers son enclume, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'volkhan EMOTE_TO_ANVIL');
INSERT INTO `script_texts` VALUES (28587, -1602040, 'Nothing is wasted in the process. You will see....', NULL, 'Rien n\'est gaspillé dans le processus. Vous verrez...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13962, 1, 0, 0, 'volkhan SAY_FORGE_2');
INSERT INTO `script_texts` VALUES (28587, -1602039, 'Life from the lifelessness... death for you.', NULL, 'La vie à  partie de l\'inerte... et la mort pour vous.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13961, 1, 0, 0, 'volkhan SAY_FORGE_1');
INSERT INTO `script_texts` VALUES (28587, -1602038, 'All my work... undone!', NULL, 'Tout mon travail... à  refaire, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13964, 1, 0, 0, 'volkhan SAY_STOMP_2');
INSERT INTO `script_texts` VALUES (28587, -1602037, 'I will crush you beneath my boots!', NULL, 'Je vais vous écraser sous mes bottes !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13963, 1, 0, 0, 'volkhan SAY_STOMP_1');
INSERT INTO `script_texts` VALUES (28587, -1602036, 'The master was right... to be concerned.', NULL, 'Le maître avait raison... de s\'inquiéter.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13968, 1, 0, 0, 'volkhan SAY_DEATH');
INSERT INTO `script_texts` VALUES (28587, -1602035, 'You have cost me too much work!', NULL, 'Vous m\'avez fait perdre bien trop de travail !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13967, 1, 0, 0, 'volkhan SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (28587, -1602034, 'Ha, pathetic!', NULL, 'Ha, pitoyable !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13966, 1, 0, 0, 'volkhan SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (28587, -1602033, 'The armies of iron will conquer all!', NULL, 'Les armées de fer vont tout conquérir !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13965, 1, 0, 0, 'volkhan SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (28587, -1602032, 'It is you who have destroyed my children? You... shall... pay!', NULL, 'C\'est vous qui avez détruit mes enfants, ? Vous... allez... payer, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13960, 1, 0, 0, 'volkhan SAY_AGGRO');
INSERT INTO `script_texts` VALUES (28604, -1571043, 'Glad I could help!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'adventurous dwarf SAY_DWARF_HELP');
INSERT INTO `script_texts` VALUES (28604, -1571042, 'Ouch! Watch where you\'re tugging!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'adventurous dwarf SAY_DWARF_OUCH');
INSERT INTO `script_texts` VALUES (28684, -1601022, 'The gate must be protected at all costs. Rip them to shreds!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14081, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601021, 'We must hold the gate. Attack! Tear them limb from limb!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14080, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601020, 'We are besieged. Strike out and bring back their corpses!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14079, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601019, 'I sense the living. Be ready.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14084, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601018, 'I hear footsteps. Be on your guard.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14083, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601017, 'Keep an eye on the tunnel. We must not let anyone through!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14082, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601016, 'Dinner time, my pets.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14086, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601015, 'They hunger.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14085, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601014, 'I should be grateful. But I long ago lost the capacity.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14087, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601013, 'As Anub\'Arak commands!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14078, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601012, 'You were foolish to come.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14077, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28684, -1601011, 'This kingdom belongs to the Scourge! Only the dead may enter.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14075, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (28787, -1800053, 'We made it! Thank you for getting me out of that hell hole. Tell Hemet to expect me! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800052, 'You really shouldn\'t play with this stuff. Someone could get hurt.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800051, 'Oh, look, it\'s another cartload of explosives! Let\'s help them dispose of it. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800050, 'It\'s getting a little hot over here. Shall we move on? ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800049, 'Or THIS is what you get. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800048, 'Listen up, Venture Company goons! Rule #1: Never keep the prisoner near the explosives.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28787, -1800047, 'Let\'s get the hell out of here', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, NULL);
INSERT INTO `script_texts` VALUES (28859, -1616036, 'Malygos fixes his eyes on you !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'Malygos WHISPER_LOOK_ME');
INSERT INTO `script_texts` VALUES (28859, -1616030, 'UNTHINKABLE! The mortals will destroy... e-everything... my sister... what have you-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14540, 1, 0, 0, 'Malygos DEATH');
INSERT INTO `script_texts` VALUES (28859, -1616029, 'Your fragile mind will be shattered!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14539, 1, 0, 0, 'Malygos SPELL 1');
INSERT INTO `script_texts` VALUES (28859, -1616028, 'Your cause is lost!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14538, 1, 0, 0, 'Malygos SPELL 1');
INSERT INTO `script_texts` VALUES (28859, -1616027, 'Still standing? Not for long...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14537, 1, 0, 0, 'Malygos SPELL 1');
INSERT INTO `script_texts` VALUES (28859, -1616026, 'The powers at work here exceed anything you could possibly imagine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14532, 1, 0, 0, 'Malygos STATIC FIELD');
INSERT INTO `script_texts` VALUES (28859, -1616025, 'Your red allies will share your fate...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14536, 1, 0, 0, 'Malygos SLAY 3-3');
INSERT INTO `script_texts` VALUES (28859, -1616024, 'Little more then gnats!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14535, 1, 0, 0, 'Malygos SLAY 3-2');
INSERT INTO `script_texts` VALUES (28859, -1616023, 'Alexstrasza! Another of your brood falls!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14534, 1, 0, 0, 'Malygos SLAY 3-1');
INSERT INTO `script_texts` VALUES (28859, -1616022, 'Your spirit will linger here forever!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14528, 1, 0, 0, 'Malygos SLAY 2-3');
INSERT INTO `script_texts` VALUES (28859, -1616021, 'I AM THE SPELL-WEAVER! My power is INFINITE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14527, 1, 0, 0, 'Malygos SLAY 2-2');
INSERT INTO `script_texts` VALUES (28859, -1616020, 'Your energy will be put to good use!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14526, 1, 0, 0, 'Malygos SLAY 2-1');
INSERT INTO `script_texts` VALUES (28859, -1616019, 'SUBMIT!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14531, 1, 0, 0, 'Malygos AGGRO 3');
INSERT INTO `script_texts` VALUES (28859, -1616018, 'Now your benefactors make their appearance...But they are too late. The powers contained here are sufficient to destroy the world ten times over! What do you think they will do to you?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14530, 1, 0, 0, 'Malygos PHASE 3 INTRO');
INSERT INTO `script_texts` VALUES (28859, -1616017, 'ENOUGH! If you intend to reclaim Azeroth\'s magic, then you shall have it...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14529, 1, 0, 0, 'Malygos PHASEEND 2');
INSERT INTO `script_texts` VALUES (28859, -1616016, 'I will teach you IGNORANT children just how little you know of magic...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14524, 1, 0, 0, 'Malygos ARCANE OVERLOAD');
INSERT INTO `script_texts` VALUES (28859, -1616014, 'YOU WILL NOT SUCCEED WHILE I DRAW BREATH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14518, 1, 0, 0, 'Malygos DEEP BREATH');
INSERT INTO `script_texts` VALUES (28859, -1616013, 'Few have experienced the pain I will now inflict upon you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14523, 1, 0, 0, 'Malygos AGGRO 2');
INSERT INTO `script_texts` VALUES (28859, -1616012, 'I had hoped to end your lives quickly, but you have proven more...resilient then I had anticipated. Nonetheless, your efforts are in vain, it is you reckless, careless mortals who are to blame for this war! I do what I must...And if it means your...extinction...THEN SO BE IT!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14522, 1, 0, 0, 'Malygos PHASEEND 1');
INSERT INTO `script_texts` VALUES (28859, -1616010, 'How very... naive...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14521, 1, 0, 0, 'Malygos SLAY 1-3');
INSERT INTO `script_texts` VALUES (28859, -1616009, 'More artifacts to confiscate...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14520, 1, 0, 0, 'Malygos SLAY 1-2');
INSERT INTO `script_texts` VALUES (28859, -1616008, 'Your stupidity has finally caught up to you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14519, 1, 0, 0, 'Malygos SLAY 1-1');
INSERT INTO `script_texts` VALUES (28859, -1616007, 'I AM UNSTOPPABLE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14533, 1, 0, 0, 'Malygos SPARK BUFF');
INSERT INTO `script_texts` VALUES (28859, -1616006, 'Watch helplessly as your hopes are swept away...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14525, 1, 0, 0, 'Malygos VORTEX');
INSERT INTO `script_texts` VALUES (28859, -1616005, 'My patience has reached its limit, I WILL BE RID OF YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14517, 1, 0, 0, 'Malygos AGGRO 1');
INSERT INTO `script_texts` VALUES (28859, -1616004, 'I give you one chance. Pledge fealty to me, and perhaps I won\'t slaughter you for your insolence!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14516, 1, 0, 0, 'Malygos INTRO 5');
INSERT INTO `script_texts` VALUES (28859, -1616003, 'I am without limits here... the rules of your cherished reality do not apply... In this realm, I am in control...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14515, 1, 0, 0, 'Malygos INTRO 4');
INSERT INTO `script_texts` VALUES (28859, -1616002, 'What could you hope to accomplish, to storm brazenly into my domain? To employ MAGIC? Against ME?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14514, 1, 0, 0, 'Malygos INTRO 3');
INSERT INTO `script_texts` VALUES (28859, -1616001, 'None but the blue dragonflight are welcome here! Perhaps this is the work of Alexstrasza? Well then, she has sent you to your deaths.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14513, 1, 0, 0, 'Malygos INTRO 2');
INSERT INTO `script_texts` VALUES (28859, -1616000, 'Lesser beings, intruding here! A shame that your excess courage does not compensate for your stupidity!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14512, 1, 0, 0, 'Malygos INTRO 1');
INSERT INTO `script_texts` VALUES (28860, -1615042, '%s begins to open a Twilight Portal!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'sartharion drake WHISPER_OPEN_PORTAL');
INSERT INTO `script_texts` VALUES (28860, -1615041, 'A Vesperon Disciple appears in the Twilight!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'shadron WHISPER_VESPERON_DICIPLE');
INSERT INTO `script_texts` VALUES (28860, -1615032, 'The lava surrounding %s churns!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'sartharion WHISPER_LAVA_CHURN');
INSERT INTO `script_texts` VALUES (28860, -1615031, 'This is why we call you lesser beeings.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14097, 1, 0, 0, 'sartharion SAY_SARTHARION_SLAY_3');
INSERT INTO `script_texts` VALUES (28860, -1615030, 'You are the grave disadvantage.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14096, 1, 0, 0, 'sartharion SAY_SARTHARION_SLAY_2');
INSERT INTO `script_texts` VALUES (28860, -1615029, 'You will make a fine meal for the hatchlings.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14094, 1, 0, 0, 'sartharion SAY_SARTHARION_SLAY_1');
INSERT INTO `script_texts` VALUES (28860, -1615028, 'All will be reduced to ash!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14102, 1, 0, 0, 'sartharion SAY_SARTHARION_SPECIAL_4');
INSERT INTO `script_texts` VALUES (28860, -1615027, 'How much heat can you take?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14101, 1, 0, 0, 'sartharion SAY_SARTHARION_SPECIAL_3');
INSERT INTO `script_texts` VALUES (28860, -1615026, 'Your charred bones will litter the floor!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14100, 1, 0, 0, 'sartharion SAY_SARTHARION_SPECIAL_2');
INSERT INTO `script_texts` VALUES (28860, -1615025, 'Such flammable little insects....', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14099, 1, 0, 0, 'sartharion SAY_SARTHARION_SPECIAL_1');
INSERT INTO `script_texts` VALUES (28860, -1615024, 'Such is the price... of failure...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14107, 1, 0, 0, 'sartharion SAY_SARTHARION_DEATH');
INSERT INTO `script_texts` VALUES (28860, -1615023, 'Vesperon! The clutch is in danger! Assist me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14104, 1, 0, 0, 'sartharion SAY_SARTHARION_CALL_VESPERON');
INSERT INTO `script_texts` VALUES (28860, -1615022, 'Tenebron! The eggs are yours to protect as well!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14106, 1, 0, 0, 'sartharion SAY_SARTHARION_CALL_TENEBRON');
INSERT INTO `script_texts` VALUES (28860, -1615021, 'Shadron! Come to me, all is at risk!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14105, 1, 0, 0, 'sartharion SARTHARION_CALL_SHADRON');
INSERT INTO `script_texts` VALUES (28860, -1615020, 'Burn, you miserable wretches!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14098, 1, 0, 0, 'sartharion SAY_SARTHARION_BREATH');
INSERT INTO `script_texts` VALUES (28860, -1615019, 'This pathetic siege ends NOW!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14103, 1, 0, 0, 'sartharion SAY_SARTHARION_BERSERK');
INSERT INTO `script_texts` VALUES (28860, -1615018, 'It is my charge to watch over these eggs. I will see you burn before any harm comes to them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14093, 1, 0, 0, 'sartharion SAY_SARTHARION_AGGRO');
INSERT INTO `script_texts` VALUES (28860, -1615017, '%s begins to hatch eggs in the twilight!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'tenebron WHISPER_HATCH_EGGS');
INSERT INTO `script_texts` VALUES (28860, -1615008, 'A Shadron Disciple appears in the Twilight!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'shadron WHISPER_SHADRON_DICIPLE');
INSERT INTO `script_texts` VALUES (28912, -1609570, 'Your High Inquisitor is nothing more than a pile of meat, Crusaders! There are none beyond the grasp of the Scourge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT10');
INSERT INTO `script_texts` VALUES (28912, -1609569, 'I\'ll draw their fire, you make your escape behind me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT9');
INSERT INTO `script_texts` VALUES (28912, -1609568, 'The death of the High Inquisitor of New Avalon will not go unnoticed. You need to get out of here at once! Go, before more of them show up. I\'ll be fine on my own.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT8');
INSERT INTO `script_texts` VALUES (28912, -1609567, 'Stay in the anti-magic field! Make them come to you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT7');
INSERT INTO `script_texts` VALUES (28912, -1609566, 'The High Inquisitor comes! Be ready, death knight! Do not let him draw you out of the protective bounds of my anti-magic field! Kill him and take his head!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT6');
INSERT INTO `script_texts` VALUES (28912, -1609565, 'I can\'t keep barrier up much longer... Where is that coward?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT5');
INSERT INTO `script_texts` VALUES (28912, -1609564, 'There are more coming. Defend yourself! Don\'t fall out of the anti-magic field! They\'ll tear you apart without its protection!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT4');
INSERT INTO `script_texts` VALUES (28912, -1609563, 'Maintaining this barrier will require all of my concentration. Kill them all!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 16, 'Koltira Deathweaver SAY_BREAKOUT3');
INSERT INTO `script_texts` VALUES (28912, -1609562, 'I\'m still weak, but I think I can get an anti-magic barrier up. Stay inside it or you\'ll be destroyed by their spells.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Koltira Deathweaver SAY_BREAKOUT2');
INSERT INTO `script_texts` VALUES (28912, -1609561, 'I\'ll need to get my runeblade and armor... Just need a little more time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 399, 'Koltira Deathweaver SAY_BREAKOUT1');
INSERT INTO `script_texts` VALUES (28923, -1602031, '%s begins to cast Lightning Nova!', NULL, '%s incante une nova de foudre, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'loken EMOTE_NOVA');
INSERT INTO `script_texts` VALUES (28923, -1602030, 'You cross the precipice of oblivion!', NULL, 'Vous traversez le précipice de l\'oubli, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14171, 1, 0, 0, 'loken SAY_25HEALTH');
INSERT INTO `script_texts` VALUES (28923, -1602029, 'Your ignorance is profound. Can you not see where this path leads?', NULL, 'Votre ignorance est insondable. Ne voyez-vous pas où vous mènera cette voie, ?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14170, 1, 0, 0, 'loken SAY_50HEALTH');
INSERT INTO `script_texts` VALUES (28923, -1602028, 'You stare blindly into the abyss!', NULL, 'Vous plongez vos regards aveugles dans l\'abîme, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14169, 1, 0, 0, 'loken SAY_75HEALTH');
INSERT INTO `script_texts` VALUES (28923, -1602027, 'Your flesh cannot hold out for long.', NULL, 'Votre chair ne tiendra pas longtemps.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14165, 1, 0, 0, 'loken SAY_NOVA_3');
INSERT INTO `script_texts` VALUES (28923, -1602026, 'Come closer. I will make it quick.', NULL, 'Approchez-vous. Je ferai vite.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14164, 1, 0, 0, 'loken SAY_NOVA_2');
INSERT INTO `script_texts` VALUES (28923, -1602025, 'You cannot hide from fate!', NULL, 'Vous ne pouvez pas fuir le destin, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14163, 1, 0, 0, 'loken SAY_NOVA_1');
INSERT INTO `script_texts` VALUES (28923, -1602024, 'My death... heralds the end of this world.', NULL, 'Ma mort! annonce la fin de ce monde.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14172, 1, 0, 0, 'loken SAY_DEATH');
INSERT INTO `script_texts` VALUES (28923, -1602023, 'What little time you had, you wasted!', NULL, 'Le peu de temps dont vous disposiez, gaspillé !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14168, 1, 0, 0, 'loken SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (28923, -1602022, 'I... am... FOREVER!', NULL, 'Je! suis! à‰TERNEL, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14167, 1, 0, 0, 'loken SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (28923, -1602021, 'Only mortal...', NULL, 'Simple mortel...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14166, 1, 0, 0, 'loken SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (28923, -1602020, 'My master has shown me the future, and you have no place in it. Azeroth will be reborn in darkness. Yogg-Saron shall be released! The Pantheon shall fall!', NULL, 'Mon maître m\'a montré l\'avenir, et vous n\'y avez pas votre place. Azeroth va renaître des ténèbres. Yogg-Saron sera libéré ! Le Panthéon va tombé !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14162, 1, 0, 0, 'loken SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (28923, -1602019, 'I have witnessed the rise and fall of empires. The birth and extinction of entire species. Over countless millennia the foolishness of mortals has remained beyond a constant. Your presence here confirms this.', NULL, 'J\'ai vu la grandeur et la décadence des empires... La naissance et l\'extinction d\'espèces entières... Pendant d\'innombrables millénaires, la seule constante a été la stupidité des mortels. Votre présence ici ne fait que le confirmer.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14160, 1, 0, 0, 'loken SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (28923, -1602018, 'What hope is there for you? None!', NULL, 'Quel espoir vous reste-t-il, ? Aucun, !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14162, 1, 0, 0, 'loken SAY_AGGRO0');
INSERT INTO `script_texts` VALUES (28939, -1609519, 'NO! PLEASE! There is one more thing that I forgot to mention... A courier comes soon... From Hearthglen. It...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 20, 'break crusader SAY_PERSUADED6');
INSERT INTO `script_texts` VALUES (28939, -1609518, 'LIES! The pain you are about to endure will be talked about for years to come!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'break crusader SAY_PERSUADED5');
INSERT INTO `script_texts` VALUES (28939, -1609517, 'I know very little else... The High General chooses who may go and who must stay behind. There\'s nothing else... You must believe me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 20, 'break crusader SAY_PERSUADED4');
INSERT INTO `script_texts` VALUES (28939, -1609516, 'The Light that guides us. The movement was set in motion before you came... We... We do as we are told. It is what must be done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 20, 'break crusader SAY_PERSUADED3');
INSERT INTO `script_texts` VALUES (28939, -1609515, 'We... We have only been told that the \"Crimson Dawn\" is an awakening. You see, the Light speaks to the High General. It is the Light...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 20, 'break crusader SAY_PERSUADED2');
INSERT INTO `script_texts` VALUES (28939, -1609514, 'I\'ll tell you everything! STOP! PLEASE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 20, 'break crusader SAY_PERSUADED1');
INSERT INTO `script_texts` VALUES (28939, -1609513, 'I used to work for Grand Inquisitor Isillien! Your idea of pain is a normal mid-afternoon for me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER6');
INSERT INTO `script_texts` VALUES (28939, -1609512, 'Argh... The pain... The pain is almost as unbearable as the lashings I received in grammar school when I was but a child.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER5');
INSERT INTO `script_texts` VALUES (28939, -1609511, 'ARGH! You burned my last good tabard!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER4');
INSERT INTO `script_texts` VALUES (28939, -1609510, 'You hit like a girl. Honestly. Is that the best you can do?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER3');
INSERT INTO `script_texts` VALUES (28939, -1609509, 'You\'ll have to kill me, monster! I will tell you NOTHING!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER2');
INSERT INTO `script_texts` VALUES (28939, -1609508, 'You\'ll be hanging in the gallows shortly, Scourge fiend!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'crusader SAY_CRUSADER1');
INSERT INTO `script_texts` VALUES (28939, -1609507, '\"Crimson Dawn!\" What is it! Speak!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE7');
INSERT INTO `script_texts` VALUES (28939, -1609506, 'What is the \"Crimson Dawn?\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE6');
INSERT INTO `script_texts` VALUES (28939, -1609505, 'I can keep this up for a very long time, Scarlet dog! Tell me about the \"Crimson Dawn!\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE5');
INSERT INTO `script_texts` VALUES (28939, -1609504, 'Is your life worth so little? Just tell me what I need to know about \"Crimson Dawn\" and I\'ll end your suffering quickly.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE4');
INSERT INTO `script_texts` VALUES (28939, -1609503, 'I\'m through being courteous with your kind, human! What is the \"Crimson Dawn?\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE3');
INSERT INTO `script_texts` VALUES (28939, -1609502, 'Tell me what you know about \"Crimson Dawn\" or the beatings will continue!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE2');
INSERT INTO `script_texts` VALUES (28939, -1609501, 'I\'ll tear the secrets from your soul! Tell me about the \"Crimson Dawn\" and your life may be spared!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'player SAY_PERSUADE1');
INSERT INTO `script_texts` VALUES (29001, -1609586, 'High Inquisitor Valroth\'s remains fall to the ground.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'High Inquisitor Valroth death');
INSERT INTO `script_texts` VALUES (29001, -1609585, 'Coward!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'High Inquisitor Valroth yell');
INSERT INTO `script_texts` VALUES (29001, -1609584, 'LIGHT PURGE YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'High Inquisitor Valroth yell');
INSERT INTO `script_texts` VALUES (29001, -1609583, 'You have come seeking deliverance? I have come to deliver!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'High Inquisitor Valroth yell');
INSERT INTO `script_texts` VALUES (29001, -1609582, 'It seems that I\'ll need to deal with you myself. The High Inquisitor comes for you, Scourge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'High Inquisitor Valroth aggro');
INSERT INTO `script_texts` VALUES (29001, -1609581, 'The Crusade will purge your kind from this world!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'High Inquisitor Valroth start');
INSERT INTO `script_texts` VALUES (29032, -1609087, 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Gilneas, our beloved home. This world is worth saving.', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 18, 'special_surprise SAY_EXEC_TIME_12');
INSERT INTO `script_texts` VALUES (29032, -1609086, 'Without you I would have died. YOU! The most noble worgen I ever knew. What have they done to you, $N? How could this have happened? Remember the worgen you once were, $Gbrother:sister;! You were our savior! Fight this! ', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_THINK_12');
INSERT INTO `script_texts` VALUES (29032, -1609085, 'You don\'t remember me? We were both servants of Arugal back in Silverpine Forest. We put up with his merciless torture for ages. It was you who saved me on that fateful night when we escaped Shadowfang Keep. ', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_NOREM_11');
INSERT INTO `script_texts` VALUES (29032, -1609084, 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Kezan, our beloved home. This world is worth saving!', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 18, 'special_surprise SAY_EXEC_TIME_11');
INSERT INTO `script_texts` VALUES (29032, -1609083, 'Listen to me, $N. You must fight against the Lich King\'s control. He is a monster that wants to see this world - our world - in ruin. Don\'t let him use you to accomplish his goals. You were once a hero and can be again. Fight, damn you! Fight his control!', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 5, 'special_surprise SAY_EXEC_LISTEN_5');
INSERT INTO `script_texts` VALUES (29032, -1609082, 'That\'s how I ended up in the Argent Dawn, because I knew it\'s what you woulda done. How could this have happened to you? \r\nRemember the goblin you once were, $Gbrother:sister;! You were my best friend! Fight this!', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_THINK_11');
INSERT INTO `script_texts` VALUES (29032, -1609081, 'You don\'t remember me, $N? I lost count of the number of jobs you and I ran back in the day on Kezan. Then I picked up a real bad Kaja\'Cola habit and you saved me! It was you who took me to Kalimdor to join the Steamwheedle Cartel. You were the only good goblin I knew.', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_NOREM_10');
INSERT INTO `script_texts` VALUES (29032, -1609080, 'Alright, j... just let me... let me st... stand up.', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 25, 'special_surprise SAY_EXEC_PROG_8');
INSERT INTO `script_texts` VALUES (29032, -1609079, 'C... cant we work this out somehow? ', '0', '0', '0', '0', '0', '0', '0', '0', NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_START_4');
INSERT INTO `script_texts` VALUES (29032, -1609078, '%s dies from his wounds.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'special_surprise EMOTE_DIES');
INSERT INTO `script_texts` VALUES (29032, -1609077, 'Do it, $N! Put me out of my misery!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 1, 'special_surprise SAY_EXEC_WAITING');
INSERT INTO `script_texts` VALUES (29032, -1609076, 'Der... Der\'s no more time for me. I be done for. Finish me off $N. Do it or they\'ll kill us both. $N... Remember Sen\'jin Village, mon! Dis world be worth saving!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 18, 'special_surprise SAY_EXEC_TIME_10');
INSERT INTO `script_texts` VALUES (29032, -1609075, 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... Remember Mulgore. This world is worth saving.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 18, 'special_surprise SAY_EXEC_TIME_9');
INSERT INTO `script_texts` VALUES (29032, -1609074, 'There... There\'s no more time for me. I\'m done for. Finish me off, $N. Do it or they\'ll kill us both. $N... For the Horde! This world is worth saving.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 18, 'special_surprise SAY_EXEC_TIME_8');
