INSERT INTO `script_texts` VALUES (29173, -1609259, 'When next we meet it won\'t be on holy ground, paladin.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14812, 1, 0, 1, 'The Lich King');
