INSERT INTO `script_texts` VALUES (29173, -1609257, 'Impossible...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14810, 1, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609256, 'Your end.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14592, 1, 0, 0, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609255, 'What is this?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14809, 1, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609254, 'ARTHAS!!!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14591, 1, 0, 0, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609253, 'Tirion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14709, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609252, 'That day is not today...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14708, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609251, 'APOCALYPSE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14808, 1, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609250, 'ATTACK!!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14488, 1, 0, 0, 'Lord Maxwell Tyrosus');
INSERT INTO `script_texts` VALUES (29173, -1609249, 'How simple it was to draw the great Tirion Fordring out of hiding. You\'ve left yourself exposed, paladin. Nothing will save you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14807, 0, 0, 1, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609248, 'You were right, Fordring. I did send them in to die. Their lives are meaningless, but yours...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14806, 0, 0, 1, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609247, 'You\'re a damned monster, Arthas!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14589, 0, 0, 25, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609246, 'Pathetic...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14804, 0, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609245, 'He\'s mine now...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14805, 0, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609244, 'You have\'ve betrayed me! You betrayed us all you monster! Face the might of Mograine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14707, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609243, 'Touching...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14803, 1, 0, 0, 'The Lich King');
INSERT INTO `script_texts` VALUES (29173, -1609242, 'Do not forget...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14497, 0, 0, 6, 'Highlord Alexandros Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609241, 'My son, there will come a day when you will command the Ashbringer and, with it, mete justice across this land. I have no doubt that when that day finally comes, you will bring pride to our people and that Lordaeron will be a better place because of you. But, my son, that day is not today.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14496, 0, 0, 1, 'Highlord Alexandros Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609240, 'If I die, father, I would rather it be on my feet, standing in defiance against the undead legions! If I die, father, I die with you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14706, 0, 0, 6, 'Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609239, 'Darion Mograine, you are barely of age to hold a sword, let alone battle the undead hordes of Lordaeron! I couldn\'t bear losing you. Even the thought...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14495, 0, 0, 1, 'Highlord Alexandros Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609238, 'Father, I wish to join you in the war against the undead. I want to fight! I can sit idle no longer!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14705, 0, 0, 6, 'Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609237, 'Nothing could have kept me away from here, Darion. Not from my home and family.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14494, 0, 0, 1, 'Highlord Alexandros Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609236, 'You have been gone a long time, father. I thought...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14704, 0, 0, 0, 'Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609235, 'Father, you have returned!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14703, 0, 0, 0, 'Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609234, 'Argh...what...is...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14702, 0, 0, 68, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609233, 'Father!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14701, 0, 0, 5, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609232, 'My son! My dear, beautiful boy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14493, 0, 0, 0, 'Highlord Alexandros Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609231, 'Save your breath, old man. It might be the last you ever draw.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14700, 0, 0, 25, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609230, 'What you are feeling right now is the anguish of a thousand lost souls! Souls that you and your master brought here! The Light will tear you apart, Darion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14588, 0, 0, 1, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609229, 'Your master knows what lies beneath the chapel. It is why he dares not show his face! He\'s sent you and your death knights to meet their doom, Darion.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14587, 0, 0, 25, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609228, 'Have you learned nothing, boy? You have become all that your father fought against! Like that coward, Arthas, you allowed yourself to be consumed by the darkness...the hate... Feeding upon the misery of those you tortured and killed!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14586, 0, 0, 378, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609227, 'Stand down, death knights. We have lost... The Light... This place... No hope...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14699, 0, 0, 68, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609226, 'Bring them before the chapel!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14585, 1, 0, 0, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609225, 'You cannot win, Darion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14584, 1, 0, 0, 'Highlord Tirion Fordring');
INSERT INTO `script_texts` VALUES (29173, -1609224, 'Minions, come to my aid!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14698, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609223, 'Ashbringer defies me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14697, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609222, 'Power...wanes...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14696, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609221, 'What is happening to me?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14695, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609220, 'I can not... the blade fights me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14694, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609219, 'You will do as I command! I am in control here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14693, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609218, 'Obey me, blade!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14692, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609217, 'What is this?! My... I cannot strike...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14691, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609216, 'Spare no one!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14690, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609215, 'The Argent Dawn is finished!\"', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14689, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609214, 'How much longer will your forces hold out?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14688, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609213, 'Life is meaningless without suffering.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14687, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609212, 'Your life is forfeit.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14686, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609211, 'The Scourge will destroy this place!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14685, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609210, 'You stand no chance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14684, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609209, 'Kneel before the Highlord!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14683, 0, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609208, 'Stand fast, brothers and sisters! The Light will prevail!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14487, 1, 0, 0, 'Lord Maxwell Tyrosus');
INSERT INTO `script_texts` VALUES (29173, -1609207, 'Scourge armies approach!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Korfax, Champion of the Light');
INSERT INTO `script_texts` VALUES (29173, -1609206, 'The skies turn red with the blood of the fallen! The Lich King watches over us, minions! Onward! Leave only ashes and misery in your destructive wake!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14682, 1, 0, 25, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609205, 'RISE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14680, 1, 0, 15, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609204, 'Soldiers of the Scourge, death knights of Acherus, minions of the darkness: hear the call of the Highlord!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14679, 1, 0, 22, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609203, 'Death knights of Acherus, the death march begins!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14681, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609202, 'The sky weeps at the devastation of sister earth! Soon, tears of blood will rain down upon us!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14678, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29173, -1609201, 'Soldiers of the Scourge, stand ready! You will soon be able to unleash your fury upon the Argent Dawn!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14677, 1, 0, 0, 'Highlord Darion Mograine');
INSERT INTO `script_texts` VALUES (29281, -1575017, 'I will be happy to slaughter them in your name! Come, enemies of the Scourge! I will show you the might of the Lich King!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Svala Sorrowgrave SAY_DIALOG_WITH_ARTHAS_3');
INSERT INTO `script_texts` VALUES (29281, -1575016, 'The sensation is... beyond my imagining. I am yours to command, my king.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Svala Sorrowgrave SAY_DIALOG_WITH_ARTHAS_2');
INSERT INTO `script_texts` VALUES (29281, -1575015, 'My liege! I have done as you asked, and now beseech you for your blessing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Svala Sorrowgrave SAY_DIALOG_WITH_ARTHAS_1');
INSERT INTO `script_texts` VALUES (29304, -1604023, 'A thousssand fangs gonna rend your flesh!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Slad\'ran SAY_SUMMON_CONSTRICTORS');
