INSERT INTO `script_texts` VALUES (29305, -1604015, 'Get ready for somethin\'... much... BIGGAH! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'SAY_TRANSFORM boss_moorabi');
