INSERT INTO `script_texts` VALUES (29305, -1604010, 'We fought back da Scourge. What chance joo be thinkin\' JOO got?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'SAY_AGGRO boss_moorabi');
INSERT INTO `script_texts` VALUES (29306, -1604009, 'You wanna see power? I\'m gonna show you power!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_TRANSFORM_2');
INSERT INTO `script_texts` VALUES (29306, -1604008, 'Ain\'t gonna be nottin\' left after this!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_TRANSFORM_1');
INSERT INTO `script_texts` VALUES (29306, -1604007, 'Say hello to my BIG friend!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_SUMMON_RHINO_3');
INSERT INTO `script_texts` VALUES (29306, -1604006, 'KILL THEM ALL!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_SUMMON_RHINO_2');
INSERT INTO `script_texts` VALUES (29306, -1604005, 'Gut them! Impale them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_SUMMON_RHINO_1');
INSERT INTO `script_texts` VALUES (29306, -1604004, 'Even the mighty... can fall.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_DEATH');
