INSERT INTO `script_texts` VALUES (29306, -1604000, 'I\'m gonna spill your guts, mon!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Gal\'darah SAY_AGGRO');
INSERT INTO `script_texts` VALUES (29308, -1619028, 'I am nowhere. I am everywhere. I am the watcher, unseen.', NULL, 'Ici-même, aux abords de son domaine, vous sentirez des pouvoirs dépassant vos imaginations !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_VANISH2');
INSERT INTO `script_texts` VALUES (29308, -1619027, 'Your heartbeat is music to my ears.', NULL, 'Vous pouvez obtenir l\'immortalité, mais seulement en vous dévouant corps et âme à  Yogg-Saron', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_VANISH1');
INSERT INTO `script_texts` VALUES (29308, -1619026, 'Fresh, warm blood. It has been too long.', NULL, 'Les éléments eux-mêmes se soulèveront contre le monde civilisé ! Seuls les fidèles seront épargnés !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_FEED2');
INSERT INTO `script_texts` VALUES (29308, -1619025, 'So appetizing.', NULL, 'Ne croyez pas que votre sacrilège... restera... impuni.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_FEED1');
INSERT INTO `script_texts` VALUES (29308, -1619024, 'Still I hunger, still I thirst.', NULL, 'Debout ! Vous n\'avez pas assez souffert.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_DEATH');
INSERT INTO `script_texts` VALUES (29308, -1619023, 'One final embrace.', NULL, 'Vous n\'êtes pas digne.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (29308, -1619022, 'I will drink no blood before it\'s time.', NULL, 'Gloire à  Yogg-Saron !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (29308, -1619021, 'I will feast on your remains.', NULL, 'Maître, un présent pour vous !', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'prince taldaram SAY_AGGRO');
INSERT INTO `script_texts` VALUES (29309, -1619020, 'Shhhad ak kereeesshh chak-k-k!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14035, 0, 0, 0, 'Elder Nadox SAY_EGG_SAC_2');
INSERT INTO `script_texts` VALUES (29309, -1619019, 'The young must not grow hungry...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14034, 0, 0, 0, 'Elder Nadox SAY_EGG_SAC_1');
INSERT INTO `script_texts` VALUES (29309, -1619018, 'Master, is my service complete?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14039, 0, 0, 0, 'Elder Nadox SAY_DEATH');
INSERT INTO `script_texts` VALUES (29309, -1619017, 'Perhaps we will be allies soon.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14038, 0, 0, 0, 'Elder Nadox SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (29309, -1619016, 'For the Lich King!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14037, 0, 0, 0, 'Elder Nadox SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (29309, -1619015, 'Sleep now, in the cold dark.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14036, 0, 0, 0, 'Elder Nadox SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (29310, -1619013, 'The faithful shall be exalted! But there is more work to be done. We will press on until all of Azeroth lies beneath his shadow!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_PREACHING_5');
INSERT INTO `script_texts` VALUES (29310, -1619012, 'You have traveled long and risked much to be here. Your devotion shall be rewarded.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_PREACHING_4');
INSERT INTO `script_texts` VALUES (29310, -1619011, 'Here on the very borders of his domain. You will experience powers you would never have imagined!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_PREACHING_3');
INSERT INTO `script_texts` VALUES (29310, -1619010, 'Immortality can be yours. But only if you pledge yourself fully to Yogg-Saron!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_PREACHING_2');
INSERT INTO `script_texts` VALUES (29310, -1619009, 'The elements themselves will rise up against the civilized world! Only the faithful will be spared!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_PREACHING_1');
INSERT INTO `script_texts` VALUES (29310, -1619008, 'Do not expect your sacrilege... to go unpunished.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_DEATH');
INSERT INTO `script_texts` VALUES (29310, -1619007, 'Get up! You haven\'t suffered enough.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_SLAY_3');
INSERT INTO `script_texts` VALUES (29310, -1619006, 'You are unworthy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (29310, -1619005, 'Glory to Yogg-Saron!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'Jedoga Shadowseeker SAY_SLAY_1');
