INSERT INTO `script_texts` VALUES (29434, -1800043, 'I\'m going to bring the venom sack to Ricket... and then... you know... collapse. Thank you for helping me! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'injured goblin SAY_END_WP_REACHED');
