INSERT INTO `script_texts` VALUES (29519, -1609014, 'Sate your hunger on cold steel, $R', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_7');
INSERT INTO `script_texts` VALUES (29519, -1609013, 'There is no hope for our future...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_6');
INSERT INTO `script_texts` VALUES (29519, -1609012, 'To battle!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_5');
INSERT INTO `script_texts` VALUES (29519, -1609011, 'And now you die', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_4');
INSERT INTO `script_texts` VALUES (29519, -1609010, 'HAH! You can barely hold a blade! Yours will be a quick death.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_3');
INSERT INTO `script_texts` VALUES (29519, -1609009, 'Let your fears consume you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_2');
INSERT INTO `script_texts` VALUES (29519, -1609008, 'To battle!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_ATTACK_1');
INSERT INTO `script_texts` VALUES (29519, -1609007, 'There can be only one survivor!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_8');
INSERT INTO `script_texts` VALUES (29519, -1609006, 'I will dismantle this festering hellhole!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_7');
INSERT INTO `script_texts` VALUES (29519, -1609005, 'I will win my freedom and leave this cursed place!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_6');
INSERT INTO `script_texts` VALUES (29519, -1609004, 'You will allow me a weapon and armor, yes?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_5');
INSERT INTO `script_texts` VALUES (29519, -1609003, 'They brand me unworthy? I will show them unmorthy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_4');
INSERT INTO `script_texts` VALUES (29519, -1609002, 'You are hopelessly outmatched, $R.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_3');
INSERT INTO `script_texts` VALUES (29519, -1609001, 'I was a soldier of the Light once... Look at what I have become... ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_2');
INSERT INTO `script_texts` VALUES (29519, -1609000, 'You have made a grave error, fiend!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'unworthy_initiate SAY_EVENT_START_1');
INSERT INTO `script_texts` VALUES (30007, -1571041, 'Do you fell that folks? The air is cracking with energy! Than can only mean one thing...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30007, -1571035, 'The battle is about to begin! Am I reading this card right It... It\'s the nefarious magnataur lord, STINKBEARD! Yes, folks, STINKBEARD! Chitchat dosen\'t stand a chance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13363, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30007, -1571034, 'Hailling from the distant mountains of Alterac, one of the fiercest competitors this arena has ever seen: KORRAK THE BLOODRAGER!!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13363, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30007, -1571033, 'The champion of the Winterax trolls has challenged you, Treeofdoom! I hope you\'re ready!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, '');
INSERT INTO `script_texts` VALUES (30007, -1571031, 'This battle must be seen to be believed! Once a mild-mannered tuskarr fisherman, our next fighter turned to the life of a soulless mercenary when his entire family was wiped out by a vicious pack of lion seals and III-tempered penguins! Now he\'s just In It for the gold! Ladies and gentlemen, ORINOKO TUSKBREAKER!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 13363, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30014, -1571039, 'Yggdras emerges!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, '');
INSERT INTO `script_texts` VALUES (30017, -1571040, 'Stinkbeard comin\' for you, little ones!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30020, -1571032, 'Whisker! Where are you? Assist me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (30154, -1571003, 'I\'m not afraid of anything -- bring it on!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 'aggro_Agnetta');
INSERT INTO `script_texts` VALUES (30449, -1615040, 'Unlike, I have many talents.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14138, 1, 0, 0, 'vesperon SAY_VESPERON_SPECIAL_2');
INSERT INTO `script_texts` VALUES (30449, -1615039, 'Aren\'t you tricky...I have a few tricks of my own...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14137, 1, 0, 0, 'vesperon SAY_VESPERON_SPECIAL_1');
INSERT INTO `script_texts` VALUES (30449, -1615038, 'Father was right about you, Sartharion...You are a weakling!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14139, 1, 0, 0, 'vesperon SAY_VESPERON_RESPOND');
INSERT INTO `script_texts` VALUES (30449, -1615037, 'I will pick my teeth with your bones!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14136, 1, 0, 0, 'vesperon SAY_VESPERON_BREATH');
INSERT INTO `script_texts` VALUES (30449, -1615036, 'I still have some...fight..in...me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14140, 1, 0, 0, 'vesperon SAY_VESPERON_DEATH');
INSERT INTO `script_texts` VALUES (30449, -1615035, 'Was that the best you can do?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14135, 1, 0, 0, 'vesperon SAY_VESPERON_SLAY_2');
INSERT INTO `script_texts` VALUES (30449, -1615034, 'The least you could do is put up a fight...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14134, 1, 0, 0, 'vesperon SAY_VESPERON_SLAY_1');
INSERT INTO `script_texts` VALUES (30449, -1615033, 'You pose no threat, lesser beings...give me your worst!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14133, 1, 0, 0, 'vesperon SAY_VESPERON_AGGRO');
INSERT INTO `script_texts` VALUES (30451, -1615007, 'On your knees!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14116, 1, 0, 0, 'shadron SAY_SHADRON_SPECIAL_2');
INSERT INTO `script_texts` VALUES (30451, -1615006, 'Father tought me well!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14115, 1, 0, 0, 'shadron SAY_SHADRON_SPECIAL_1');
INSERT INTO `script_texts` VALUES (30451, -1615005, 'I will take pity on you Sartharion, just this once.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14117, 1, 0, 0, 'shadron SAY_SHADRON_RESPOND');
INSERT INTO `script_texts` VALUES (30451, -1615004, 'You are easily bested! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14114, 1, 0, 0, 'shadron SAY_SHADRON_BREATH');
INSERT INTO `script_texts` VALUES (30451, -1615003, 'We...are superior! How could this...be...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14118, 1, 0, 0, 'shadron SAY_SHADRON_DEATH');
INSERT INTO `script_texts` VALUES (30451, -1615002, 'Such mediocre resistance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14113, 1, 0, 0, 'shadron SAY_SHADRON_SLAY_2');
INSERT INTO `script_texts` VALUES (30451, -1615001, 'You are insignificant!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14112, 1, 0, 0, 'shadron SAY_SHADRON_SLAY_1');
INSERT INTO `script_texts` VALUES (30451, -1615000, 'I fear nothing! Least of all you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14111, 1, 0, 0, 'shadron SAY_SHADRON_AGGRO');
INSERT INTO `script_texts` VALUES (30452, -1615016, 'I am no mere dragon! You will find I am much, much, more...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14127, 1, 0, 0, 'tenebron SAY_TENEBRON_SPECIAL_2');
INSERT INTO `script_texts` VALUES (30452, -1615015, 'Arrogant little creatures! To challenge powers you do not yet understand...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14126, 1, 0, 0, 'tenebron SAY_TENEBRON_SPECIAL_1');
INSERT INTO `script_texts` VALUES (30452, -1615014, 'It is amusing to watch you struggle. Very well, witness how it is done.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14128, 1, 0, 0, 'tenebron SAY_TENEBRON_RESPOND');
INSERT INTO `script_texts` VALUES (30452, -1615013, 'To darkness I condemn you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14125, 1, 0, 0, 'tenebron SAY_TENEBRON_BREATH');
INSERT INTO `script_texts` VALUES (30452, -1615012, 'I should not... have held back...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14129, 1, 0, 0, 'tenebron SAY_TENEBRON_DEATH');
INSERT INTO `script_texts` VALUES (30452, -1615011, 'Typical... Just as I was having fun.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14124, 1, 0, 0, 'tenebron SAY_TENEBRON_SLAY_2');
INSERT INTO `script_texts` VALUES (30452, -1615010, 'No contest.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14123, 1, 0, 0, 'tenebron SAY_TENEBRON_SLAY_1');
INSERT INTO `script_texts` VALUES (30452, -1615009, 'You have no place here. Your place is among the departed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14122, 1, 0, 0, 'tenebron SAY_TENEBRON_AGGRO');
