INSERT INTO `script_texts` VALUES (32295, -1616034, 'The red dragonflight will take on the burden of mending the devastation wrought on Azeroth. Return home to your people and rest. Tomorrow will bring you new challenges, and you must be ready to face them. Life...goes on.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14409, 1, 0, 0, 'Alexstrasza OUTRO 4');
INSERT INTO `script_texts` VALUES (32295, -1616033, 'This resolution pains me deeply, but the destruction, the monumental loss of life had to end. Regardless of Malygos\' recent transgressions, I will mourn his loss. He was once a guardian, a protector. This day, one of the world\'s mightiest has fallen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14408, 1, 0, 0, 'Alexstrasza OUTRO 3');
INSERT INTO `script_texts` VALUES (32295, -1616032, 'And so ends the Nexus War.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14407, 1, 0, 0, 'Alexstrasza OUTRO 2');
INSERT INTO `script_texts` VALUES (32295, -1616031, 'I did what I had to, brother. You gave me no alternative.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 14406, 1, 0, 0, 'Alexstrasza OUTRO 1');
