INSERT INTO `script_texts` VALUES (32871, -1603019, 'It is in the universe\'s best interest to re-originate this planet should my analysis find systemic corruption. Do not interfere.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15407, 1, 0, 0, 'algalon SAY_SUMMON_3');
