INSERT INTO `script_texts` VALUES (32871, -1603012, 'Witness the fury of cosmos!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15396, 1, 0, 0, 'algalon SAY_BIGBANG_1');
INSERT INTO `script_texts` VALUES (32871, -1603011, 'You are... out of time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15394, 1, 0, 0, 'algalon SAY_BERSERK');
INSERT INTO `script_texts` VALUES (32871, -1603010, 'Do not worry about my fate $N. If the signal is not transmitted in time re-origination will proceed regardless. Save. Your. World.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15404, 1, 0, 0, 'algalon SAY_DEATH_5');
INSERT INTO `script_texts` VALUES (32871, -1603009, 'I lack the strength to transmit the signal. You must hurry. Find a place of power close to the skies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15403, 1, 0, 0, 'algalon SAY_DEATH_4');
INSERT INTO `script_texts` VALUES (32871, -1603008, 'I\'ve rearranged the reply code. Your planet will be spared. I cannot be certain of my own calculations anymore.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15402, 1, 0, 0, 'algalon SAY_DEATH_3');
INSERT INTO `script_texts` VALUES (32871, -1603007, 'Perhaps it is your imperfection that which grants you free will. That allows you to persevere against cosmically calculated odds. You prevailed where the Titans\' own perfect creations have failed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15401, 1, 0, 0, 'algalon SAY_DEATH_2');
INSERT INTO `script_texts` VALUES (32871, -1603006, 'I have seen worlds bathed in the Makers\' flames. Their denizens fading without so much as a whimper. Entire planetary systems born and raised in the time that it takes your mortal hearts to beat once. Yet all throughout, my own heart, devoid of emotion... of empathy. I... have... felt... NOTHING! A million, million lives wasted. Had they all held within them your tenacity? Had they all loved life as you do?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15393, 1, 0, 0, 'algalon SAY_DEATH_1');
INSERT INTO `script_texts` VALUES (32871, -1603005, 'The stars come to my aid.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15392, 1, 0, 0, 'algalon SAY_SUMMON_COLLAPSING_STAR');
INSERT INTO `script_texts` VALUES (32871, -1603004, 'Beware!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15391, 1, 0, 0, 'algalon SAY_PHASE_2');
INSERT INTO `script_texts` VALUES (32871, -1603003, 'See your world through my eyes: A universe so vast as to be immeasurable - incomprehensible even to your greatest minds.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15390, 1, 0, 0, 'algalon SAY_ENGADED_FOR_FIRTS_TIME');
INSERT INTO `script_texts` VALUES (32871, -1603002, 'I do what I must.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15388, 1, 0, 0, 'algalon SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (32871, -1603001, 'Loss of life, unavoidable.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15387, 1, 0, 0, 'algalon SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (32871, -1603000, 'Your actions are illogical. All possible results for this encounter have been calculated. The Pantheon will receive the Observer\'s message regardless of outcome.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15386, 1, 0, 0, 'algalon SAY_AGGRO');
INSERT INTO `script_texts` VALUES (32906, -1603189, 'Eonar, your servant calls for your blessing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15535, 1, 0, 0, 'Freya SAY_YS_HELP');
INSERT INTO `script_texts` VALUES (32906, -1603188, 'The swarm of the elements shall overtake you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15534, 1, 0, 0, 'Freya SAY_SUMMON_LASHERS');
INSERT INTO `script_texts` VALUES (32906, -1603187, 'Children, assist me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15533, 1, 0, 0, 'Freya SAY_SUMMON_TRIO');
INSERT INTO `script_texts` VALUES (32906, -1603186, 'Eonar, your servant requires aid!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15528, 1, 0, 0, 'Freya SAY_SUMMON_CONSERVATOR');
INSERT INTO `script_texts` VALUES (32906, -1603185, 'You have strayed too far, wasted too much time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15532, 1, 0, 0, 'Freya SAY_BERSERK');
INSERT INTO `script_texts` VALUES (32906, -1603184, 'His hold on me dissipates. I can see clearly once more. Thank you, heroes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15531, 1, 0, 0, 'Freya SAY_DEATH');
INSERT INTO `script_texts` VALUES (32906, -1603183, 'From your death springs life anew!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15530, 1, 0, 0, 'Freya SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (32906, -1603182, 'Forgive me.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15529, 1, 0, 0, 'Freya SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (32906, -1603181, 'Elders, grant me your strength!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15527, 1, 0, 0, 'Freya SAY_AGGRO_WITH_ELDER');
INSERT INTO `script_texts` VALUES (32906, -1603180, 'The Conservatory must be protected!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15526, 1, 0, 0, 'Freya SAY_AGGRO');
INSERT INTO `script_texts` VALUES (32913, -1603197, 'Freya! They come for you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15496, 1, 0, 0, 'Elder Ironbranch SAY_DEATH');
