INSERT INTO `script_texts` VALUES (32914, -1603201, 'Matron, flee! They are ruthless....', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15503, 1, 0, 0, 'Elder Stonebark SAY_DEATH');
