INSERT INTO `script_texts` VALUES (32927, -1603032, 'Death is the price of your arrogance.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15659, 1, 0, 0, 'Molgeim SAY_SLAY_2');
