INSERT INTO `script_texts` VALUES (33287, -1603262, 'Give us a moment to prepare to build the turrets.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES (33288, -1603341, 'Your fate is sealed. The end of days is finally upon you and ALL who inhabit this miserable little seedling. Uulwi ifis halahs gag erh\'ongg w\'ssh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15761, 1, 0, 0, 'YoggSaron SAY_DEATH');
INSERT INTO `script_texts` VALUES (33288, -1603340, 'Destroy them minion, your master commands it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15760, 5, 0, 0, 'YoggSaron WHISP_INSANITY_2');
INSERT INTO `script_texts` VALUES (33288, -1603339, 'Your will is no longer you own...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15759, 5, 0, 0, 'YoggSaron WHISP_INSANITY_1');
INSERT INTO `script_texts` VALUES (33288, -1603338, 'Eternal suffering awaits!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15758, 1, 0, 0, 'YoggSaron SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (33288, -1603337, 'Hoohehehahahaha... AHAHAHAHAHAHA!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15757, 1, 0, 0, 'YoggSaron SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (33288, -1603336, 'MADNESS WILL CONSUME YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15756, 1, 0, 0, 'YoggSaron SAY_VISION');
INSERT INTO `script_texts` VALUES (33288, -1603335, 'Look upon the true face of death and know that your end comes soon!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15755, 1, 0, 0, 'YoggSaron SAY_PHASE3');
INSERT INTO `script_texts` VALUES (33288, -1603334, 'BOW DOWN BEFORE THE GOD OF DEATH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'YoggSaron SAY_PHASE2_5');
INSERT INTO `script_texts` VALUES (33288, -1603333, 'Cower before my true form.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'YoggSaron SAY_PHASE2_4');
INSERT INTO `script_texts` VALUES (33288, -1603332, 'The fiend of a thousand faces.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'YoggSaron SAY_PHASE2_3');
INSERT INTO `script_texts` VALUES (33288, -1603331, 'The monster in your nightmares.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'YoggSaron SAY_PHASE2_2');
INSERT INTO `script_texts` VALUES (33288, -1603330, 'I am the lucid dream.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15754, 1, 0, 0, 'YoggSaron SAY_PHASE2_1');
INSERT INTO `script_texts` VALUES (33293, -1603308, 'Time for a new game! My old toys will fight my new toys!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15732, 1, 0, 0, 'XT002 SAY_SUMMON');
INSERT INTO `script_texts` VALUES (33293, -1603307, 'You are bad... Toys... Very... Baaaaad!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15731, 1, 0, 0, 'XT002 SAY_DEATH');
INSERT INTO `script_texts` VALUES (33293, -1603306, 'I\'m tired of these toys. I don\'t want to play anymore!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15730, 1, 0, 0, 'XT002 SAY_BERSERK');
INSERT INTO `script_texts` VALUES (33293, -1603305, 'I guess it doesn\'t bend that way.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15729, 1, 0, 0, 'XT002 SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (33293, -1603304, 'I... I think I broke it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15728, 1, 0, 0, 'XT002 SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (33293, -1603303, 'NO! NO! NO! NO! NO!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15727, 1, 0, 0, 'XT002 SAY_TYMPANIC_TANTRUM');
INSERT INTO `script_texts` VALUES (33293, -1603302, 'I\'m ready to play!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15726, 1, 0, 0, 'XT002 SAY_HEART_CLOSED');
INSERT INTO `script_texts` VALUES (33293, -1603301, 'So tired. I will rest for just a moment!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15725, 1, 0, 0, 'XT002 SAY_HEART_OPENED');
INSERT INTO `script_texts` VALUES (33293, -1603300, 'New toys? For me? I promise I won\'t break them this time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15724, 1, 0, 0, 'XT002 SAY_AGGRO');
INSERT INTO `script_texts` VALUES (33350, -1603259, 'Combat matrix enhanced. Behold wonderous rapidity!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15630, 1, 0, 0, 'Mimiron SAY_YS_HELP');
INSERT INTO `script_texts` VALUES (33350, -1603258, 'Oh, my! It would seem that we are out of time, my friends!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15628, 1, 0, 0, 'Mimiron SAY_BERSERK');
INSERT INTO `script_texts` VALUES (33350, -1603257, 'It would appear that I\'ve made a slight miscalculation. I allowed my mind to be corrupted by the fiend in the prison, overriding my primary directive. All systems seem to be functional now. Clear.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15627, 1, 0, 0, 'Mimiron SAY_V07TRON_DEATH');
INSERT INTO `script_texts` VALUES (33350, -1603256, 'You\'re not going to get up from that one, friend.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15626, 1, 0, 0, 'Mimiron SAY_V07TRON_SLAY_2');
INSERT INTO `script_texts` VALUES (33350, -1603255, 'Prognosis: Negative!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15625, 1, 0, 0, 'Mimiron SAY_V07TRON_SLAY_1');
INSERT INTO `script_texts` VALUES (33350, -1603254, 'Gaze upon its magnificence! Bask in its glorious, um, glory! I present you... V-07-TR-0N!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15624, 1, 0, 0, 'Mimiron SAY_V07TRON_ACTIVATE');
INSERT INTO `script_texts` VALUES (33350, -1603253, 'Preliminary testing phase complete. Now comes the true test!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15623, 1, 0, 0, 'Mimiron SAY_AERIAL_DEATH');
INSERT INTO `script_texts` VALUES (33350, -1603252, 'You can do better than that!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15622, 1, 0, 0, 'Mimiron SAY_AERIAL_SLAY_2');
INSERT INTO `script_texts` VALUES (33350, -1603251, 'Outplayed!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15621, 1, 0, 0, 'Mimiron SAY_AERIAL_SLAY_1');
INSERT INTO `script_texts` VALUES (33350, -1603250, 'Isn\'t it beautiful? I call it the magnificent aerial command unit!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15620, 1, 0, 0, 'Mimiron SAY_AERIAL_ACTIVATE');
INSERT INTO `script_texts` VALUES (33350, -1603249, 'Thank you, friends! Your efforts have yielded some fantastic data! Now, where did I put-- oh, there it is!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15619, 1, 0, 0, 'Mimiron SAY_VX001_DEATH');
INSERT INTO `script_texts` VALUES (33350, -1603248, 'Note to self: Cannon highly effective against flesh.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15618, 1, 0, 0, 'Mimiron SAY_VX001_SLAY_2');
INSERT INTO `script_texts` VALUES (33350, -1603247, 'Fascinating. I think they call that a \"clean kill\".', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15617, 1, 0, 0, 'Mimiron SAY_VX001_SLAY_1');
INSERT INTO `script_texts` VALUES (33350, -1603246, 'Behold the VX-001 Anti-personnel Assault Cannon! You might want to take cover.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15616, 1, 0, 0, 'Mimiron SAY_VX001_ACTIVATE');
INSERT INTO `script_texts` VALUES (33350, -1603245, 'WONDERFUL! Positively marvelous results! Hull integrity at 98.9 percent! Barely a dent! Moving right along.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15615, 1, 0, 0, 'Mimiron SAY_MKII_DEATH');
INSERT INTO `script_texts` VALUES (33350, -1603244, 'I can fix that... or, maybe not! Sheesh, what a mess...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15614, 1, 0, 0, 'Mimiron SAY_MKII_SLAY_2');
INSERT INTO `script_texts` VALUES (33350, -1603243, 'MEDIC!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15613, 1, 0, 0, 'Mimiron SAY_MKII_SLAY_1');
INSERT INTO `script_texts` VALUES (33350, -1603242, 'We haven\'t much time, friends! You\'re going to help me test out my latest and greatest creation. Now, before you change your minds, remember, that you kind of owe it to me after the mess you made with the XT-002.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15612, 1, 0, 0, 'Mimiron SAY_MKII_ACTIVATE');
INSERT INTO `script_texts` VALUES (33350, -1603241, 'Now why would you go and do something like that? Didn\'t you see the sign that said \'DO NOT PUSH THIS BUTTON!\'? How will we finish testing with the self-destruct mechanism active?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15629, 1, 0, 0, 'Mimiron SAY_HARDMODE_ON');
INSERT INTO `script_texts` VALUES (33350, -1603240, 'Oh, my! I wasn\'t expecting company! The workshop is such a mess! How embarrassing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15611, 1, 0, 0, 'Mimiron SAY_AGGRO');
INSERT INTO `script_texts` VALUES (33413, -1603287, 'Golganneth, lend me your strengh! Grant my mortal allies the power of thunder!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15750, 1, 0, 0, 'Thorim SAY_YS_HELP');
INSERT INTO `script_texts` VALUES (33413, -1603286, 'And now it falls to you, champions, to avenge us all! The task before you is great, but I will lend you my aid as I am able. You must prevail!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15749, 1, 0, 0, 'Thorim SAY_END_HARD_3');
INSERT INTO `script_texts` VALUES (33413, -1603285, 'Behold the hand behind all the evil that has befallen Ulduar! Left my kingdom in ruins, corrupted my brother and slain my wife!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15748, 1, 0, 0, 'Thorim SAY_END_HARD_2');
INSERT INTO `script_texts` VALUES (33413, -1603284, 'You! Fiend! You are not my beloved! Be gone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15747, 1, 0, 0, 'Thorim SAY_END_HARD_1');
INSERT INTO `script_texts` VALUES (33413, -1603283, 'I need time to reflect.... I will aid your cause if you should require it. I owe you at least that much. Farewell.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15746, 1, 0, 0, 'Thorim SAY_END_NORMAL_3');
INSERT INTO `script_texts` VALUES (33413, -1603282, 'Sif... was Sif here? Impossible--she died by my brother\'s hand. A dark nightmare indeed....', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15745, 1, 0, 0, 'Thorim SAY_END_NORMAL_2');
INSERT INTO `script_texts` VALUES (33413, -1603281, 'I feel as though I am awakening from a nightmare, but the shadows in this place yet linger.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15744, 1, 0, 0, 'Thorim SAY_END_NORMAL_1');
INSERT INTO `script_texts` VALUES (33413, -1603280, 'Stay your arms! I yield!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15743, 1, 0, 0, 'Thorim SAY_DEATH');
INSERT INTO `script_texts` VALUES (33413, -1603279, 'Failures! Weaklings!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15742, 1, 0, 0, 'Thorim SAY_WIPE');
INSERT INTO `script_texts` VALUES (33413, -1603278, 'My patience has reached its limit!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15741, 1, 0, 0, 'Thorim SAY_BERSERK');
INSERT INTO `script_texts` VALUES (33413, -1603277, 'Pathetic!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15740, 1, 0, 0, 'Thorim SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (33413, -1603276, 'Can\'t you at least put up a fight!?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15739, 1, 0, 0, 'Thorim SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (33413, -1603275, 'Impertinent whelps! You dare challenge me atop my pedestal! I will crush you myself!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15738, 1, 0, 0, 'Thorim SAY_JUMPDOWN');
INSERT INTO `script_texts` VALUES (33413, -1603274, 'Have you begun to regret your intrusion?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15737, 1, 0, 0, 'Thorim SAY_SPECIAL_3');
INSERT INTO `script_texts` VALUES (33413, -1603273, 'Do not hold back! Destroy them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15736, 1, 0, 0, 'Thorim SAY_SPECIAL_2');
INSERT INTO `script_texts` VALUES (33413, -1603272, 'Behold the power of the storms and despair!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15735, 1, 0, 0, 'Thorim SAY_SPECIAL_1');
INSERT INTO `script_texts` VALUES (33413, -1603271, 'I remember you... In the mountains... But you... what is this? Where am--', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15734, 1, 0, 0, 'Thorim SAY_AGGRO_2');
INSERT INTO `script_texts` VALUES (33413, -1603270, 'Interlopers! You mortals who dare to interfere with my sport will pay... Wait--you...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15733, 1, 0, 0, 'Thorim SAY_AGGRO_1');
INSERT INTO `script_texts` VALUES (33515, -1603056, 'Auriaya begins to activate the Feral Defender!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Auriaya - EMOTE_DEFENDER');
INSERT INTO `script_texts` VALUES (33515, -1603055, 'Auriaya begins to cast Terrifying Screech.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Auriaya - EMOTE_FEAR');
INSERT INTO `script_texts` VALUES (33515, -1603054, 'You waste my time!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15477, 1, 0, 0, 'Auriaya SAY_BERSERK');
INSERT INTO `script_texts` VALUES (33515, -1603053, 'Auriaya screams in agony.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 6, 0, 15476, 'Auriaya SAY_DEATH');
INSERT INTO `script_texts` VALUES (33515, -1603052, 'There is no escape!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15475, 1, 0, 0, 'Auriaya SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (33515, -1603051, 'The secret dies with you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15474, 1, 0, 0, 'Auriaya SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (33515, -1603050, 'Some things are better left alone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 15473, 1, 0, 0, 'Auriaya SAY_AGGRO');
INSERT INTO `script_texts` VALUES (33993, -1590002, 'Archavon the Stone Watcher goes into a berserker rage!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'archavon EMOTE_BERSERK');
INSERT INTO `script_texts` VALUES (33993, -1590001, 'A Tempest Minion appears to defend Emalon!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'emalon EMOTE_MINION_RESPAWN');
INSERT INTO `script_texts` VALUES (33993, -1590000, 'Emalon the Storm Watcher overcharges a Tempest Minion!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'emalon EMOTE_OVERCHARGE_TEMPEST_MINION');
INSERT INTO `script_texts` VALUES (36476, -1658021, 'Ick is chasing you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Ick SAY_ICK_CHASE_1');
INSERT INTO `script_texts` VALUES (36476, -1658020, 'Ick begins to unleash a toxic poison cloud!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Ick SAY_ICK_POISON_NOVA');
INSERT INTO `script_texts` VALUES (36477, -1658038, 'Urg... no!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16937, 1, 0, 0, 'Krick SAY_KRICK_OUTRO_8');
INSERT INTO `script_texts` VALUES (36477, -1658036, 'I swear it is true! Please, don\'t kill me!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16936, 1, 0, 0, 'Krick SAY_KRICK_OUTRO_5');
INSERT INTO `script_texts` VALUES (36477, -1658033, 'What you seek is in the master\'s lair, but you must destroy Tyrannus to gain entry. Within the Halls of Reflection you will find Frostmourne. It... it holds the truth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16935, 1, 0, 0, 'Krick SAY_KRICK_OUTRO_3');
INSERT INTO `script_texts` VALUES (36477, -1658030, 'Wait! Stop! Don\'t kill me, please! I\'ll tell you everything!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16934, 1, 0, 0, 'Krick SAY_KRICK_OUTRO_1');
INSERT INTO `script_texts` VALUES (36477, -1658018, 'What are you attacking him for? The dangerous one is over there,fool!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16933, 1, 0, 0, 'Krick SAY_CHASE_3');
INSERT INTO `script_texts` VALUES (36477, -1658017, 'I\'ve changed my mind...go get that one instead!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16932, 1, 0, 0, 'Krick SAY_CHASE_2');
INSERT INTO `script_texts` VALUES (36477, -1658016, 'No! That one! That one! Get that one!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16931, 1, 0, 0, 'Krick SAY_CHASE_1');
INSERT INTO `script_texts` VALUES (36477, -1658015, 'Quickly! Poison them all while they\'re still close!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16930, 1, 0, 0, 'Krick SAY_POISON_NOVA');
INSERT INTO `script_texts` VALUES (36477, -1658014, 'Krick begins rapidly conjuring explosive mines!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Krick SAY_BARRAGE_2');
INSERT INTO `script_texts` VALUES (36477, -1658013, 'Enough moving around! Hold still while I blow them all up!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16929, 1, 0, 0, 'Krick SAY_BARRAGE_1');
INSERT INTO `script_texts` VALUES (36477, -1658012, 'Arms and legs are in short supply...Thanks for your contribution!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16928, 1, 0, 0, 'Krick SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (36477, -1658011, 'Ooh...We could probably use these parts!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16927, 1, 0, 0, 'Krick SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (36477, -1658010, 'Our work must not be interrupted! Ick! Take care of them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16926, 1, 0, 0, 'Krick SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36494, -1658006, 'Garfrost tired of puny mortals. Now your bones will freeze!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16917, 1, 0, 0, 'garfrost SAY_PHASE3');
INSERT INTO `script_texts` VALUES (36494, -1658005, 'Axe too weak. Garfrost make better and CRUSH YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16916, 1, 0, 0, 'garfrost SAY_PHASE2');
INSERT INTO `script_texts` VALUES (36494, -1658004, 'Garfrost hope giant underpants clean. Save boss great shame. For later.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16915, 1, 0, 0, 'garfrost SAY_DEATH');
INSERT INTO `script_texts` VALUES (36494, -1658003, 'That one maybe not so good to eat now. Stupid Garfrost! BAD! BAD!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16914, 1, 0, 0, 'garfrost SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (36494, -1658002, 'Will save for snack. For later.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16913, 1, 0, 0, 'garfrost SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (36494, -1658001, 'Tiny creatures under feet, you bring Garfrost something good to eat!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16912, 1, 0, 0, 'garfrost SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36497, -1632006, 'I will sever the soul from your body!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16600, 1, 0, 0, 'Bronjham SAY_CORRUPT_SOUL');
INSERT INTO `script_texts` VALUES (36497, -1632005, 'The vortex of the harvested calls to you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16599, 1, 0, 0, 'Bronjham SAY_SOUL_STORM');
INSERT INTO `script_texts` VALUES (36497, -1632004, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16598, 1, 0, 0, 'Bronjham SAY_DEATH');
INSERT INTO `script_texts` VALUES (36497, -1632003, 'Another soul to strengthen the host!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16597, 1, 0, 0, 'Bronjham SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (36497, -1632002, 'Fodder for the engine!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16596, 1, 0, 0, 'Bronjham SAY_SLAY_1');
