INSERT INTO `script_texts` VALUES (36597, -1810031, 'The Lich King begins to cast Defile', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810030, 'Watch as the world around you collapses!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17370, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810029, 'Val\'kyr, your master calls!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17373, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810027, 'Frostmourne hungers...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17366, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810025, 'They cannot fear.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17362, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810024, 'Now I stand, the lion before the lambs... and they do not fear.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17361, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810018, 'Impossible...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17358, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810016, 'I delight in the irony.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17357, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810015, 'Watch now as I raise them from the dead to become masters of the Scourge. They will shroud this world in chaos and destruction. Azeroth\'s fall will come at their hands -- and you will be the first to die.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17356, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810014, 'You trained them well, Fordring. You delivered the greatest fighting force this world has ever known... right into my hands -- exactly as I intended. You shall be rewarded for your unwitting sacrifice.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17355, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810013, 'No question remains unanswered. No doubts linger. You are Azeroth\'s greatest champions! You overcame every challenge I laid before you. My mightiest servants have fallen before your relentless onslaught, your unbridled fury... Is it truly righteousness that drives you? I wonder.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17353, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810012, 'Face now your tragic end!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17365, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810011, 'The end has come!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17364, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810010, 'Hope wanes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17363, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810009, 'Bow down before your lord and master!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17372, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810008, 'Apocalypse!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17371, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810007, 'I will freeze you from within until all that remains is an icy husk!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17369, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810005, 'I\'ll keep you alive to witness the end, Fordring. I would not want the Light\'s greatest champion to miss seeing this wretched world remade in my image.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17351, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36597, -1810003, 'You will learn of that first hand. When my work is complete, you will beg for mercy -- and I will deny you. Your anguished cries will be testament to my unbridled power.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17350, 1, 0, 22, '');
INSERT INTO `script_texts` VALUES (36597, -1810001, 'So...the Light\'s vaunted justice has finally arrived. Shall I lay down Frostmourne and throw myself at your mercy, Fordring?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17349, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36612, -1631010, 'Lord Marrowgar creates a whirling storm of bone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Лорд Ребрад распадается, и его кости начинают вращаться', NULL, NULL, 0, 3, 0, 0, 'SAY_BONE_STORM_EMOTE');
INSERT INTO `script_texts` VALUES (36612, -1631009, 'THE MASTER\'S RAGE COURSES THROUGH ME!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Во мне бушует ярость господина!', NULL, NULL, 16945, 1, 0, 0, 'SAY_BERSERK');
INSERT INTO `script_texts` VALUES (36612, -1631008, 'I see... only darkness...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Я вижу... лишь тьму', NULL, NULL, 16944, 1, 0, 0, 'SAY_DEATH');
INSERT INTO `script_texts` VALUES (36612, -1631007, 'Languish in damnation!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Сгинь в вечных муках!', NULL, NULL, 16943, 1, 0, 0, 'SAY_KILL_2');
INSERT INTO `script_texts` VALUES (36612, -1631006, 'More bones for the offering!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Кости, для жертвоприношений!', NULL, NULL, 16942, 1, 0, 0, 'SAY_KILL_1');
INSERT INTO `script_texts` VALUES (36612, -1631005, 'The only escape is death!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Единственный выход - это СМЕРТЬ!', NULL, NULL, 16949, 1, 0, 0, 'SAY_BONESPIKE_3');
INSERT INTO `script_texts` VALUES (36612, -1631004, 'Stick Around!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Постой-ка тут!', NULL, NULL, 16948, 1, 0, 0, 'SAY_BONESPIKE_2');
INSERT INTO `script_texts` VALUES (36612, -1631003, 'Bound by bone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Костяная хватка!', NULL, NULL, 16947, 1, 0, 0, 'SAY_BONESPIKE_1');
INSERT INTO `script_texts` VALUES (36612, -1631002, 'BONE STORM!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ВИХРЬ КОСТЕЙ!', NULL, NULL, 16946, 1, 0, 0, 'SAY_BONE_STORM');
INSERT INTO `script_texts` VALUES (36612, -1631001, 'The Scourge will wash over this world as a swarm of death and destruction!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Плеть накроет этот мир волной смерти и разрушения!', NULL, NULL, 16941, 1, 0, 0, 'SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36612, -1631000, 'This is the beginning AND the end, mortals. None may enter the master\'s sanctum!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Смертные, ваш путь закончится так и не начавшись! Никто не смеет входить  в Обитель Господина!', NULL, NULL, 16950, 1, 0, 0, 'SAY_ENTER_ZONE');
