INSERT INTO `script_texts` VALUES (36658, -1658063, 'Scourgelord Tyrannus roars and swells with dark might!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Tyrannus SAY_DARK_MIGHT_2');
INSERT INTO `script_texts` VALUES (36658, -1658062, 'Power... overwhelming!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16765, 1, 0, 0, 'Tyrannus SAY_DARK_MIGHT_1');
INSERT INTO `script_texts` VALUES (36658, -1658061, 'The frostwyrm Rimefang gazes at $N and readies an icy attack!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'Tyrannus SAY_MARK_RIMEFANG_2');
INSERT INTO `script_texts` VALUES (36658, -1658060, 'Rimefang, destroy this fool!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16764, 1, 0, 0, 'Tyrannus SAY_MARK_RIMEFANG_1');
INSERT INTO `script_texts` VALUES (36658, -1658059, 'Impossible! Rimefang... Warn...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16763, 1, 0, 0, 'Tyrannus SAY_DEATH');
INSERT INTO `script_texts` VALUES (36658, -1658058, 'Perhaps you should have stayed in the mountains!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16762, 1, 0, 0, 'Tyrannus SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (36658, -1658057, 'Such a shameful display... You are better off dead!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16761, 1, 0, 0, 'Tyrannus SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (36658, -1658056, 'I shall not fail The Lich King! Come and meet your end!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16760, 1, 0, 0, 'Tyrannus SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36658, -1658055, 'Ha, such an amusing gesture from the rabble. When I have finished with you, my master\'s blade will feast upon your souls. Die!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16759, 1, 0, 0, 'Tyrannus SAY_TYRANNUS_INTRO_3');
INSERT INTO `script_texts` VALUES (36658, -1658053, 'Alas, brave, brave adventurers, your meddling has reached its end. Do you hear the clatter of bone and steel coming up the tunnel behind you? That is the sound of your impending demise.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16758, 1, 0, 0, 'Tyrannus SAY_TYRANNUS_INTRO_1');
INSERT INTO `script_texts` VALUES (36658, -1658052, 'Rimefang! Trap them within the tunnel! Bury them alive!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16757, 1, 0, 0, 'Tyrannus SAY_GAUNTLET_START');
INSERT INTO `script_texts` VALUES (36658, -1658051, 'Persistent whelps! You will not reach the entrance of my lord\'s lair! Soldiers, destroy them!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16756, 1, 0, 0, 'Tyrannus SAY_AMBUSH_2');
INSERT INTO `script_texts` VALUES (36658, -1658050, 'Your pursuit shall be in vain, adventurers, for the Lich King has placed an army of undead at my command! Behold!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16755, 1, 0, 0, 'Tyrannus SAY_AMBUSH_1');
INSERT INTO `script_texts` VALUES (36658, -1658039, 'Do not think that I shall permit you entry into my master\'s sanctum so easily. Pursue me if you dare.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16754, 1, 0, 0, 'Tyrannus SAY_TYRANNUS_OUTRO_9');
INSERT INTO `script_texts` VALUES (36658, -1658037, 'Worthless gnat! Death is all that awaits you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16753, 1, 0, 0, 'Tyrannus SAY_TYRANNUS_OUTRO_7');
INSERT INTO `script_texts` VALUES (36658, -1658007, 'Another shall take his place. You waste your time.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16752, 1, 0, 0, 'Tyrannus SAY_TYRANNUS_DEATH');
INSERT INTO `script_texts` VALUES (36678, -1631114, 'Bad news, everyone! I don\'t think I\'m going to make it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17117, 1, 0, 0, 'SAY_DEATH');
INSERT INTO `script_texts` VALUES (36678, -1631113, 'Great news, everyone!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17118, 1, 0, 0, 'SAY_BERSERK');
INSERT INTO `script_texts` VALUES (36678, -1631112, 'That was unexpected!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17116, 1, 0, 0, 'SAY_KILL_2');
INSERT INTO `script_texts` VALUES (36678, -1631111, 'Hmm... Interesting...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17115, 1, 0, 0, 'SAY_KILL_1');
