INSERT INTO `script_texts` VALUES (36678, -1631108, 'Tastes like... Cherry! Oh! Excuse me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17121, 1, 0, 15, 'SAY_TRANSFORM_2');
INSERT INTO `script_texts` VALUES (36678, -1631107, 'Hmm. I don\'t feel a thing. Whaa...? Where\'d those come from?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17120, 1, 0, 15, 'SAY_TRANSFORM_1');
INSERT INTO `script_texts` VALUES (36678, -1631106, 'Two oozes, one room! So many delightful possibilities...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17122, 1, 0, 0, 'SAY_PHASE_TRANSITION_HEROIC');
INSERT INTO `script_texts` VALUES (36678, -1631105, '%s begins to cast Unstable Experiment!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_UNSTABLE_EXPERIMENT');
INSERT INTO `script_texts` VALUES (36678, -1631104, 'Good news, everyone! I think I perfected a plague that will destroy all life on Azeroth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17114, 1, 0, 0, 'SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36678, -1631093, 'Terrible news, everyone, Rotface is dead! But great news everyone, he left behind plenty of ooze for me to use! Whaa...? I\'m a poet, and I didn\'t know it? Astounding!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17146, 1, 0, 0, 'SAY_ROTFACE_DEATH');
INSERT INTO `script_texts` VALUES (36678, -1631092, 'Good news, everyone! I\'ve fixed the poison slime pipes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17123, 1, 0, 1, 'SAY_ROTFACE_OOZE_FLOOD2');
INSERT INTO `script_texts` VALUES (36678, -1631091, 'Great news, everyone! The slime is flowing again!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17126, 1, 0, 1, 'SAY_ROTFACE_OOZE_FLOOD1');
INSERT INTO `script_texts` VALUES (36678, -1631090, 'Oh, Festergut. You were always my favorite. Next to Rotface. The good news is you left behind so much gas, I can practically taste it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17124, 1, 0, 0, 'SAY_FESTERGUT_DEATH');
INSERT INTO `script_texts` VALUES (36678, -1631080, 'Just an ordinary gas cloud. But watch out, because that\'s no ordinary gas cloud!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17119, 1, 0, 432, 'SAY_GASEOUS_BLIGHT');
INSERT INTO `script_texts` VALUES (36789, -1666070, 'I am renewed! Ysera grants me the favor to lay these foul creatures to rest!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17071, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666069, 'FAILURES!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17067, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666068, 'A tragic loss...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17066, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666067, 'Forgive me for what I do! I... cannot... stop... ONLY NIGHTMARES REMAIN!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17072, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666066, 'I will not last much longer!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17069, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666065, 'My strength is returning! Press on, heroes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17070, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666064, 'I have opened a portal into the Emerald Dream. Your salvation lies within, heroes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17068, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36789, -1666063, 'Heroes, lend me your aid! I... I cannot hold them off much longer! You must heal my wounds!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17064, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666080, 'Free...at last...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17010, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666079, 'Enough! I tire of these games!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17011, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666078, 'A flaw of mortality...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17009, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666077, 'Perish!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17008, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666076, 'Now feel my master\'s limitless power and despair!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17016, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666075, 'Your incursion ends here! None shall survive!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17012, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666074, 'Aaah! It burns! What sorcery is this?!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17015, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666073, 'Can you feel the cold hand of death upon your heart?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17013, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666072, 'Suffer, mortals, as your pathetic magic betrays you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17014, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36853, -1666071, 'You are fools to have come to this place! The icy winds of Northrend will consume your souls!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17007, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (36855, -1631028, 'All part of the masters plan! Your end is... inevitable!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16871, 1, 0, 0, 'SAY_DEATH');
INSERT INTO `script_texts` VALUES (36855, -1631027, 'This charade has gone on long enough.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16872, 1, 0, 0, 'SAY_BERSERK');
INSERT INTO `script_texts` VALUES (36855, -1631026, 'Embrace the darkness... Darkness eternal!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16870, 1, 0, 0, 'SAY_KILL_2');
INSERT INTO `script_texts` VALUES (36855, -1631025, 'Do you yet grasp of the futility of your actions?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16869, 1, 0, 0, 'SAY_KILL_1');
INSERT INTO `script_texts` VALUES (36855, -1631024, 'Arise and exult in your pure form!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16875, 1, 0, 0, 'SAY_ANIMATE_DEAD');
INSERT INTO `script_texts` VALUES (36855, -1631023, 'I release you from the curse of flesh!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16874, 1, 0, 0, 'SAY_DARK_TRANSFORMATION');
INSERT INTO `script_texts` VALUES (36855, -1631022, 'Take this blessing and show these intruders a taste of our master\'s power.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16873, 1, 0, 0, 'SAY_DARK_EMPOWERMENT');
INSERT INTO `script_texts` VALUES (36855, -1631021, 'You are weak, powerless to resist my will!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16876, 1, 0, 0, 'SAY_DOMINATE_MIND');
INSERT INTO `script_texts` VALUES (36855, -1631020, 'Lady Deathwhisper\'s Mana Barrier shimmers and fades away!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'SAY_PHASE_2_EMOTE');
INSERT INTO `script_texts` VALUES (36855, -1631019, 'Enough! I see I must take matters into my own hands!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16877, 1, 0, 0, 'SAY_PHASE_2');
INSERT INTO `script_texts` VALUES (36855, -1631018, 'What is this disturbance?! You dare trespass upon this hallowed ground? This shall be your final resting place.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16868, 1, 0, 0, 'SAY_AGGRO');
INSERT INTO `script_texts` VALUES (36855, -1631017, 'Those who oppose him will be destroyed utterly, and those who serve -- who serve wholly, unquestioningly, with utter devotion of mind and soul -- elevated to heights beyond your ken.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17271, 1, 0, 0, 'SAY_INTRO_7');
INSERT INTO `script_texts` VALUES (36855, -1631016, 'Through our Master, all things are possible. His power is without limit, and his will unbending.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17270, 1, 0, 0, 'SAY_INTRO_6');
INSERT INTO `script_texts` VALUES (36855, -1631015, 'The sooner you come to accept your condition as a defect, the sooner you will find yourselves in a position to transcend it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17269, 1, 0, 0, 'SAY_INTRO_5');
INSERT INTO `script_texts` VALUES (36855, -1631014, 'It is a weakness; a crippling flaw.... A joke played by the Creators upon their own creations.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17268, 1, 0, 0, 'SAY_INTRO_4');
INSERT INTO `script_texts` VALUES (36855, -1631013, 'Fix your eyes upon your crude hands: the sinew, the soft meat, the dark blood coursing within.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16878, 1, 0, 0, 'SAY_INTRO_3');
INSERT INTO `script_texts` VALUES (36855, -1631012, 'You can see through the fog that hangs over this world like a shroud, and grasp where true power lies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17273, 1, 0, 0, 'SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (36855, -1631011, 'You have found your way here, because you are among the few gifted with true vision in a world cursed with blindness.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17272, 1, 0, 0, 'SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (36990, -1658069, 'I thought he\'d never shut up. At last, Sindragosa silenced that long-winded fool. To the Halls of Reflection, champions! Our objective is near... I can sense it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17036, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO_4');
INSERT INTO `script_texts` VALUES (36990, -1658067, 'Take cover behind me! Quickly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17037, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO_3');
INSERT INTO `script_texts` VALUES (36990, -1658041, 'A fitting end for a traitor. Come, we must free the slaves and see what is within the Lich King\'s chamber for ourselves.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17035, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO_10');
INSERT INTO `script_texts` VALUES (36990, -1658035, 'Frostmourne? The Lich King is never without his blade! If you are lying to me...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17034, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO_4');
INSERT INTO `script_texts` VALUES (36990, -1658032, 'Why should the Banshee Queen spare your miserable life?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17033, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO_2');
INSERT INTO `script_texts` VALUES (36993, -1658070, 'I... I could not save them... Damn you, Arthas! DAMN YOU!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16616, 0, 0, 0, 'Jaina SAY_JAYNA_OUTRO_5');
INSERT INTO `script_texts` VALUES (36993, -1658068, 'The Frost Queen is gone. We must keep moving - our objective is near.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16615, 0, 0, 0, 'Jaina SAY_JAYNA_OUTRO_4');
INSERT INTO `script_texts` VALUES (36993, -1658066, 'Heroes, to me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16614, 1, 0, 0, 'Jaina SAY_JAYNA_OUTRO_3');
INSERT INTO `script_texts` VALUES (36993, -1658040, 'What a cruel end. Come, heroes. We must see if the gnome\'s story is true. If we can separate Arthas from Frostmourne, we might have a chance at stopping him.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16613, 1, 0, 0, 'Jaina SAY_JAINA_OUTRO_10');
INSERT INTO `script_texts` VALUES (36993, -1658034, 'Frostmourne lies unguarded? Impossible!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16612, 1, 0, 0, 'Jaina SAY_JAINA_OUTRO_4');
INSERT INTO `script_texts` VALUES (36993, -1658031, 'I\'m not so naive as to believe your appeal for clemency, but I will listen.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16611, 1, 0, 0, 'Jaina SAY_JAINA_OUTRO_2');
INSERT INTO `script_texts` VALUES (37187, -1631077, 'Honor, young heroes... no matter how dire the battle... Never forsake it!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17102, 0, 0, 0, 'SAY_OUTRO_HORDE_4');
INSERT INTO `script_texts` VALUES (37187, -1631076, 'You will have a proper ceremony in Nagrand next to the pyres of your mother and ancestors.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17101, 0, 0, 0, 'SAY_OUTRO_HORDE_3');
INSERT INTO `script_texts` VALUES (37187, -1631075, 'High Overlord Saurfang weeps over the corpse of his son.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17106, 2, 0, 15, 'SAY_OUTRO_HORDE_2');
INSERT INTO `script_texts` VALUES (37187, -1631074, 'High Overlord Saurfang coughs.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17105, 2, 0, 0, 'SAY_OUTRO_HORDE_1');
INSERT INTO `script_texts` VALUES (37187, -1631067, 'I will not forget this... kindness. I thank you, Highness', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17095, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_15');
INSERT INTO `script_texts` VALUES (37187, -1631066, 'Higher Overlord Saurfang picks up the body of his son and walks over towards Varian', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'SAY_OUTRO_ALLIANCE_14');
INSERT INTO `script_texts` VALUES (37187, -1631065, '[Orcish] No\'ku kil zil\'nok ha tar.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17096, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_13');
INSERT INTO `script_texts` VALUES (37187, -1631064, 'High Overlord Saurfang walks over to his son and kneels before his son\'s body.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'SAY_OUTRO_ALLIANCE_12');
INSERT INTO `script_texts` VALUES (37187, -1631060, 'Behind you lies the body of my only son. Nothing will keep me from him.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17094, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_8');
INSERT INTO `script_texts` VALUES (37187, -1631043, 'High Overlord Saurfang charges!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17104, 2, 0, 53, 'SAY_INTRO_HORDE_8');
INSERT INTO `script_texts` VALUES (37187, -1631042, 'Today, I fulfill that promise.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17100, 0, 0, 397, 'SAY_INTRO_HORDE_7');
INSERT INTO `script_texts` VALUES (37187, -1631041, 'I made a promise to his mother before she died; that I would cross the Dark Portal alone - whether I lived or died, my son would be safe. Untainted...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17099, 0, 0, 1, 'SAY_INTRO_HORDE_6');
INSERT INTO `script_texts` VALUES (37187, -1631040, 'We named him Dranosh. It means \"Heart of Draenor\" in orcish. I would not let the warlocks take him. My boy would be safe, hidden away by the elders of Garadar.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17098, 0, 0, 1, 'SAY_INTRO_HORDE_5');
INSERT INTO `script_texts` VALUES (37187, -1631038, 'My boy died at the Wrath Gate. I am here only to collect his body.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17097, 0, 0, 397, 'SAY_INTRO_HORDE_3');
INSERT INTO `script_texts` VALUES (37187, -1631036, 'Kor\'kron, move out! Champions, watch your backs. The Scourge have been...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17103, 1, 0, 22, 'SAY_INTRO_HORDE_1');
INSERT INTO `script_texts` VALUES (37188, -1631071, 'It was nothing, your majesty. Just... I\'m proud of my king.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16652, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_19');
INSERT INTO `script_texts` VALUES (37188, -1631069, 'Lady Jaina Proudmoore cries.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16651, 2, 0, 18, 'SAY_OUTRO_ALLIANCE_17');
INSERT INTO `script_texts` VALUES (37200, -1631073, 'Right away, yer majesty!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16979, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_21');
INSERT INTO `script_texts` VALUES (37200, -1631061, 'I... I can\'t do it. Get back on yer ship and we\'ll spare yer life.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16973, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_9');
INSERT INTO `script_texts` VALUES (37200, -1631059, 'Don\'t force me hand, orc. We can\'t let ye pass.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16972, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_7');
INSERT INTO `script_texts` VALUES (37200, -1631057, 'Soldiers, fall in! Looks like the Horde are comin\' to take another shot!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16978, 1, 0, 0, 'SAY_OUTRO_ALLIANCE_5');
INSERT INTO `script_texts` VALUES (37200, -1631055, 'What in the... There, in the distance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16977, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_3');
INSERT INTO `script_texts` VALUES (37200, -1631054, 'That was Saurfang\'s boy - the Horde commander at the Wrath Gate. Such a tragic end...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16976, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_2');
INSERT INTO `script_texts` VALUES (37200, -1631053, 'Muradin Bronzebeard gasps for air.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16975, 2, 0, 0, 'SAY_OUTRO_ALLIANCE_1');
INSERT INTO `script_texts` VALUES (37200, -1631033, 'Charge!!!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16971, 1, 0, 0, 'SAY_INTRO_ALLIANCE_5');
INSERT INTO `script_texts` VALUES (37200, -1631032, 'A lone orc against the might of the Alliance???', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16970, 1, 0, 0, 'SAY_INTRO_ALLIANCE_4');
INSERT INTO `script_texts` VALUES (37200, -1631029, 'Let\'s get a move on then! Move ou...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16974, 1, 0, 0, 'SAY_INTRO_ALLIANCE_1');
INSERT INTO `script_texts` VALUES (37221, -1668042, 'You won\'t deny me this Arthas! I must know! I must find out!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16642, 1, 0, 0, 'Jaina SAY_JAINA_INTRO_END');
INSERT INTO `script_texts` VALUES (37221, -1668019, 'Then maybe there is still hope...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16641, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_11');
INSERT INTO `script_texts` VALUES (37221, -1668017, 'Who could bear such a burden?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16640, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_10');
INSERT INTO `script_texts` VALUES (37221, -1668014, 'You\'re right, Uther. Forgive me. I... I don\'t know what got a hold of me. We will deliver this information to the King and the knights that battle the Scourge within Icecrown Citadel.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16639, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_9');
INSERT INTO `script_texts` VALUES (37221, -1668012, 'Tell me how, Uther? How do I destroy my prince? My...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16638, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_8');
INSERT INTO `script_texts` VALUES (37221, -1668010, 'But Uther, if there\'s any hope of reaching Arthas. I... I must try.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16637, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_7');
INSERT INTO `script_texts` VALUES (37221, -1668008, 'Arthas is here? Maybe I...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16636, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_6');
INSERT INTO `script_texts` VALUES (37221, -1668006, 'Uther! Dear Uther! ... I... I\'m so sorry.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16635, 0, 0, 0, 'Jaina SAY_JAINA_INTRO_5');
INSERT INTO `script_texts` VALUES (37221, -1668004, 'Stand back! Touch that blade and your soul will be scarred for all eternity! I must attempt to commune with the spirits locked away within Frostmourne. Give me space, back up please!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16634, 1, 0, 0, 'Jaina SAY_JAINA_INTRO_4');
INSERT INTO `script_texts` VALUES (37221, -1668003, 'Frostmourne! The blade that destroyed our kingdom...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16633, 1, 0, 0, 'Jaina SAY_JAINA_INTRO_3');
INSERT INTO `script_texts` VALUES (37221, -1668002, 'What is that? Up ahead! Could it be... ? Heroes at my side!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16632, 1, 0, 0, 'Jaina SAY_JAINA_INTRO_2');
INSERT INTO `script_texts` VALUES (37221, -1668001, 'The chill of this place... Brr... I can feel my blood freezing.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16631, 1, 0, 0, 'Jaina SAY_JAINA_INTRO_1');
INSERT INTO `script_texts` VALUES (37223, -1668043, 'You will not escape me that easily, Arthas! I will have my vengeance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17057, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_END');
INSERT INTO `script_texts` VALUES (37223, -1668034, 'The Frozen Throne...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17056, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_8');
INSERT INTO `script_texts` VALUES (37223, -1668031, 'Who could bear such a burden?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17055, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_7');
INSERT INTO `script_texts` VALUES (37223, -1668029, 'There must be a way... ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17054, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_6');
INSERT INTO `script_texts` VALUES (37223, -1668027, 'The Lich King is here? Then my destiny shall be fulfilled today!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17053, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_5');
INSERT INTO `script_texts` VALUES (37223, -1668025, 'Uther...Uther the Lightbringer. How...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17052, 0, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_4');
INSERT INTO `script_texts` VALUES (37223, -1668023, 'I dare not touch it. Stand back! Stand back as I attempt to commune with the blade! Perhaps our salvation lies within...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17051, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_3');
INSERT INTO `script_texts` VALUES (37223, -1668022, 'Standing this close to the blade that ended my life... The pain... It is renewed.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17050, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_2');
INSERT INTO `script_texts` VALUES (37223, -1668021, 'I... I don\'t believe it! Frostmourne stands before us, unguarded! Just as the Gnome claimed. Come, heroes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17049, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_INTRO_1');
INSERT INTO `script_texts` VALUES (37225, -1668035, 'I... Aargh... He... He is coming... You... You must...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16665, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_7');
INSERT INTO `script_texts` VALUES (37225, -1668033, 'Alas, the only way to defeat the Lich King is to destroy him at the place he was created.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16664, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_6');
INSERT INTO `script_texts` VALUES (37225, -1668032, 'I do not know, Banshee Queen. I suspect that the piece of Arthas that might be left inside the Lich King is all that holds the Scourge from annihilating Azeroth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16663, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_5');
INSERT INTO `script_texts` VALUES (37225, -1668030, 'Perhaps, but know this: there must always be a Lich King. Even if you were to strike down Arthas, another would have to take his place, for without the control of the Lich King, the Scourge would wash over this world like locusts, destroying all that they touched.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16662, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_4');
INSERT INTO `script_texts` VALUES (37225, -1668028, 'You cannot defeat the Lich King. Not here. You would be a fool to try. He will kill those who follow you and raise them as powerful servants of the Scourge. But for you, Sylvanas, his reward for you would be worse than the last.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16661, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_3');
INSERT INTO `script_texts` VALUES (37225, -1668026, 'You haven\'t much time. The Lich King sees what the sword sees. He will be here shortly.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16660, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_2');
INSERT INTO `script_texts` VALUES (37225, -1668024, 'Careful, girl. I\'ve heard talk of that cursed blade saving us before. Look around you and see what has been born of Frostmourne.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16659, 0, 0, 0, 'Uther SAY_UTHER_INTRO_H2_1');
INSERT INTO `script_texts` VALUES (37225, -1668020, 'No, Jaina! Aargh! He... He is coming! You... You must...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16674, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_9');
INSERT INTO `script_texts` VALUES (37225, -1668018, 'I do not know, Jaina. I suspect that the piece of Arthas that might be left inside the Lich King is all that holds the Scourge from annihilating Azeroth.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16673, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_8');
INSERT INTO `script_texts` VALUES (37225, -1668016, 'A grand sacrifice by a noble soul...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16672, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_7');
INSERT INTO `script_texts` VALUES (37225, -1668015, 'There is... something else that you should know about the Lich King. Control over the Scourge must never be lost. Even if you were to strike down the Lich King, another would have to take his place. For without the control of its master, the Scourge would run rampant across the world - destroying all living things.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16671, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_6');
INSERT INTO `script_texts` VALUES (37225, -1668013, 'Snap out of it, girl. You must destroy the Lich King at the place where he merged with Ner\'zhul - atop the spire, at the Frozen Throne. It is the only way.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16670, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_5');
INSERT INTO `script_texts` VALUES (37225, -1668011, 'Jaina, listen to me. You must destroy the Lich King. You cannot reason with him. He will kill you and your allies and raise you all as powerful soldiers of the Scourge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16669, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_4');
INSERT INTO `script_texts` VALUES (37225, -1668009, 'No, girl. Arthas is not here. Arthas is merely a presence within the Lich King\'s mind. A dwindling presence...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16668, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_3');
INSERT INTO `script_texts` VALUES (37225, -1668007, 'Jaina you haven\'t much time. The Lich King sees what the sword sees. He will be here shortly!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16667, 0, 0, 0, 'Uther SAY_UTHER_INTRO_A2_2');
INSERT INTO `script_texts` VALUES (37225, -1668005, 'Jaina! Could it truly be you?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16666, 1, 0, 0, 'Uther SAY_UTHER_INTRO_A2_1');
INSERT INTO `script_texts` VALUES (37226, -1668038, 'Falric. Marwyn. Bring their corpses to my chamber when you are through.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17227, 1, 0, 0, 'Lich King SAY_LK_INTRO_3');
INSERT INTO `script_texts` VALUES (37226, -1668037, 'So you wish to commune with the dead? You shall have your wish.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17226, 1, 0, 0, 'Lich King SAY_LK_INTRO_2');
INSERT INTO `script_texts` VALUES (37226, -1668036, 'SILENCE, PALADIN!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17225, 1, 0, 0, 'Lich King SAY_LK_INTRO_1');
INSERT INTO `script_texts` VALUES (37592, -1658065, 'This day will stand as a testament not only to your valor, but to the fact that no foe, not even the Lich King himself, can stand when Alliance and Horde set aside their differences and ---', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Gorkun SAY_GORKUN_OUTRO_2');
INSERT INTO `script_texts` VALUES (37592, -1658064, 'Brave champions, we owe you our lives, our freedom... Though it be a tiny gesture in the face of this enormous debt, I pledge that from this day forth, all will know of your deeds, and the blazing path of light you cut through the shadow of this dark citadel.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Gorkun SAY_GORKUN_OUTRO_1');
INSERT INTO `script_texts` VALUES (37592, -1658054, 'Heroes! We will hold off the undead as long as we can, even to our dying breath. Deal with the Scourgelord!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17150, 1, 0, 0, 'Gorkun SAY_GORKUN_INTRO_2');
INSERT INTO `script_texts` VALUES (37596, -1632055, 'The Dark Lady watches over you. Make haste!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17043, 0, 0, 0, 'Sylvanas SAY_INTRO_6');
INSERT INTO `script_texts` VALUES (37596, -1632054, 'Your first mission is to destroy the machines of death within this wretched engine of souls, and clear a path for our soldiers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17042, 0, 0, 0, 'Sylvanas SAY_INTRO_5');
INSERT INTO `script_texts` VALUES (37596, -1632053, 'We will cut a swath of destruction through this cursed place and find a way to enter the Halls of Reflection. If there is anything of value to be found here, it will be found in the Halls.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17041, 0, 0, 0, 'Sylvanas SAY_INTRO_4');
INSERT INTO `script_texts` VALUES (37596, -1632052, 'Our scouts have reported that the Lich King has a private chamber, outside of the Frozen Throne, deep within a place called the Halls of Reflection. That is our target, champions.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17040, 0, 0, 0, 'Sylvanas SAY_INTRO_3');
INSERT INTO `script_texts` VALUES (37596, -1632051, 'With the attention of the Lich King turned towards the front gate, we\'ll be working our way through the side in search of information that will enable us to defeat the Lich King - once and for all.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17039, 0, 0, 0, 'Sylvanas SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (37596, -1632050, 'The Argent Crusade and the Knights of the Ebon Blade have assaulted the gates of Icecrown Citadel and are preparing for a massive attack upon the Scourge. Our missition is a bit more subtle, but equally as important.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17038, 0, 0, 0, 'Sylvanas SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (37597, -1632047, 'Make haste, champions! I will prepare the troops to fall in behind you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16624, 0, 0, 0, 'Jaina SAY_INTRO_8');
INSERT INTO `script_texts` VALUES (37597, -1632046, 'Your first mission is to destroy the machines of death within this malevolent engine of souls, and clear a path for our soldiers.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16623, 0, 0, 0, 'Jaina SAY_INTRO_7');
INSERT INTO `script_texts` VALUES (37597, -1632045, 'We will carve a path through this wretched place and find a way to enter the Halls of Reflection. I sense powerful magic hidden away within those walls... Magic that could be the key to destroy the Scourge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16622, 0, 0, 0, 'Jaina SAY_INTRO_6');
INSERT INTO `script_texts` VALUES (37597, -1632044, 'King Varian\'s SI7 agents have gathered information about a private sanctum of the Lich King\'s deep within a place called the Halls of Reflection.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16621, 0, 0, 0, 'Jaina SAY_INTRO_5');
INSERT INTO `script_texts` VALUES (37597, -1632043, 'With the attention of the Lich King drawn toward the front gate, we will be working our way through the side in search of information that will enable us to defeat the Scourge - once and for all.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16620, 0, 0, 0, 'Jaina SAY_INTRO_4');
INSERT INTO `script_texts` VALUES (37597, -1632042, 'Their success hinges upon what we discover in these cursed halls. Although our mission is a wrought with peril, we must persevere!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16619, 0, 0, 0, 'Jaina SAY_INTRO_3');
INSERT INTO `script_texts` VALUES (37597, -1632041, 'Our allies within the Argent Crusade and the Knights of the Ebon Blade have broken through the front gate of Icecrown and are attempting to establish a foothold within the Citadel.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16618, 0, 0, 0, 'Jaina SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (37597, -1632040, 'Thank the light for seeing you here safely. We have much work to do if we are to defeat the Lich King and put an end to the Scourge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16617, 0, 0, 0, 'Jaina SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (37813, -1631052, 'I... Am... Released.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16697, 1, 0, 0, 'SAY_DEATH');
INSERT INTO `script_texts` VALUES (37813, -1631051, 'I have become...DEATH!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16698, 1, 0, 0, 'SAY_BERSERK');
INSERT INTO `script_texts` VALUES (37813, -1631050, 'Deathbringer Saurfang goes into frenzy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'SAY_FRENZY');
INSERT INTO `script_texts` VALUES (37813, -1631049, 'Your soul will find no redemption here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16696, 1, 0, 0, 'SAY_KILL_2');
INSERT INTO `script_texts` VALUES (37813, -1631048, 'You are nothing!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16695, 1, 0, 0, 'SAY_KILL_1');
INSERT INTO `script_texts` VALUES (37813, -1631047, 'Feast, my minions!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16700, 1, 0, 0, 'SAY_BLOOD_BEASTS');
INSERT INTO `script_texts` VALUES (37813, -1631046, 'The ground runs red with your blood!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16699, 1, 0, 0, 'SAY_MARK_OF_THE_FALLEN_CHAMPION');
INSERT INTO `script_texts` VALUES (37813, -1631045, 'BY THE MIGHT OF THE LICH KING!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16694, 1, 0, 0, 'SAY_AGGRO');
INSERT INTO `script_texts` VALUES (37813, -1631044, 'Pathetic old orc. Come then heroes. Come and face the might of the Scourge!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16706, 1, 0, 15, 'SAY_INTRO_HORDE_9');
INSERT INTO `script_texts` VALUES (37813, -1631039, 'Stubborn and old. What chance do you have? I am stronger, and more powerful than you ever were.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16705, 1, 0, 5, 'SAY_INTRO_HORDE_4');
INSERT INTO `script_texts` VALUES (37813, -1631037, 'Join me, father. Join me and we will crush this world in the name of the Scourge -- for the glory of the Lich King!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16704, 1, 0, 0, 'SAY_INTRO_HORDE_2');
INSERT INTO `script_texts` VALUES (37813, -1631035, 'Deathbringer Saurfang immobilizes Muradin and his guards.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2, 0, 0, 'SAY_INTRO_ALLIANCE_7');
INSERT INTO `script_texts` VALUES (37813, -1631034, 'Dwarves...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16703, 1, 0, 0, 'SAY_INTRO_ALLIANCE_6');
INSERT INTO `script_texts` VALUES (37813, -1631031, 'Things are about to get much worse. Come, taste the power that the Lich King has bestowed upon me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16702, 1, 0, 0, 'SAY_INTRO_ALLIANCE_3');
INSERT INTO `script_texts` VALUES (37813, -1631030, 'For every Horde soldier that you killed -- for every Alliance dog that fell, the Lich King\'s armies grew. Even now the val\'kyr work to raise your fallen as Scourge.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16701, 1, 0, 0, 'SAY_INTRO_ALLIANCE_2');
INSERT INTO `script_texts` VALUES (37879, -1631072, 'Bah! Muradin, secure the deck and prepare our soldiers for an assault on the upper citadel. I\'ll send out another regiment from Stormwind.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16693, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_20');
INSERT INTO `script_texts` VALUES (37879, -1631070, 'Jaina? Why are you crying?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16692, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_18');
INSERT INTO `script_texts` VALUES (37879, -1631068, 'I... I was not at the Wrath Gate, but the soldiers who survived told me much of what happened. Your son fought with honor. He died a hero\'s death. He deserves a hero\'s burial.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16691, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_16');
INSERT INTO `script_texts` VALUES (37879, -1631063, 'Stand down, Muradin. Let a grieving father pass.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16690, 0, 0, 0, 'SAY_OUTRO_ALLIANCE_11');
INSERT INTO `script_texts` VALUES (37955, -1666062, 'But... we were getting along... so well...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16794, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666061, 'THIS ENDS NOW!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16793, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666060, 'Here it comes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16788, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666059, 'Yes... feed my precious one! You\'re mine now! ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16790, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666058, 'Can you handle this?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16787, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666057, 'SUFFER!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16786, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666056, 'Know my hunger!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16784, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666055, 'Just a taste...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16783, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666054, 'You have made an... unwise... decision.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16782, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37955, -1666053, 'Is that all you got?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16791, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (37970, -1631139, '...why...?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16683, 1, 0, 0, 'SAY_VALANAR_DEATH');
INSERT INTO `script_texts` VALUES (37970, -1631138, 'BOW DOWN BEFORE THE SAN\'LAYN!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16684, 1, 0, 0, 'SAY_VALANAR_BERSERK');
INSERT INTO `script_texts` VALUES (37970, -1631137, 'Do you see NOW the power of the Darkfallen?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16682, 1, 0, 0, 'SAY_VALANAR_KILL_2');
INSERT INTO `script_texts` VALUES (37970, -1631136, 'Dinner... is served.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16681, 1, 0, 0, 'SAY_VALANAR_KILL_1');
INSERT INTO `script_texts` VALUES (37970, -1631135, '%s begins casting Empowered Schock Vortex!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_VALANAR_SHOCK_VORTEX');
INSERT INTO `script_texts` VALUES (37970, -1631134, 'My cup runneth over.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16686, 1, 0, 0, 'SAY_VALANAR_SPECIAL');
INSERT INTO `script_texts` VALUES (37970, -1631133, 'Invocation of Blood jumps to Prince Valanar!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_VALANAR_INVOCATION');
INSERT INTO `script_texts` VALUES (37970, -1631132, 'Naxxanar was merely a setback! With the power of the orb, Valanar will have his vengeance!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16685, 1, 0, 0, 'SAY_VALANAR_INVOCATION');
INSERT INTO `script_texts` VALUES (37972, -1631123, 'My queen... they come...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16725, 1, 0, 0, 'SAY_KELESETH_DEATH');
INSERT INTO `script_texts` VALUES (37972, -1631122, '%s cackles maniacally!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16726, 2, 0, 0, 'EMOTE_KELESETH_BERSERK');
INSERT INTO `script_texts` VALUES (37972, -1631121, 'Truth is found in death.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16724, 1, 0, 0, 'SAY_KELESETH_KILL_2');
INSERT INTO `script_texts` VALUES (37972, -1631120, 'Were you ever a threat?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16723, 1, 0, 0, 'SAY_KELESETH_KILL_1');
INSERT INTO `script_texts` VALUES (37972, -1631119, 'Blood will flow!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16728, 1, 0, 0, 'SAY_KELESETH_SPECIAL');
INSERT INTO `script_texts` VALUES (37972, -1631118, 'Invocation of Blood jumps to Prince Keleseth!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_KELESETH_INVOCATION');
INSERT INTO `script_texts` VALUES (37972, -1631117, 'Such wondrous power! The Darkfallen Orb has made me INVINCIBLE!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16727, 1, 0, 0, 'SAY_KELESETH_INVOCATION');
INSERT INTO `script_texts` VALUES (37973, -1631131, '%s gurgles and dies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16855, 2, 0, 0, 'EMOTE_TALDARAM_DEATH');
INSERT INTO `script_texts` VALUES (37973, -1631130, '%s laughs.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16856, 2, 0, 0, 'EMOTE_TALDARAM_BERSERK');
INSERT INTO `script_texts` VALUES (37973, -1631129, 'Beg for mercy!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16854, 1, 0, 0, 'SAY_TALDARAM_KILL_2');
INSERT INTO `script_texts` VALUES (37973, -1631128, 'Worm food.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16853, 1, 0, 0, 'SAY_TALDARAM_KILL_1');
INSERT INTO `script_texts` VALUES (37973, -1631127, 'Inferno Flames speed toward $N!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_TALDARAM_FLAME');
INSERT INTO `script_texts` VALUES (37973, -1631126, 'Delight in the pain!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16858, 1, 0, 0, 'SAY_TALDARAM_SPECIAL');
INSERT INTO `script_texts` VALUES (37973, -1631125, 'Invocation of Blood jumps to Prince Taldaram!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 3, 0, 0, 'EMOTE_TALDARAM_INVOCATION');
INSERT INTO `script_texts` VALUES (37973, -1631124, 'Tremble before Taldaram, mortals, for the power of the orb flows through me!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16857, 1, 0, 0, 'SAY_TALDARAM_INVOCATION');
INSERT INTO `script_texts` VALUES (38004, -1631116, 'Rise up, brothers, and destroy our enemies.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16796, 1, 0, 0, 'SAY_INTRO_2');
INSERT INTO `script_texts` VALUES (38004, -1631115, 'Foolish mortals. You thought us defeated so easily? The San\'layn are the Lich King\'s immortal soldiers! Now you shall face their might combined!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16795, 1, 0, 1, 'SAY_INTRO_1');
INSERT INTO `script_texts` VALUES (38112, -1668055, 'Fear... so exhilarating...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16716, 1, 0, 0, 'Falric SAY_DEFILING_HORROR');
INSERT INTO `script_texts` VALUES (38112, -1668054, 'Despair... so delicious...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16715, 1, 0, 0, 'Falric SAY_IMPENDING_DESPAIR');
INSERT INTO `script_texts` VALUES (38112, -1668053, 'Marwyn, finish them...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16713, 1, 0, 0, 'Falric SAY_DEATH');
INSERT INTO `script_texts` VALUES (38112, -1668052, 'The children of Stratholme fought with more ferocity!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16712, 1, 0, 0, 'Falric SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (38112, -1668051, 'Sniveling maggot!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16711, 1, 0, 0, 'Falric SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (38112, -1668050, 'Men, women and children... None were spared the master\'s wrath. Your death will be no different.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16710, 1, 0, 0, 'Falric SAY_AGGRO');
INSERT INTO `script_texts` VALUES (38112, -1668041, 'Soldiers of Lordaeron, rise to meet your master\'s call!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16714, 1, 0, 0, 'Falric SAY_FALRIC_INTRO_2');
INSERT INTO `script_texts` VALUES (38112, -1668039, 'As you wish, my lord.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16717, 1, 0, 0, 'Falric SAY_FALRIC_INTRO_1');
INSERT INTO `script_texts` VALUES (38113, -1668065, 'Waste away into nothingness!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16740, 1, 0, 0, 'Marwyn SAY_CORRUPTED_FLESH_2');
INSERT INTO `script_texts` VALUES (38113, -1668064, 'Your flesh has decayed before your very eyes!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16739, 1, 0, 0, 'Marwyn SAY_CORRUPTED_FLESH_1');
INSERT INTO `script_texts` VALUES (38113, -1668063, 'Yes... Run... Run to meet your destiny... Its bitter, cold embrace, awaits you.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16737, 1, 0, 0, 'Marwyn SAY_DEATH');
INSERT INTO `script_texts` VALUES (38113, -1668062, 'Choke on your suffering!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16736, 1, 0, 0, 'Marwyn SAY_SLAY_2');
INSERT INTO `script_texts` VALUES (38113, -1668061, 'I saw the same look in his eyes when he died. Terenas could hardly believe it. Hahahaha!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16735, 1, 0, 0, 'Marwyn SAY_SLAY_1');
INSERT INTO `script_texts` VALUES (38113, -1668060, 'Death is all that you will find here!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16734, 1, 0, 0, 'Marwyn SAY_AGGRO');
INSERT INTO `script_texts` VALUES (38113, -1668040, 'As you wish, my lord.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16741, 1, 0, 0, 'Marwyn SAY_MARWYN_INTRO_1');
INSERT INTO `script_texts` VALUES (38160, -1632029, 'Excellent work, champions! We shall set up our base camp in these chambers. My mages will get the Scourge transport device working shortly. Step inside it when you\'re ready for your next mission. I will meet you on the other side.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 16625, 1, 0, 0, 'Jaina SAY_JAINA_OUTRO');
INSERT INTO `script_texts` VALUES (38161, -1632030, 'Excellent work, champions! We shall set up our base camp in these chambers. My mages will get the Scourge transport device working shortly. Step inside when you are ready for your next mission. I will meet you on the other side.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17044, 1, 0, 0, 'Sylvanas SAY_SYLVANAS_OUTRO');
INSERT INTO `script_texts` VALUES (38579, -1810023, 'Rise up, champions of the Light!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17398, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38579, -1810021, 'Free at last! It is over, my son. This is the moment of reckoning.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17397, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38995, -1810022, 'The Lich King must fall!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17389, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38995, -1810020, 'No more, Arthas! No more lives will be consumed by your hatred!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17393, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38995, -1810017, 'LIGHT, GRANT ME ONE FINAL BLESSING. GIVE ME THE STRENGTH... TO SHATTER THESE BONDS!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17392, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38995, -1810006, 'Come then champions, feed me your rage!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17352, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (38995, -1810004, 'So be it. Champions, attack!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17391, 1, 0, 397, '');
INSERT INTO `script_texts` VALUES (38995, -1810002, 'We will grant you a swift death, Arthas. More than can be said for the thousands you\'ve tortured and slain.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 17390, 1, 0, 0, '');
INSERT INTO `script_texts` VALUES (40586, -1643006, 'The abyss awaits!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Lady Naz\'jar SAY_KILL_2');
INSERT INTO `script_texts` VALUES (40586, -1643005, 'Depths take you!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Lady Naz\'jar SAY_KILL_1');
INSERT INTO `script_texts` VALUES (40586, -1643004, 'Ulthok... stop them...', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Lady Naz\'jar SAY_DEATH');
INSERT INTO `script_texts` VALUES (40586, -1643003, 'Destroy these intruders! Leave them for the great dark beyond!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Lady Naz\'jar SAY_REPETANCE_33_PRECENT');
INSERT INTO `script_texts` VALUES (40586, -1643002, 'Take arms, minions! Rise from the icy depths!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Lady Naz\'jar SAY_66_PRECENT');
