INSERT INTO `script_texts` VALUES (40765, -1643018, 'I am... weary. You must carry on without me. I shall take my leave once my strength has returned.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, 0, 0, 'Erunak Stonespeaker SAY_WIN_ERUNAK');
