INSERT INTO `script_texts` VALUES (40765, -1643010, 'They do not die.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 5, 0, 0, 'Commander Ulthok SAY_DEATH_WHISP');
